y farmers to keep an eye on crops, or by civil organizations to inspect infrastructure for safety. \n\nIn the US, commercial applications of flying drones are regulated by the Federal Aviation Administration (FAA). The drone commercial era will begin with the announcement of the FAA\'s rules for integrating drones into the National Air Space by 2015. Much like the 1889 Oklahoma Land Rush, an avalanche of disruptive commercial drone applications and services is bound to emerge. \n\nVLAB is excited to host a panel of innovative entrepreneurs and experts to discuss commercial drone technology, its potential for the future, and implications on daily life. Join us in March for a robust discussion by a diverse set of panelist. Learn what your opportunities are as the commercial era of drones takes off. \n\nCome join us to hear a Panel of Experts discuss how entrepreneurs can build businesses and capitalize on this disruption. \n\nPanelists:\nHelen Greiner, CEO CyPhyWorks \nZack Schildhorn, Lux Capital \nChris Anderson, CEO of 3D Robotics and founder of DIY Drone \nMatthew Pobloske, Director Unmanned Aircraft Programs at BAE Systems \n\nEvent Twitter Hashtag: #VLABdrones \n\nRegister now ',NULL,'tom.rikert@wildfireapp.com','tom.rikert@wildfireapp.com','2011-01-17 17:26:55','2013-03-04 05:03:17','0',0,NULL,NULL),(1400,122,'87sh617is7fdbh3bovmg7vap6c',NULL,'Brunch - Rikerts / Adracti','2013-03-23 10:00:00','2013-03-23 11:00:00',0,'',NULL,'monica@adractas.com','monica@adractas.com','2013-03-07 06:30:08','2013-03-11 05:36:13','0',0,NULL,NULL),(1398,122,'1r059m741s9stqk441buqh3hlg',NULL,'Vimbli. Tom/ Hennie','2013-03-18 07:30:00','2013-03-18 08:20:00',0,'',NULL,'hennies@gmail.com','hennies@gmail.com','2013-03-14 12:02:16','2013-03-14 15:20:23','0',0,NULL,NULL),(1399,122,'vpfkdig49a5q2a5meeguikd200_20130314T020000Z',NULL,'CG','2013-03-13 19:00:00','2013-03-13 21:00:00',0,'',NULL,'Tom Rikert','tomrikert@gmail.com','2012-09-23 23:49:23','2013-03-14 00:42:32','0',0,NULL,NULL),(1394