est in the CG Norm and I will be co-leading this year!  We\'re so excited that you\'ve decided to join us!  Norm and I decided to start this group because we were both craving deep spiritual discussions and a strong sense of community, and we know you will all contribute so much to the group :)\n \nOur first meeting will be next Wednesday, October 3rd, from 7:30 - 9p, location TBD (it will either be at my apartment or Norm\'s; stay tuned for details. I wanted to get this out now though so that you can get this date on your calendars)!  \n \nUnfortunately I won\'t be able to make it to The Prologue this Wednesday night, but I would encourage you all to go if you are able so that you can learn more about the study we\'ll be doing as a church this season - Leaving Egypt: Finding God in the Wilderness Places, by Chuck DeGroat.  Gary, I do have your book here, as well as one extra copy if you need one Chris (I know you have yours Jeo!).\n \nHere is a link to more information on The Prologue: http://www.citychurchsf.org/site/calendar/details/more/event_id/28908/\n \nIf you know of anyone else that would be interested in joining this group and think they\'d be a good fit, please feel free to pass this email on to them or put them in touch with me.  Norm has a friend that will also be joining us, and we may have one or two additional City Church members here for our first meeting as well.\n \nPlease let me know if you have any questions.  We look forward to seeing you in just over a week!  \n \n \nSincerely,\n \n \nKim\n(925) 788-2199\n\n',NULL,'Chris Palm','chrispalm2007@gmail.com','2012-11-04 06:03:53','2012-11-04 06:03:50','0',0,NULL,NULL),(1505,152,'1364437800_60q30c1g60o30e1i60o4ac1g60rj8gpl88rj2c1h84s34h9g60s30c1g60o30c1g88o3ggpk6go30ga2750k6h1g64o30c1g60o30c1g60o30c1g60o32c1g60o30c1g712k6cph6sq38d24611k6dpk8l130hhg8cp38c1h6os44e1p64pg',NULL,'Kim & Norm CG','2013-03-27 19:30:00','2013-03-27 21:00:00',0,'Gary, Chris and Jeo!\n \nThank you all for expressing interest in the CG Norm and I will be co-leading this year!  We\'re so excited that you\'ve decided to join us!  Norm and I decided to start this group because we were both craving deep spiritual discussions and a strong sense of community, and we know you will all contribute so much to the group :)\n \nOur first meeting will be next Wednesday, October 3rd, from 7:30 - 9p, location TBD (it will either be at my apartment or Norm\'s; stay tuned for details. I wanted to get this out now though so that you can get this date on your calendars)!  \n \nUnfortunately I won\'t be able to make it to The Prologue this Wednesday night, but I would encourage you all to go if you are able so that you can learn more about the study we\'ll be doing as a church this season - Leaving Egypt: Finding God in the Wilderness Places, by Chuck DeGroat.  Gary, I do have your book here, as well as one extra copy if you need one Chris (I know you have yours Jeo!).\n \nHere is a link to more information on The Prologue: http://www.citychurchsf.org/site/calendar/details/more/event_id/28908/\n \nIf you know of anyone else that would be interested in joining this group and think they\'d be a good fit, please feel free to pass this email on to them or put them in touch with me.  Norm has a friend that will also be joining us, and we may have one or two additional City Church members here for our first meeting as well.\n \nPlease let me know if you have any questions.  We look forward to seeing you in just over a week!  \n \n \nSincerely,\n \n \nKim\n(925) 788-2199\n\n',NULL,'Chris Palm','chrispalm2007@gmail.com','2012-11-04 06:03:53','2012-11-04 06:03:50','0',0,NULL,NULL),(1506,152,'1363721400_60q30c1g60o30e1i60o4ac1g60rj8gpl88rj2c1h84s34h9g60s30c1g60o30c1g68o48gq484qk8gho75246h1g64o30c1g60o30c1g60o30c1g60o32c1g60o30c1g84rj6gpk7123ae9i6gqjac1k85142e9p7514ch1o68rjeh9p6h2g',NULL,'Midday Process Check','2013-03-19 12:30:00','2013-03-19 13:00:00',0,'\n',NULL,'Chris Palm','chrispalm2007@gmail.com','2012-09-29 03:3