sitting) for just one minute and a way to keep track of time. Set the timer for one minute. Close your eyes and try to focus on one of the following three things: the sounds around you, your breathing, or the sensations in your toes.\n*tSounds. Scan your environment for sound. Imagine your ears are satellite dishes passively and objectively registering sounds.\n*tBreath. Focus on your breath and the sensations it creates in your nostrils or stomach as it goes in and out. Pay attention to one breath at a time, but try to notice everything about this one breath. Imagine that your breath is someone you want to give your full attention to. \n*tToes. Focus your attention on the sensations in your toes. This forces your mind to sweep through your body, helping your  to get into the physical sensations of the moment. \n\n\nPower - Visualization\nThe following visualization exercise is a great tool to increase the amount of power you want to convey. You can try this exercise at home on the couch, at work sitting at your desk, or even in an elevator - whenever you have an opportunity to close your eyes for a minute:\n*tClose your eyes and relax.\n*tRemember a past experience when you felt absolutely triumphant:\notBeating up Greg Mulner and Jack Segal, stuffing dirty in their mouths and getting rewarded with La Luna\notWinning the race at Cub Scout camp\notBeating Ethan Bauman in the Gill debate\notDominating the scrimmage at County All-Star practice\notArguing all the liberals into submission at UCSB and USC\notGetting A\'s in English Senior Seminar from the best professors for your writing\notBEA Oracle OpenWorld byline\notCyberwar on US Op-Ed \notLynam best man speech\n*tHear the sounds in the room: the murmurs of approval, the swell of applause.\n*tHear the praise people have for you as they share it with each other. \n*tSee people\'s smiles and expressions of warmth and admiration.\n*tFeel your feet on the ground and the congratulatory handshakes.\n*tAbove all, experience your feelings, the warm glow of confidence rising within you.\n*tEach time you do this exercise, work to create images that are event more detailed. Guided imagery must be precise, vivid, and detailed to be effective:\notSpeaking to groups of people\notSpeaking to large audiences\notSpeaking to superiors to present your ideas and solutions\notDebating a peer before an audience\n*tPresentations. Visualize you giving an amazing presentation and the enthusiasm of the crowd; arrive early to the presentation location to visualize on site\n*tMeetings. Before important meetings - imagine the smiles on their faces, that they liked you, and they are confident about the value you are bringing; imagine as much detail\n*tAnxiousness. Imagine yourself getting a hug from someone you care about.\n\n\nWarmth: Gratitude\nFocus on the present: Next time you find yourself annoyed  at some minor thing, remember that letting your mind focus on the annoyance could impair your body language..\n*tSweep through your body from head to toe and find three abilities you approve of. You could be grateful you can walk; that you can read, and that you have sight and hearing. You might appreciate the ability to read and enjoy music.. \notthank God that i can walk\notthank God for my ability to read write and enjoy music\notthank God for my health\n*tScan your environment for three pleasant sights - even the smallest ones enjoy them for a short time\n\nUse a third person lens: Take time with a pen and paper to sit down and do the following exercises:\n*tSpend a few minutes describing your life through the lens of another: \notâ€œChris Palm lives in a beautiful apartment in the affluent Marina District of San Francisco. You can often find him at his living room desk either working or enjoying one of his many history books and periodically glancing out at the sailboats, the bay and across the bay to Sausalito. He drives a sleek silver Porsche convertible and can be seen around town in stylish restaurants and bars in the early evening with a lovely crowd of friends. He has loving parents, loyal and loving friends, and is liked and appreciated by just about everybody who knows him.  He attends a wonderful church and is beginning to spread his wings as a leader within that community and socially around the city. He works with high level executives as a corporate communications specialist to help them navigate the media landscapes of crises, business leadership transitions, and corporate rebranding initiatives. He also does a great deal of ghost writing for executive bylines and OpEds and has begun writing a book on the history of the City and the Valley with another friend who loves history. Last year he launched his own PR consulting firm. He is healthy, handsome, athletic in build, well-read, and looks a few years younger than he really is.â€\n*tWrite about your job - the work you do and the people you work with. Describe your personal relationships and the good things friends and family members would say about you. Mention a few positive things that have happened today and the tasks you have already accomplished.\n*tImagine your funeral - http://www.CharismaMyth.com/funeral \n\n\nWarmth: Compassion\nGoodwill, Empathy, and Compassion give you warmth to balance your power, and can save you from appearing overconfident or, worse, arrogant. \n*tGoodwill means that you wish someone well without necessarily knowing how they\'re feeling. \n*tEmpathy means you understand what they feel; perhaps you\'ve had a similar experience in the past.\n*tCompassion is Empathy plus Goodwill: you understand how they feel, and you wish them well.\n\nTake these three steps to practice compassion for someone you know:\n*tImagine their past. What if you had been born in their circumstances, with their family and upbringing? What was it like growing up in their family situation with whatever they experienced as a child? Everyone has stories to tell, and everyone has a few that would break your heart. Consider also that if you had experienced everything they have experienced, perhaps you would have turned out just like they have.\n*tImagine their present. Try to put yourself in their shoes right now. Imagine what it feels like to be them today. Put yourself in their place, be in their skin, see through their eyes. Imagine what they might be feeling right now - all the emotions they might be holding inside.\n*tWhat if this is the last day alive? You can even imagine their funeral. You\'re at their funeral, and you\'re asked to say a few words about them. You can also imagine what you\'d say to them after they\'d already died. \n\n\nSelf-Compassion\nKeep a self-compassion list. Jot down five ways in which you already care for yourself when you\'re having a hard time. If you\'re on a roll, go for ten. Star those that are particularly effective.\n*t.\n*t.\n*t.\n*t.\n*t.\n\n\nMetta - Developing compassion:  http://CharismaMyth.com/metta \n\n\nBody Language - Be Patton or TR\nTry out the following postures to see for yourself just how powerfully the arrangement of your body can affect your mind and your feelings. \n*tPhysically spring into excitement. Jump up and down as if you\'ve won the election, smile the biggest smile you can, wave your arms in the air, and while doing all this, note that its difficult to feel depress or small.\n*tBe the general. For confidence, assertiveness, and to be able to emanate gravitas, imagine playing the role of a military general - take a wide stance, puff up your chest, broaden your shoulders, stand straight, and confidently put your arms behind your back. Feel the effect of this posture internally.\n*tFor a boost in both energy and warmth, stand up, stretch your hands as high as possible, inhale as much as you can - imagine your rib cage expanding, doubling in size - make the biggest smile you can and look upward, hold for a second, and then relax everything.\n\n\nVoice Fluctuation - Communicate the way a judge asserts\nYou can gain great insights into your own voice fluctuation by practicing sentences with a tape recorder. Repeat a sentence several times with a variation in styles as y',NULL,'Chris Palm','chrispalm2007@gmail.com','2012-09-28 09:32:28','2012-09-28 09:32:34','0',0,NULL,NULL),(1529,152,'1363980600_b94l0mhd60rk8gpg74ok6b9g60okcb9g74p30ba68ookab9g60rj6e8',NULL,'Midday Check-In - A','2013-03-22 12:30:00','2013-03-22 13:00:00',0,'\n\nGaining and Maintaining Presence\nFind a reasonably quiet place when you can close your eyes (whether standing or sitting) for just one minute and a way to keep track of time. Set the timer for one minute. Close your eyes and try to focus on one of the following three things: the sounds around you, your breathing, or the sensations in your toes.\n*tSounds. Scan your environment for sound. Imagine your ears are satellite dishes passively and objectively registering sounds.\n*tBreath. Focus on your breath and the sensations it creates in your nostrils or stomach as it goes in and out. Pay attention to one breath at a time, but try to notice everything about this one breath. Imagine that your breath is someone you want to give your full attention to. \n*tToes. Focus your attention on the sensations in your toes. This forces your mind to sweep through your body, helping your  to get into the physical sensations of the moment. \n\n\nPower - Visualization\nThe following visualization exercise is a great tool to increase the amount of power you want to convey. You can try this exercise at home on the couch, at work sitting at your desk, or even in an elevator - whenever you have an opportunity to close your eyes for a minute:\n*tClose your eyes and relax.\n*tRemember a past experience when you felt absolutely triumphant:\notBeating up Greg Mulner and Jack Segal, stuffing dirty in their mouths and getting rewarded with La Luna\notWinning the race at Cub Scout camp\notBeating Ethan Bauman in the Gill debate\notDominating the scrimmage at County A