company, and the San Francisco ferry will depart from Pier 41 at: 9:45am, 11:45am, and 2:20pm with return ferries at: 12:25pm, 3:20pm, and 4:30pm.\n\nThe ferry takes about 20 minutes and costs $17 round trip.\n\nIn terms of the main group, we will plan to take the 11:45am ferry to the island, and the 4:30pm ferry back.  You are of course welcome to come and go earlier or later.\n\n\nFood/Drinks:\n\nThere will be BBQ pits, and we will coordinate BBQ staples (burgers, hot dogs, etc.), as well as beer, soda, and water.  Feel free to bring anything else you might want, but the plan is that you  should be able to just bring yourself and be ok.\n\n\nGuests:\n\nFamily and friends are WELCOME.  We have a capacity of 100 people at the picnic site, so I don\'t anticipate it being a problem.\n\n\nFunding:\n\nI will have a suggested donation available when I have all of the costs in, but I don\'t expect it to be prohibitive, and I will adjust it for students and families.  I will also waive the suggested donation if you sign up for the Alumni Board\'s paypal recurring donation program :)\n\n\nQuestions:\n\nDon\'t hesitate to email me.',NULL,'tom@a16z.com','tom@a16z.com','2013-04-21 05:04:04','2013-05-16 05:03:29','0',0,NULL,NULL),(13260,189,'rqhn0lqg1dni4ua1pbk95o4jc4_20130517T050000Z',NULL,'Sleep','2013-05-17 05:00:00','2013-05-17 12:50:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-02-07 23:07:45','2013-02-07 23:07:45','0',0,NULL,NULL),(13261,189,'rqhn0lqg1dni4ua1pbk95o4jc4_20130514T050000Z',NULL,'Sleep','2013-05-14 05:00:00','2013-05-14 12:50:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-02-07 23:07:45','2013-02-07 23:07:45','0',0,NULL,NULL),(13262,189,'rqhn0lqg1dni4ua1pbk95o4jc4_20130518T050000Z',NULL,'Sleep','2013-05-18 05:00:00','2013-05-18 12:50:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-02-07 23:07:45','2013-02-07 23:07:45','0',0,NULL,NULL),(13263,189,'rqhn0lqg1dni4ua1pbk95o4jc4_20130519T050000Z',NULL,'Sleep','2013-05-19 05:00:00','