uctions to access traditional teleconference information:\n\nStep 1) Using the instructions at the bottom of this e-mail, connect to the Web portion of this event 10 minutes prior to the start time.\n\nStep 2) Close the small broadcast dialog box, which will be displayed in the upper left of your screen.\n\nStep 3) Click the â€œRequestâ€ button in the Participant Panel on the right side of your screen.\n\nStep 4) Dial into the teleconference line from your phone using the information which will be provided in a pop-up box (please be sure to disable your pop-up blocker).\n\nIf you have any questions or experience any difficulty joining the session, please send an e-mail to alumni_relations@mckinsey.com or call +1-216-274-4460. We look forward to having you join us! \n\nBest regards,\n\nSean Brown\nDirector of Alumni Relations\nhttp://alumni.mckinsey.com\n-------------------------------------------------------\n\nTopic: Reinventing Leadership Development for the 21st Century\nHost: McKinsey Alumni Relations\nDate and Time:\nThursday, May 30, 2013 11:00 am, Eastern Daylight Time (New York, GMT-04:00)\nThursday, May 30, 2013 8:00 am, Pacific Daylight Time (San Francisco, GMT-07:00)\nThursday, May 30, 2013 4:00 pm, GMT Summer Time (London, GMT+01:00)\nFriday, May 31, 2013 12:00 am, Japan Time (Tokyo, GMT+09:00)\nEvent number: 665 676 832\nRegistration ID: This event does not require a registration ID\nEvent password: Leadership1\n\n-------------------------------------------------------\nTo join the online event \n-------------------------------------------------------\n Click here  to join the online event.\nOr copy and paste the following link to a browser: \n https://mckinseyevents.webex.com/mckinseyevents/onstage/g.php?d=665676832&t=a&jf=1&rId=&EA=hennies%40gmail.com&ET=33ddbf950926ad09504a7d9e3502d138&ETR=2918ca15b37b207ab9e09c49bc849541&RT=MiMxMQ==&p\n\nTo view in other time zones or languages, please click the link:\nhttps://mckinseyevents.webex.com/mckinseyevents/onstage/g.php?d=665676832&t=a&jf=1&rId=&EA=hennies%40gmail.com&ET=33ddbf950926ad09504a7d9e3502d138&ETR=2918ca15b37b207ab9e09c49bc849541&ORT=MiMxMQ==&p\n\nAudio will be delivered via an audio stream to your computer speakers. If you have challenges with the audio, please click the \"Event Info\" tab at the top of your WebEx window for teleconference information.\n\n-------------------------------------------------------\nFor assistance\n-------------------------------------------------------\nYou may also contact the alumni relations team by sending an e-mail to alumni_relations@mckinsey.com or calling +1-216-274-4460. \n\nTo join the event more quickly, you can set up Event Manager before the event starts. Go to: https://mckinseyevents.webex.com/mckinseyevents/ecsetup.php?frommail=1\n\nThe playback of UCF (Universal Communications Format) rich media files requires appropriate players. To view this type of rich media files in the meeting, please check whether you have the players installed on your computer by going to https://mckinseyevents.webex.com/mckinseyevents/onstage/systemdiagnosis.php\n\n\nIMPORTANT NOTICE: This WebEx service includes a feature that allows audio and any documents and other materials exchanged or viewed during the session to be recorded. By joining this session, you automatically consent to such recordings. If you do not consent to the recording, discuss your concerns with the meeting host prior to the start of the recording or do not join the session. Please note that any such recordings may be subject to discovery in the event of litigation. \n\n',NULL,'Hennie Strydom','hennies@gmail.com','2013-05-19 20:31:37','2013-05-19 20:31:39','0',0,NULL,NULL),(13887,189,'l5v3h0c72cpsj2cv492mj76flc_20130602T050000Z',NULL,'Sleep Dec 1','2013-06-02 05:00:00','2013-06-02 12:00:00',0,' ',NULL,'Hennie Strydom','hennies@gmail.com','2012-12-01 20:49:51','2013-05-22 22:47:03','0',0,NULL,NULL),(13888,189,'3pjn745lo8ovf3v3i98meuj894_20130525T043000Z',NULL,'Refl