rydom','hennies@gmail.com','2013-07-02 21:07:19','2013-07-02 21:07:19','0',0,'2013-07-03 07:00:00','2013-07-03 10:00:00'),(15169,239,'fd7uhu4b7v3mbkj7s84s2v248s',NULL,'One pager user experience. A16Z. ','2013-07-03 10:00:00','2013-07-03 11:00:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-07-02 21:07:20','2013-07-02 21:07:20','0',0,'2013-07-03 10:00:00','2013-07-03 11:00:00'),(15170,239,'21323c8c2i7snrfid8vm8pgjfg',NULL,'Andy / Hennie. Catchup. VC/ Vimbli and life in general.','2013-07-09 15:30:00','2013-07-09 16:20:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-07-02 18:16:30','2013-07-02 21:11:32','0',0,'2013-07-09 15:30:00','2013-07-09 16:20:00'),(15171,239,'384tgc8j946erc2flr961lo2u0',NULL,'Vimbli call','2013-08-06 07:30:00','2013-08-06 08:00:00',0,'Tom - I would like you to consider #4.  The rest is really just context.  \nWe need to discuss our view of the future.  My suggestion would be to start on the call, and then potentially to follow-up with an in person session or two. \n\n1.  Open\n\n2.  Earthquakes\n- On hold. They are figuring out the offer to the person they want for the HR role. \n- My take:  Will happen, but nothing will happen in the next 2 weeks.  Probably a day a week for 2-3 months, with a couple of hours ongoing after the initial couple of months. The commute is not ideal, but the organization is a good reference client. \n\n3.  My perspective on rolling out the Earthquakes-like consulting servcies  to 2-3 clients\nPro\'s:  Technically feasible, and the demand is there.\nCon\'s:\n- I will have less time to allocate to the development of Vimbli, and will have to spend more in client service (and no, development Vimbli does not equal client service ... the solution is only a small part of what the clients want)\n- I will have less predictability in my schedule, and quite a bit of uncertainty in the business (compared to running a solution based startup, or working for a more established firm in a Leadership & Development role)\n\n>> The short:  Funding Vimbli via consulting gigs is doable, but will not be very energizing/ attractive, and based on my assessment it will put a tremendous strain on my relationship with Simone and others, and my health. \n\n4.  I would like to hear your thoughts on the elephant in the room: \n- Why would we not call it quits on Vimbli as it is structured today?  \n- How does it look if we continue?\n- How does it look if we fold it?\n\n5.  Close\n',NULL,'Tom Rikert','tom@a16z.com','2013-08-06 00:43:00','2013-08-06 12:27:51','0',0,'2013-08-06 07:30:00','2013-08-06 08:00:00'),(15172,172,'3pjn745lo8ovf3v3i98meuj894_20130719T043000Z',NULL,'Reflect. Celebrate day. Anticipate tomorrow. ','2013-07-19 05:30:00','2013-07-19 06:00:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-01-23 07:09:03','2013-01-23 07:09:03','0',0,'2013-07-18 21:30:00','2013-07-18 22:00:00'),(15173,172,'l5v3h0c72cpsj2cv492mj76flc_20130724T050000Z',NULL,'Sleep Dec 1','2013-07-24 06:00:00','2013-07-24 13:00:00',0,' ',NULL,'Hennie Strydom','hennies@gmail.com','2012-12-01 20:49:51','2013-05-22 22:47:03','0',0,'2013-07-23 22:00:00','2013-07-24 05:00:00'),(15174,172,'k60bsod1p2scs5midngj3irfa8_20130716T143000Z',NULL,'Vimbil Board Call','2013-07-16 07:30:00','2013-07-16 08:00:00',0,'415-595-8641',NULL,'Tom Rikert','tomrikert@gmail.com','2013-01-04 17:18:49','2013-01-04 17:21:22','0',0,'2013-07-16 07:30:00','2013-07-16 08:00:00'),(15175,172,'l5v3h0c72cpsj2cv492mj76flc_20130725T050000Z',NULL,'Sleep Dec 1','2013-07-25 06:00:00','2013-07-25 13:00:00',0,' ',NULL,'Hennie Strydom','hennies@gmail.com','2012-12-01 20:49:51','2013-05-22 22:47:03','0',0,'2013-07-24 22:00:00','2013-07-25 05:00:00'),(15176,172,'3pjn745lo8ovf3v3i98meuj894_20130717T043000Z',NULL,'Reflect. Celebrate day. Anticipate tomorrow. ','2013-07-16 21:30:00','2013-07-16 22:00:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-01-23 07:09:03','2013-01-23 07:09:03','0',0,'2013-07-16 21:30:00','2013-07-16 22:00:00'),(15177