Travel back to 211 Masonic','2013-07-25 18:00:00','2013-07-25 18:50:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-07-25 14:44:21','2013-07-25 14:44:24','0',0,'2013-07-25 10:00:00','2013-07-25 10:50:00'),(15217,172,'9pm6bdqu5p8i733ctfq62ct614',NULL,'Check in with Jim Argalas','2013-07-17 07:00:00','2013-07-17 07:25:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-06-25 15:28:24','2013-06-25 15:28:24','0',0,'2013-07-17 07:00:00','2013-07-17 07:25:00'),(15218,172,'384tgc8j946erc2flr961lo2u0',NULL,'Vimbli call','2013-08-06 15:30:00','2013-08-06 16:00:00',0,'Tom - I would like you to consider #4.  The rest is really just context.  \nWe need to discuss our view of the future.  My suggestion would be to start on the call, and then potentially to follow-up with an in person session or two. \n\n1.  Open\n\n2.  Earthquakes\n- On hold. They are figuring out the offer to the person they want for the HR role. \n- My take:  Will happen, but nothing will happen in the next 2 weeks.  Probably a day a week for 2-3 months, with a couple of hours ongoing after the initial couple of months. The commute is not ideal, but the organization is a good reference client. \n\n3.  My perspective on rolling out the Earthquakes-like consulting servcies  to 2-3 clients\nPro\'s:  Technically feasible, and the demand is there.\nCon\'s:\n- I will have less time to allocate to the development of Vimbli, and will have to spend more in client service (and no, development Vimbli does not equal client service ... the solution is only a small part of what the clients want)\n- I will have less predictability in my schedule, and quite a bit of uncertainty in the business (compared to running a solution based startup, or working for a more established firm in a Leadership & Development role)\n\n>> The short:  Funding Vimbli via consulting gigs is doable, but will not be very energizing/ attractive, and based on my assessment it will put a tremendous strain on my relationship with Simone and others, and my health. \n\n4.  I would like to hear your thoughts on the elephant in the room: \n- Why would we not call it quits on Vimbli as it is structured today?  \n- How does it look if we continue?\n- How does it look if we fold it?\n\n5.  Close\n',NULL,'Tom Rikert','tom@a16z.com','2013-08-06 00:43:00','2013-08-06 12:27:51','0',0,'2013-08-06 07:30:00','2013-08-06 08:00:00'),(15219,172,'_60q30c1g60o30e1i60o4ac1g60rj8gpl88rj2c1h84s34h9g60s30c1g60o30c1g8ko32di5651kch1g712k6h9g64o30c1g60o30c1g60o30c1g60o32c1g60o30c1g68sk8dhj611kcgpm8l24cghk8p13ed9g8914ad1m84ok2gpg6crg',NULL,'Clockwork Discussion with Hennie Strydom, Simon Francis, and Christian Spletzer','2013-08-06 16:30:00','2013-08-06 17:30:00',0,'------------\r\nFrom:	Simon Francis\r\nSent:	Thursday, August 01, 2013 3:45 PM\r\nTo:	Hennie Strydom; Christian Spletzer\r\nCc:	Clockwork Recruiting\r\nSubject:	Re: Clockwork Recruiting Investment Summary\r\n\r\nYes that works for me\r\n\r\nKind regards,\r\n\r\nSimon J. Francis\r\nLancor\r\nSuite 2500\r\n120 Kearny\r\nSan Francisco\r\nCA94108\r\n\r\nMobile: +650 315 7351 \r\nFrom: Hennie Strydom\r\nSent: Thursday, August 1, 2013 3:43 PM\r\nTo: Christian Spletzer\r\nCc: Clockwork Recruiting; Simon Francis\r\nSubject: RE: Clockwork Recruiting Investment Summary\r\n\r\n\r\nPeet\'s in the Ferry Building at 830 next Tuesday can work. \r\nOr somewhere else close. \r\n/hs\r\n\r\nTuesday could work. Simon and I have a 10 AM on the Embarcadero. Could  you meet at 8:30 around that part of town?\r\n\r\n \r\n\r\n                                           \r\n\r\nChristian M. Spletzer\r\n\r\nFounder, Clockwork Recruiting\r\n\r\n(415) 246-9517 <tel:%28415%29%20246-9517>  (cell)\r\n\r\n(925) 386-0746 <tel:%28925%29%20386-0746>  (direct)\r\n\r\nwww.clockworkrecruiting.com <http://www.clockworkrecruiting.com/> \r\n\r\n \r\n\r\nHelp Questions? Email us at:\r\n\r\nsupport@clockworkrecruiting.com\r\n\r\n \r\n\r\n \r\n\r\ncid:image001.jpg@01CD023A.823B8570 <http://www.clockworkrecru