likely will revisit structure of business. Both corporate and cost structure. \n- In short: I\'m still very interested in the self realization space. Not convinced the current Vimbli approach provides me with the best, most feasible, opportunities.\n\n4. SD\n- received referral credit of about $3k\n- available for followup work\n- pending #3 I may  not use it\n\n5. Close',NULL,'Tom Rikert','tom@a16z.com','2013-07-24 05:29:27','2013-07-24 12:37:44','0',0,'2013-07-24 07:30:00','2013-07-24 08:00:00'),(15458,189,'4ib785f3jkd5tm0cdafa3dn3uk',NULL,'Travel back to 211 Masonic','2013-07-25 10:00:00','2013-07-25 10:50:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-07-25 14:44:21','2013-07-25 14:44:24','0',0,'2013-07-25 10:00:00','2013-07-25 10:50:00'),(15459,189,'vn3la9g4mjeioomv74j6tklcpc',NULL,'Vimbli - pitch A16Z','2013-07-25 11:00:00','2013-07-25 12:20:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-07-25 14:44:37','2013-07-25 14:44:39','0',0,'2013-07-25 11:00:00','2013-07-25 12:20:00'),(15460,189,'5r46rn1j8nkhn9n5j0slen5k8k',NULL,'Follow up with Ajay on outstanding questions','2013-07-25 12:30:00','2013-07-25 13:20:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-07-25 14:45:16','2013-07-25 14:45:16','0',0,'2013-07-25 12:30:00','2013-07-25 13:20:00'),(15461,189,'384tgc8j946erc2flr961lo2u0',NULL,'Vimbli call','2013-08-06 07:30:00','2013-08-06 08:00:00',0,'Tom - I would like you to consider #4.  The rest is really just context.  \nWe need to discuss our view of the future.  My suggestion would be to start on the call, and then potentially to follow-up with an in person session or two. \n\n1.  Open\n\n2.  Earthquakes\n- On hold. They are figuring out the offer to the person they want for the HR role. \n- My take:  Will happen, but nothing will happen in the next 2 weeks.  Probably a day a week for 2-3 months, with a couple of hours ongoing after the initial couple of months. The commute is not ideal, but the organization is a good reference client. \n\n3.  My perspective on rolling out the Earthquakes-like consulting servcies  to 2-3 clients\nPro\'s:  Technically feasible, and the demand is there.\nCon\'s:\n- I will have less time to allocate to the development of Vimbli, and will have to spend more in client service (and no, development Vimbli does not equal client service ... the solution is only a small part of what the clients want)\n- I will have less predictability in my schedule, and quite a bit of uncertainty in the business (compared to running a solution based startup, or working for a more established firm in a Leadership & Development role)\n\n>> The short:  Funding Vimbli via consulting gigs is doable, but will not be very energizing/ attractive, and based on my assessment it will put a tremendous strain on my relationship with Simone and others, and my health. \n\n4.  I would like to hear your thoughts on the elephant in the room: \n- Why would we not call it quits on Vimbli as it is structured today?  \n- How does it look if we continue?\n- How does it look if we fold it?\n\n5.  Close\n',NULL,'Tom Rikert','tom@a16z.com','2013-08-06 00:43:00','2013-08-06 12:27:51','0',0,'2013-08-06 07:30:00','2013-08-06 08:00:00'),(15462,207,'k60bsod1p2scs5midngj3irfa8_20130730T143000Z',NULL,'Vimbil Board Call','2013-07-30 15:30:00','2013-07-30 16:00:00',0,'415-595-8641',NULL,'Tom Rikert','tomrikert@gmail.com','2013-01-04 17:18:49','2013-01-04 17:21:22','0',0,'2013-07-30 07:30:00','2013-07-30 08:00:00'),(15463,207,'lumapi0h8m2h942uvdd1lgg7nc',NULL,'Dinner with Sagers?','2013-08-03 03:30:00','2013-08-03 05:00:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-07-29 22:14:56','2013-07-29 22:48:38','0',0,'2013-08-02 19:30:00','2013-08-02 21:00:00'),(15464,207,'50qkgpblmju7pebvlj14tpgris',NULL,'Call Yaosh','2013-08-08 02:30:00','2013-08-08 03:00:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-08-08 18:13:13','2013-08-08 18:13:13','0',0,'2013-08-07 18:30:00','2013-08-07 19:00:00'),(15465,207,'p7j1dp6qubof1a3