0erg',NULL,'Tom J Rehearsal Dinner','2013-07-19 03:00:00','2013-07-19 06:00:00',0,'--------- Forwarded message ----------\nFrom: Tom Jozefowicz <canman4295@yahoo.com>\nDate: Mon, Jul 15, 2013 at 6:31 AM\nSubject: This Week\nTo: Chris Hoffman <downbynature77@gmail.com>, william brooks 3 <n_achoman427@hotmail.com>, Brad Leach <chloroxjr@verizon.net>, Andy Jozefowicz <baldysinclair@aol.com>, Tom Rikert <tom.rikert@gmail.com>, \"jjozefowicz@hvc.rr.com\" <jjozefowicz@hvc.rr.com>, Jim Jozefowicz <jimjozef@iup.edu>\n\n\nHi Guys,\n \nHere\'s some info about this week.  I\'ll be in touch with each of you in case you have any questions.\n \nThursday:  Rehearsal is at the First Congregation United Church of Christ (269 Mill St. Poughkeepsie, NY  12601) at 4pm\n                 Rehearsal dinner is at Umberto\'s of Mama Marisa\'s on Rt. 9 in Poughkeepsie (Rt. 9 South right next to Red Lobster) at 5:30pm\n \nFriday:      Please be at the Church by 2pm.  We\'ll meet in the \"Swartz Parlor\" of the Church (I\'ll keep an eye out for everyone to get you to the right\n                place).  The Swartz Parlor is Air Conditioned so we can stay cool.  You probably want to arrive mostly dressed in your Tux....finishing\n                touches can be done at the Church.\n                Ceremony is at 3pm.  I\'ll probably need you guys to help inform people the Cocktail Hour begins at 6pm at the Grandview.  Missy and I\n                aren\'t doing a \"receiving line\" after the wedding \'cause it\'s going to be HOT! \n                After everyone leaves the Church, we\'ll hang out for some brief pictures.  We\'ll then go to the Grandview to cool off and take               pictures    there.\n \nMissy\'s Stepfather is driving she and I to the Grandview.  You guys will need to coordinate travel from the Church to the Grandview since we don\'t have a limo or anything.  It\'s only a few miles away from the Church. \n \nI\'m sure there are lots of things I\'ve forgetten to cover in this email.  Bear with me and I\'ll be in touch.\n \nThank!\n \nT-Bone\n',NULL,'Tom Rikert','tomrikert@gmail.com','2013-07-04 22:15:01','2013-07-16 03:55:36','0',0,'2013-07-18 19:00:00','2013-07-18 22:00:00'),(15472,207,'3hj3k52utmp7dc68al0okom23g',NULL,'Vimbli board call','2013-07-24 15:30:00','2013-07-24 16:00:00',0,'Tom I am good to do our call tomorrow.\n\nLet me know if you are available.\n\nThings I want to cover:\n1. Update... Teryn/you, Colton, Simone, me\n\n2. Clients:\n- Earthquakes \n- RelateIQ\n-... And I just realized I still owe you an updated ppt\n\n3.  My thinking? \n- I\'m planning on exploring non-Vimbli options in August. \n- Also will be testing interest from folks who could take Vimbli fwd\n- If non-Vimbli likely will revisit structure of business. Both corporate and cost structure. \n- In short: I\'m still very interested in the self realization space. Not convinced the current Vimbli approach provides me with the best, most feasible, opportunities.\n\n4. SD\n- received referral credit of about $3k\n- available for followup work\n- pending #3 I may  not use it\n\n5. Close',NULL,'Tom Rikert','tom@a16z.com','2013-07-24 05:29:27','2013-07-24 12:37:44','0',0,'2013-07-24 07:30:00','2013-07-24 08:00:00'),(15473,207,'73sm1b6j46ld0jrdiqksrlcim4',NULL,'Priority emails: Martin','2013-07-25 17:30:00','2013-07-25 18:00:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-07-25 16:03:42','2013-07-25 16:13:31','0',0,'2013-07-25 09:30:00','2013-07-25 10:00:00'),(15474,207,'5arc84vkrrtvtlc7m9vcmlhao0',NULL,'Dinner with Joglekars','2013-08-12 02:30:00','2013-08-12 05:30:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-08-12 15:36:44','2013-08-12 15:36:47','0',0,'2013-08-11 18:30:00','2013-08-11 21:30:00'),(15475,207,'13ud9b6vjqrkucc5cd921fn030',NULL,'Lift','2013-08-07 03:30:00','2013-08-07 04:30:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-08-06 15:38:52','2013-08-06 15:38:56','0',0,'2013-08-06 19:30:00','2013-08-06 20:30:00'),(15689,204,'t1q40gtvablsah7p9n0t5kfp