ion','2013-08-06 22:30:00','2013-08-06 23:00:00',0,'Attendees:\nMicah Loucks (loucks.micah@gmail.com)\n\nService: Complimentary initial consultation\nMeetMe page: David Evans\nPhone number: 6508677756\n\nCancel/Reschedule link: meetme.so/jeditrainers&update=NjM5MTQz\n\nNote from Micah Loucks:\nHi David,\nI\'m not sure I currently qualify as an entrepreneur, but I am currently thinking along those lines. I read one of your testimonials that mentioned you gave him \"soul coaching\" and that\'s more along the lines of what I need. I am going through something akin to a midlife crisis at the moment, but it\'s more about what do I want to do with the next phase of my life. I got into the gaming industry in my late twenties, and started at the bottom and worked my way up the chain at EA and them moved to Sony and then finally Zynga. I have been on the game producer track since 2001 and have only gotten as high as senior producer. I\'ve had the benefit of working with some industry leaders, made some good connections, but was never all that interested in trying to elevate to the executive level in these organizations. Feel free to take a look at my LinkedIn profile for some context on my experience.\nI have a family now and priorities have changed somewhat. I\'m having trouble making the work-life balance sacrifices make sense. I\'m not afraid to work hard, I never have been but now I\'m re-evaluating the reason for doing so. \nIn any case, the crux of my issue is I have lots of ideas floating around my head and I need to focus so I can formulate clear and concise action. I\'ve taken quite a bit of time off from work to just spend time with my wife and kids and and try and think about what to do next. The family time has been great but the problem is I still don\'t know what I want to do. \nI realize I may not possess the kind of professional aptitude as many of your clients but I\'m hoping you will agree to help me out nonetheless. \n\nAdditional information:\nI will call you at your scheduled appointment time.',NULL,'David Evans','david@jeditrainers.com','2013-08-05 15:49:48','2013-08-05 15:49:48','0',0,'2013-08-06 14:30:00','2013-08-06 15:00:00'),(15530,212,'bvempc7h0e8f5kcc4amih6i98g',NULL,'Travel time','2013-08-07 19:30:00','2013-08-08 00:30:00',0,NULL,NULL,'David Evans','david@jeditrainers.com','2013-07-15 19:19:26','2013-08-06 18:02:24','0',0,'2013-08-07 11:30:00','2013-08-07 16:30:00'),(15531,212,'5bduo82kffp42a2cjsacob516k',NULL,'Anne M #stoked','2013-08-06 20:00:00','2013-08-06 20:30:00',0,NULL,NULL,'David Evans','david@jeditrainers.com','2013-08-05 18:20:25','2013-08-05 19:58:14','0',0,'2013-08-06 12:00:00','2013-08-06 12:30:00'),(15532,212,'004c65ng8v3mdl9akt5toh8p4g',NULL,'Jeremy UGaWo','2013-08-06 18:00:00','2013-08-06 19:00:00',0,NULL,NULL,'David Evans','david@jeditrainers.com','2013-08-02 16:52:10','2013-08-06 14:47:04','0',0,'2013-08-06 10:00:00','2013-08-06 11:00:00'),(15533,212,'m95tdnpc1qcqvjl82drfkq3sv4_20130723T180000Z',NULL,'CPCC Triad Call','2013-07-23 19:00:00','2013-07-23 20:30:00',0,NULL,NULL,'David Evans','david@jeditrainers.com','2013-03-24 16:56:18','2013-03-24 16:56:18','0',0,'2013-07-23 11:00:00','2013-07-23 12:30:00'),(15534,212,'iis8vrmmt5g40ouaredod48bm0_20130724T140000Z',NULL,'Garbage & Recycling','2013-07-24 15:00:00','2013-07-24 15:00:00',0,NULL,NULL,'David Evans','david@jeditrainers.com','2013-03-24 16:56:41','2013-03-24 16:56:41','0',0,'2013-07-24 07:00:00','2013-07-24 07:00:00'),(15535,212,'f15c3ctfq33lcbrnknpdpkrimg_20130721T170000Z',NULL,'Change Kitty Litter','2013-07-21 18:00:00','2013-07-21 18:00:00',0,NULL,NULL,'David Evans','david@jeditrainers.com','2013-03-24 16:58:17','2013-03-24 16:58:17','0',0,'2013-07-21 10:00:00','2013-07-21 10:00:00'),(15536,212,'iamnkf5fr6tnqk4i5uu370uii0',NULL,'Rebekah - Long phone appointment','2013-08-08 22:45:00','2013-08-08 23:30:00',0,'Attendees:\nRebekah (rebekah.moan@gmail.com)\n\nService: Long phone appointment\nMeetMe page: Jedi Trainers Phone Appointme