- $25\n  *   APF - $50\n  *   GED - $20\n  *   EMV - $30\n\nEMV status â€“ call out, Sept. mtgs (NK)\nEmerging Mgrs program â€“ update (AZ, SM)\nRFPs, RFIs â€“ update (SM)\n',NULL,'Kevin Brennan','brennkp@gmail.com','2013-08-05 16:50:43','2013-08-05 16:50:48','0',0,'2013-08-05 16:00:00','2013-08-05 17:00:00'),(16165,189,'3pjn745lo8ovf3v3i98meuj894_20130807T043000Z',NULL,'Reflect. Celebrate now. Plan. ','2013-08-06 21:30:00','2013-08-06 22:00:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-01-23 07:09:03','2013-08-04 23:00:30','0',0,'2013-08-06 21:30:00','2013-08-06 22:00:00'),(16295,189,'3pjn745lo8ovf3v3i98meuj894_20130816T043000Z',NULL,'Reflect. Celebrate now. Plan. ','2013-08-15 21:30:00','2013-08-15 22:00:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-01-23 07:09:03','2013-08-04 23:00:30','0',0,'2013-08-15 21:30:00','2013-08-15 22:00:00'),(16469,172,'l5v3h0c72cpsj2cv492mj76flc_20130818T050000Z',NULL,'Sleep Dec 1','2013-08-18 06:00:00','2013-08-18 13:00:00',0,' ',NULL,'Hennie Strydom','hennies@gmail.com','2012-12-01 20:49:51','2013-05-22 22:47:03','0',0,'2013-08-17 22:00:00','2013-08-18 05:00:00'),(16130,207,'384tgc8j946erc2flr961lo2u0',NULL,'Vimbli call','2013-08-06 15:30:00','2013-08-06 16:00:00',0,'Tom - I would like you to consider #4.  The rest is really just context.  \nWe need to discuss our view of the future.  My suggestion would be to start on the call, and then potentially to follow-up with an in person session or two. \n\n1.  Open\n\n2.  Earthquakes\n- On hold. They are figuring out the offer to the person they want for the HR role. \n- My take:  Will happen, but nothing will happen in the next 2 weeks.  Probably a day a week for 2-3 months, with a couple of hours ongoing after the initial couple of months. The commute is not ideal, but the organization is a good reference client. \n\n3.  My perspective on rolling out the Earthquakes-like consulting servcies  to 2-3 clients\nPro\'s:  Technically feasible, and the demand is there.\nCon\'s:\n- I will have less time to allocate to the development of Vimbli, and will have to spend more in client service (and no, development Vimbli does not equal client service ... the solution is only a small part of what the clients want)\n- I will have less predictability in my schedule, and quite a bit of uncertainty in the business (compared to running a solution based startup, or working for a more established firm in a Leadership & Development role)\n\n>> The short:  Funding Vimbli via consulting gigs is doable, but will not be very energizing/ attractive, and based on my assessment it will put a tremendous strain on my relationship with Simone and others, and my health. \n\n4.  I would like to hear your thoughts on the elephant in the room: \n- Why would we not call it quits on Vimbli as it is structured today?  \n- How does it look if we continue?\n- How does it look if we fold it?\n\n5.  Close\n',NULL,'Tom Rikert','tom@a16z.com','2013-08-06 00:43:00','2013-08-06 12:27:50','0',0,'2013-08-06 07:30:00','2013-08-06 08:00:00'),(16131,207,'mhsjc4vnsif6dfv5bek34oq2uc_20130802T143000Z',NULL,'Men\'s call w/ new dialin','2013-08-02 15:30:00','2013-08-02 16:00:00',0,'(712) 451-6025\n1060029*',NULL,'tom.rikert@wildfireapp.com','tom.rikert@wildfireapp.com','2012-03-30 15:16:28','2013-01-29 03:32:55','0',0,'2013-08-02 07:30:00','2013-08-02 08:00:00'),(16292,265,'t1q40gtvablsah7p9n0t5kfp84_20130803T070000Z',NULL,'Sleep','2013-08-03 08:00:00','2013-08-03 16:00:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-06-20 16:58:00','2013-06-20 16:58:00','0',0,'2013-08-03 00:00:00','2013-08-03 08:00:00'),(16413,262,'t1q40gtvablsah7p9n0t5kfp84_20130806T070000Z',NULL,'Sleep','2013-08-06 00:00:00','2013-08-06 08:00:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-06-20 16:58:00','2013-06-20 16:58:00','0',0,'2013-08-06 00:00:00','2013-08-06 08:00:00'),(16414,262,'t1q40gtvablsah7p9n0t5kfp84_20130813T070000Z',NULL,'Sleep','2013-08-13 00:00:00','2013-08-13 08:00:00'