00:00'),(16259,267,'_60q30c1g60o30e1i60o4ac1g60rj8gpl88rj2c1h84s34h9g60s30c1g60o30c1g68o4cd1i88oj2dpi71346h9g64o30c1g60o30c1g60o30c1g60o32c1g60o30c1g6924aga56kr38ci46h0k8ghk8d132di26kpj2h9g68rj0e9o6h0g',NULL,'Connecting about MAP','2013-08-06 22:30:00','2013-08-06 23:00:00',0,'\n\n_____________________________________________\nFrom: Benjamin Crosby\nSent: Friday, August 02, 2013 11:18 AM\nTo: \'Jon Deane\'; Bruce Brege\nSubject: RE: Connecting about MAP\n\n\nHi Jon,\n\nYes, next Tuesday at 2:30 works well.  We can use our conference line â€“ the dial-in information is below.\n\nConference Dial-in Number: (661) 673-8600\n Host Access Code: 430830*\n Participant Access Code: 430830#\n\nLooking forward to it â€“ enjoy your weekend.\n\nBen\n\nFrom: Jon Deane [mailto:jdeane@summitps.org]\nSent: Friday, August 02, 2013 10:56 AM\nTo: Benjamin Crosby; Bruce Brege\nSubject: Re: Connecting about MAP\n\nBen-\n\nDoes 2:30 Tuesday work? I\'m looping in Bruce Brege who runs our efforts with MAP, so he can join the call as well.\n\nBest,\nJon\nOn Thu, Aug 1, 2013 at 3:42 PM, Benjamin Crosby <Benjamin.Crosby@aspirepublicschools.org<mailto:Benjamin.Crosby@aspirepublicschools.org>> wrote:\n\nHi Jon,\n\nIâ€™m so sorry, not sure how I missed this until nowâ€¦looks like itâ€™s my turn to apologize.\n\nYes, it would be great to hear about your experience with MAP â€“ weâ€™re ramping up our K-2 work with MAP and Iâ€™d be most interested to hear how youâ€™ve used the test in upper grades.  Perhaps thereâ€™s a day next week we could chat?  Iâ€™m free most of next Tuesday and Wednesday if you have any time, otherwise perhaps a time next week.\n\nThanks, and hope youâ€™re well,\nBen\n\n\nFrom: Jon Deane [mailto:jdeane@summitps.org<mailto:jdeane@summitps.org>]\nSent: Wednesday, July 24, 2013 3:48 PM\nTo: Benjamin Crosby\nSubject: Re: Connecting about MAP\n\nBen-\n\nApologies, this got lost in the post-vacation shuffle and I just realized I never responded.\n\nDo you have time on Monday 7/20 or Tuesday 7/30? Happy to jump on a call and talk MAP at that point if so.\n\nThanks!\n\nJon\n\nOn Wed, Jul 3, 2013 at 1:12 PM, Benjamin Crosby <Benjamin.Crosby@aspirepublicschools.org<mailto:Benjamin.Crosby@aspirepublicschools.org>> wrote:\n\nJon,\n\nIs there a time next week we can connect briefly on MAP?  Weâ€™ve just run through a pilot of the test this year with our K-2â€™s and are wrestling with whether we should adopt the test as part of our multiple measureâ€™s teacher evaluation system.  I imagine Summit isnâ€™t using the same K-2 version we are, but Iâ€™d be interested in hearing how you have implemented the assessment, how/if teachers have used the data to drive instruction, and how it may or may not have factored in teacher evaluation scores.\n\nEnjoy the holiday,\nBen\n\n\nFrom: James Gallagher\n\nSent: Wednesday, July 03, 2013 12:19 PM\nTo: Diane Tavenner\n\nCc: Benjamin Crosby; Jon Deane\nSubject: RE: Connecting about MAP\n\nThank you, Diane.\n\nEnjoy the holiday weekend.\n\nJames\n\n\nFrom: Diane Tavenner [mailto:dtavenner@summitps.org]\nSent: Wednesday, July 03, 2013 8:05 AM\nTo: James Gallagher\nCc: Benjamin Crosby; Jon Deane\nSubject: RE: Connecting about MAP\n\nHi James,\n\nIt was great to spend time with you and your team in Chicago.  Iâ€™ve copied Jon Deane, as he leads all of our efforts with regards to NWEA MAP.  Iâ€™m sure Jon can be helpful in sharing how we are using the assessment.\n\nMany thanks,\n\nDiane\n\n\nFrom: James Gallagher [mailto:James.Gallagher@aspirepublicschools.org]\nSent: Monday, July 01, 2013 9:18 PM\nTo: dtavenner@summitps.org<mailto:dtavenner@summitps.org>\nCc: Benjamin Crosby\nSubject: Connecting about MAP\n\nHello Diane,\n\nIt was good to be with you at the recent CAN/Lumicore convening and have a chance to join you on the Blended Learning panel.\n\nIf I remember correctly, you mentioned that Summit is using the MAP assessment with some of your students.  Here at Aspire, we are considering the MAP assessment as an optio