o the Westin Saturday night for the main ceremony/reception.  (A return taxi should cost ~$20/up to four people)\n\nOur negotiated room rate is $166 (+tax/service, ~$195 total).  This includes: Buffet breakfast for two adults at Tomatoes Restaurant, One complimentary national welcome drink coupon per person at check in, Group rate valid 4 days pre and post the official wedding dates (subject to availability), 10% off on food and beverage for individual consumptions at the hotel restaurants: Tomatoes, Sirenas, Sports Bar, Dolphins Pool, De Cortez for guests who reserve under the wedding room block, 20% discount at any Spa treatments for contracted rooms only (beauty salon services not included). Not valid with packages or other discounts and promotions, 15% discount on beauty services at the SPA (contracted rooms only). Not valid with packages or other discounts and promotions, 10% off at Cabo del Sol Golf Course Green Fees.\n\nPlease let us know if you have any questions!\n\nThank you,\nS&G\n\nRESERVATION PROCEDURE:\nAttendees will contact our reservations office either via e-mail or by phone. The following information needs to be provided: name of the guest, arrival and departure dates, type and number of rooms. Please make sure they will refer to the group â€œPramanik-Chesser Weddingâ€ in order to honor them the contracted rates. They will be required to guarantee their own reservations by credit card.\n \nEvery attendee must dial 1-888-672-7137 or 011-52-624-145 6197 from 9:00 AM to 5:00 PM Monday to Friday, and from 9:00 AM to 1:00 PM on Saturday (local time-Mountain Time). Or email humberto.garciar@sheraton.com.',NULL,'Tom Rikert','tomrikert@gmail.com','2013-08-19 03:54:07','2013-08-24 18:00:25','0',0,'2013-08-24 11:00:00','2013-08-24 11:30:00'),(16924,207,'kc7pnji5pnm01q5ugi4ecvuh2k',NULL,'Tom/ Hennie. Vimbli ','2013-08-23 18:00:00','2013-08-23 19:00:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-08-21 18:49:20','2013-08-21 22:14:21','0',0,'2013-0