3-08-31 15:30:00','2013-08-31 15:45:00',0,'Hi\nHappy Easter!  May this coming weekend be filled with a greater awareness of what Jesus did for us on the cross and a true celebration of His resurrection and what that means for us! Thanks again for your love, commitment and prayers.\n \nQuick Request for prayer:\nAt this moment Brett is on his way to Tulsa Oklahoma to speak at Oral Roberts University.  This is the first time he has been there.  He has meetings with the staff, faculty and students.  Please pray that God uses him to speak the truth of the Kingdom and that many people will be touched!\n\nHe just spent 2 days in Atlanta with one of our rÄ“p alumni and her family.  Kaki Spencer (Coleman) booked him solidly and he spoke to menâ€™s groups, her momâ€™s ladies Bible Study and prayed for her dad who has cancer.  There was an overwhelmingly positive response to Brettâ€™s messages and a number of couples are seriously considering coming to the Intensive!!  Praise God!\n \nPrayer for babies:\nA number of people who pray for us regularly and are part of our â€œPrayer Peopleâ€ group have spoken to me about the challenges they are facing with infertility, wisdom needed regarding adopting/fostering etc.  I thought it may be a good idea to link these people together in a group so they could pray and support each other.  Some others who are part of our â€œPrayer Peopleâ€ group and have walked through this situation themselves may want to be part of the group to offer care and encouragement.  If this is something you are interested in please contact me via email and we will take it from there.  Thanks.\n \nBrief Family Report Back:\nâ€¢         Fay has been able to present DeliberateLIFE to a number of potential investors these last 2 weeks.  She needs to raise money (a lot) to continue with the magazine and to build a strong business around it with online sales of fair trade products, affiliate sales, â€œvolun-travelâ€ opportunities and so on.  (She has an excellent plan for building a community of people who want to live â€œdeliberatelyâ€ that could be the basis for a good business that could have a massive impact on people around the world.)  Please pray that the right people are raised up with the same vision that are willing to invest in the magazine/ company.  And she needs the breakthrough soon!\n\nâ€¢         Fay turns 30 this Friday.  Please pray that she will feel Godâ€™s presence on her life and know His favor on this special milestone birthday.\n\nâ€¢         We are going to visit James and Jessy in Texas next month and are looking forward to spending 5 days with them.  James was in a â€œwindowâ€ for being called up to Afghanistan but it looks as if that has passed him byâ€¦praise God!\n\nâ€¢         Davey is loving his job with Portal-A and working hard.  Right now he is just a contractor being paid daily rates while the company decides whether to hire him full time or not. Please pray that they offer him a full time job soon, with good pay and benefits.  His parents will be very happy to no longer be supporting him!\n\nPersonal Report Back:\nâ€¢         I have a strong desire to start teaching again, specifically in the area of Hospitality.  I am trying to grab moments of time in the midst of everything else that needs to be done to prepare for this.  Please pray that God brings me the support I need and opens the way in the right time.\n\nâ€¢         Our rÄ“p 10 Year Celebration is on April 27 and I am very busy planning for this special event.  It is going to be a wonderful time.  Please pray that it all comes together quickly and easily (I already had my caterer bomb out!)\n\nâ€¢         We continue to pray for a full group for the Intensive and all the needed volunteers and helpers to staff this week long training.  I am spending time daily reaching out to people.\n\nâ€¢         Brett has been working very hard on finishing off some new products that will be launched at the 10 Year Celebration.  He is so amazing and I am very proud of him and grateful for his vision and perseverance.\n\nThank you again for all your love and support!\nMany blessings,\nLyn\n',NULL,'Kevon Saber','ksaber@gmail.com','2013-03-27 01:44:59','2013-05-25 13:26:08','0',0,'2013-08-31 07:30:00','2013-08-31 07:45:00'),(17539,204,'97k5r7vhuivhj9cjhis0fg66ds_20130910T170000Z',NULL,'Test','2013-09-10 18:00:00','2013-09-11 02:00:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-06-20 16:58:58','2013-06-20 16:59:26','0',0,'2013-09-10 10:00:00','2013-09-10 18:00:00'),(17506,172,'l5v3h0c72cpsj2cv492mj76flc_20130831T050000Z',NULL,'Sleep Dec 1','2013-08-31 06:00:00','2013-08-31 13:00:00',0,' ',NULL,'Hennie Strydom','hennies@gmail.com','2012-12-01 20:49:51','2013-05-22 22:47:03','0',0,'2013-08-30 22:00:00','2013-08-31 05:00:00'),(17972,239,'mj7b06uo52nq7npnqgahdaq0jo_20130916T180000Z',NULL,'Weekly Company Meeting','2013-09-16 13:00:00','2013-09-16 14:00:00',NULL,'(218) 339-2500\nAccess Code: 389527#',NULL,'W Barton Munro Jr','bart@munro.org','2011-05-28 21:15:56','2013-09-16 15:59:17','0',0,'2013-09-16 13:00:00','2013-09-16 14:00:00'),(17854,172,'3pjn745lo8ovf3v3i98meuj894_20130910T043000Z',NULL,'Reflect. Celebrate now. Plan. ','2013-09-10 05:30:00','2013-09-10 06:00:00',NULL,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-01-23 07:09:03','2013-08-04 23:00:30','0',0,'2013-09-09 21:30:00','2013-09-09 22:00:00'),(17230,309,'_64s3ed1g8d2j0ba58933ab9k8gr34b9o6kokcba161330chn60q4ch9g8o_20130924T220000Z',NULL,'Review today + plan tomorrow','2013-09-25 01:00:00','2013-09-25 01:30:00',0,NULL,NULL,'Kevon Saber','ksaber@gmail.com','2013-09-06 18:27:14','2013-09-06 18:27:31','0',0,'2013-09-24 17:00:00','2013-09-24 17:30:00'),(17231,309,'_64s3ed1g8d2j0ba58933ab9k8gr34b9o6kokcba161330chn60q4ch9g8o_20130925T220000Z',NULL,'Review today + plan tomorrow','2013-09-26 01:00:00','2013-09-26 01:30:00',0,NULL,NULL,'Kevon Saber','ksaber@gmail.com','2013-09-06 18:27:14','2013-09-06 18:27:31','0',0,'2013-09-25 17:00:00','