ied leaving an unclaimed funds  with my bank.\n \n In the year 2003, my late customer made a fixed deposit here in my bank  totaling $7.1 Million Dollars which was due to be collected in 2008 after 4 years maturity with accrued dividends.\nOn my yearly appraisal of my customers at the turn of every year, I discovered that this fixed deposit remained overdue for retrieval. I had put up series of mails and bank notifications to him which were sent back uncollected.\n \nIt was a year ago that i discovered that he passed on along with his wife and only child through 2004 Indian ocean Tsunami while resorting at Khao Lak in Thailand. Since learning of his death , I have managed his account expecting any of his extended relatives to come forward to claim his money but all attempts to trace his relatives over the years  has been fruitless since he did not declare any of his relatives information in his banking records with us.\n \nAdded to this, professional ethics obligates us to act with extreme confidentiality when dealing with clients accounts of this type. According to my country \"Cote D\' Ivoire\" banking law, the money will be bequeathed to the government if it remains unclaimed by a certain period which is almost near.\nHowever, I dont belong to that school of thought which proposes that the fortunes of unlucky people be given to the government and I am fully convinced that no one would turn up to execute the letter of administration to claim his funds before this short time.\n \nHence,I decided to contact you to come in as the next of kin/Business partner to my late customer so that the funds totalling $7.1 million (Seven Million, one Hundred Thousand Dollars) can then be transferred to your nominated bank account in your country within 7 working days after we have filed in your claims transfer application to the bank.\n \nI will prepare every operation that will assist you to claim the funds as the next of kin/confidential business partner and everything will be left between you and me.\nThe share would be 50/50 or better we can still map out 5% for any expenses. Again, I feel that you may be apprehensive and consider this amount too big for you to defend. It does not matter, as there are documents to back it up.\n \nThis transaction is risk free and as the most senior account manager with the bank, be rest assured that all documents to enable you get this fund as the next of kin will be carefully worked out by me.\n \nDo not be bothered that you are not related in any way to my late customer as I am in position to affix your name as the next of kin.\nKindly send your reply enclosing your Full Names, Contact Address and Phone Number to me for confidentiality, to enable me talk to you before I send you the certificate of deposit and other relevant information relating to this fund transfer.\n \nI need not emphasize the confidentiality of this issue and I therefore appeal to you not discuss this request with anybody, even if you decline to take full advantage of this great and urgent opportunity in my bank.\n \nI look forward to your quick reply by email  \n \nSincerely,\n \nMr Abel Korimba',NULL,'Korimba Abel','korimbaabel@gmail.com','2013-09-02 10:44:14','2013-09-02 17:55:01','0',0,'2013-09-02 04:00:00','2013-09-02 05:00:00'),(17968,117,'b4gdebnj27tjipk5dn5jk0h034',NULL,'From Mr.Abel Korimba','2013-09-02 12:00:00','2013-09-02 13:00:00',NULL,'Dear Friend,\n \nI choose to reach you through this medium because it is the fastest and most reliable way of communication, as I wish to solicit for your urgent assistance in what i strongly believe will be of great benefit to both of us.\n \nI am Mr.Abel Korimba,an Accounts Manager with a Bank here in Cote D\' Ivoire also known as \"Ivory Coast\".\nThe issue I am presenting to you is a case of one of my late customer,a businessman from Thailand who died leaving an unclaimed funds  with my bank.\n \n In the year 2003, my late customer made a fixed deposit here in my bank  totaling $7.1 Million Dollars which was due to be collected in 2008 after 4 years maturity with accrued dividends.\nOn my yearly appraisal of my customers at the turn of every year, I discovered that this fixed deposit remained overdue for retrieval. I had put up series of mails and bank notifications to him which were sent back uncollected.\n \nIt was a year ago that i discovered that he passed on along with his wife and only child through 2004 Indian ocean Tsunami while resorting at Khao Lak in Thailand. Since learning of his death , I have managed his account expecting any of his extended relatives to come forward to claim his money but all attempts to trace his relatives over the years  has been fruitless since he did not declare any of his relatives information in his banking records with us.\n \nAdded to this, professional ethics obligates us to act with extreme confidentiality when dealing with clients accounts of this type. According to my country \"Cote D\' Ivoire\" banking law, the money will be bequeathed to the government if it remains unclaimed by a certain period which is almost near.\nHowever, I dont belong to that school of thought which proposes that the fortunes of unlucky people be given to the government and I am fully convinced that no one would turn up to execute the letter of administration to claim his funds before this short time.\n \nHence,I decided to contact you to come in as the next of kin/Business partner to my late customer so that the funds totalling $7.1 million (Seven Million, one Hundred Thousand Dollars) can then be transferred to your nominated bank account in your country within 7 working days after we have filed in your claims transfer application to the bank.\n \nI will prepare every operation that will assist you to claim the funds as the next of kin/confidential business partner and everything will be left between you and me.\nThe share would be 50/50 or better we can still map out 5% for any expenses. Again, I feel that you may be apprehensive and consider this amount too big for you to defend. It does not matter, as there are documents to back it up.\n \nThis transaction is risk free and as the most senior account manager with the bank, be rest assured that all documents to enable you get this fund as the next of kin will be carefully worked out by me.\n \nDo not be bothered that you are not related in any way to my late customer as I am in position to affix your name as the next of kin.\nKindly send your reply enclosing your Full Names, Contact Address and Phone Number to me for confidentiality, to enable me talk to you before I send you the certificate of deposit and other relevant information relating to this fund transfer.\n \nI need not emphasize the confidentiality of this issue and I therefore appeal to you not discuss this request with anybody, even if you decline to take full advantage of this great and urgent opportunity in my bank.\n \nI look forward to your quick reply by email  \n \nSincerely,\n \nMr Abel Korimba',NULL,'Korimba Abel','korimbaabel@gmail.com','2013-09-02 10:44:14','2013-09-02 17:55:01','0',0,'2013-09-02 04:00:00','2013-09-02 05:00:00'),(17831,309,'_64s3ed1g8d2j0ba58933ab9k8gr34b9o6kokcba161330chn60q4ch9g8o_20130919T220000Z',NULL,'Review today + plan tomorrow','2013-09-20 01:00:00','2013-09-20 01:30:00',0,NULL,NULL,'Kevon Saber','ksaber@gmail.com','2013-09-06 18:27:14','2013-09-06 18:27:31','0',0,'2013-09-19 17:00:00','2013-09-19 17:30:00'),(18262,239,'_64s3ed1g8d2j0ba58933ab9k8gr34b9o6kokcba161330chn60q4ch9g8o_20130923T220000Z',NULL,'Review today + plan tomorrow','2013-09-23 17:00:00','2013-09-23 17:30:00',0,NULL,NULL,'Kevon Saber','ksaber@gmail.com','2013-09-06 18:27:14','2013-09-06 18:27:31','0',0,'2013-09-23 17:00:00','2013-09-23 17:30:00'),(17832,239,'vitf9g1a9i2njjku7vijarfrb4',NULL,'Bikram Yoga San Jose','2013-09-21 10:00:00','2013-09-21 11:30:00',NULL,'Phone: 408.255.9910',NULL,'Lacy Reiss','fig.assistant@gmail.com','2013-07-29 21:06:21','2013-07-29 21:06:21','