nity to brief you about our company. With couple of developers(including me), we have build a amazing product that provides great in-store mobile experience to consumers and a rich merchandising platform to merchants. \n\nRegards,\nNitin Mangtani \nhttp://www.predictspring.com/\nhttps://twitter.com/nitin_mangtani\n\nOn Thu, Sep 12, 2013 at 11:39 AM, Mehul Nariyawala <mehul@flutterapp.com> wrote:\nHi Marc & Scott,\n\nI am super excited to introduce you to my friend Nitin, who recently founded PredictSpring. Nitin and I were colleagues at Google, and he\'s one of the smartest PM I\'ve ever had pleasure of working with.  He helped build a large business at Google out of Google Site Search and was instrument in many of the recent Google Commerce initiatives.\n\nPredictSpring enables merchants to build GoogleNow like capability for their users resulting in equally predictive & personalized experience.  PredictSrping is in process of raising its seed round of funding, and I thought you might be interested in meeting him.  More on him and company below.\n\nI will let you take it from here!\n\nBest,\nMehul\n\n\nPredictSpring is building a b2c CRM platform that allows merchants to increase consumer engagement with semantic entities such as promotions, events & products. These semantic entities are fully integrated into merchant\'s mobile app & digital wallets. The underlying platform provides personalized discovery & search experience to consumers via merchants mobile app & email.  PredictSpring team has built a alpha product and has couple beta merchants whom are already seeing the benefits of this platform.\n\nNitin started PredictSpring in March 2013, previously he was a Group Product Manager at Google for 7 years. At Google, Nitin founded Google Site Search product, and growing the business to tens of thousands of customers. Nitin then led Google Shopping merchant experience team, scaling the product to hundreds of thousands of merchants. Most recently he led Google Retail Promotions & Offer Extensions team. While at Google, he interacted with numerous merchants and realized the need for a enterprise product to deliver personalized promotions, products & events to consumers. \n\n\n\n\n-- \nMarc Andreessen\npmarca@a16z.com\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-16 19:10:31','2013-10-08 14:23:47','0',0,'2013-09-18 15:00:00','2013-09-18 16:00:00'),(18366,239,'_64s3ed1g8d2j0ba58933ab9k8gr34b9o6kokcba161330chn60q4ch9g8o_20130916T220000Z',NULL,'Review today + plan tomorrow','2013-09-16 17:00:00','2013-09-16 17:30:00',0,NULL,NULL,'Kevon Saber','ksaber@gmail.com','2013-09-06 18:27:14','2013-09-06 18:27:31','0',0,'2013-09-16 17:00:00','2013-09-16 17:30:00'),(18313,309,'ir5qmmvm2tcd5hi1e1l2v7hm68_20130914T160000Z',NULL,'Cook for A&K','2013-09-14 17:00:00','2013-09-14 18:00:00',0,NULL,NULL,'Lacy Reiss','fig.assistant@gmail.com','2012-12-17 16:51:40','2013-09-21 12:14:43','0',0,'2013-09-14 09:00:00','2013-09-14 10:00:00'),(18493,204,'t1q40gtvablsah7p9n0t5kfp84_20130927T070000Z',NULL,'Sleep','2013-09-27 08:00:00','2013-09-27 16:00:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-06-20 16:58:00','2013-06-20 16:58:00','0',0,'2013-09-27 00:00:00','2013-09-27 08:00:00'),(18325,207,'k5rohnb1uugo2a9qj39q62nui8',NULL,'Dinner at Girl and the Fig','2013-09-22 01:30:00','2013-09-22 03:30:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-08-31 20:49:15','2013-09-12 04:56:37','0',0,'2013-09-21 17:30:00','2013-09-21 19:30:00'),(18308,286,'l0h4f5mgm0qtp25earamnjdbgk_20130924T200000Z',NULL,'TEST - 8 hours, 2 hour overlap','2013-09-24 21:00:00','2013-09-25 05:00:00',0,NULL,NULL,'Hennie Strydom','270win@gmail.com','2013-06-22 18:47:01','2013-06-22 18:47:28','0',0,'2013-09-24 13:00:00','2013-09-24 21:00:00'),(18331,204,'t1q40gtvablsah7p9n0t5kfp84_20130907T070000Z',NULL,'Sleep','2013-09-07 08:00:00','2013-09-07 16:00:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-06-20 16:58:00','2013-06-20 16:58:00','0',0,'2013-09-07 00:00:00','2013-09