 to hear more about your progress - our partner Tom is best suited to take a closer look and Lisa, also cced, can help with scheduling. \n\nPls let us know if you are currently fundraising or just looking for feedback at this stage.\n\nBest,\nJuliet\n\n\nOn Tue, Aug 27, 2013 at 8:01 AM, Jeff Jordan <jj@a16z.com> wrote:\nHey Sam,\n\nThanks for reaching out.  And congrats on the progress.  I\'m copying Juliet Pullis who runs the deal team that on-boards all prospective new investments.  She can work with you on next steps.\n\nThanks.\n\nSent from my iPad\n\nOn Aug 27, 2013, at 5:58 PM, Sam von Pollaro <sam@getvenga.com> wrote:\n\nHi Jeff -\n\nHope you\'re enjoying the summer. As it\'s been a while since we originally met (originally introduced by Chris Schroeder), I thought it would be good to update you on Venga, particularly in light of all the work we\'re doing with OpenTable.\n\nLast fall we began working with Jose Andres\' ThinkFoodGroup to develop what they called the \"holy grail\" for restaurants. Earlier this year we launched VengaIntel Reserve, a complete customer management system that seamlessly integrates restaurantsâ€™ point of sale systems and reservation systems (e.g. OpenTable). Venga connects purchases to individual guests to build profiles on guests habits and preferences and uses that information to increase visit frequency and spending.\n\nThe product has met with resounding success in the market and has been adopted by many of the most influential restaurant operators in the country including Mario Batali, Michael Mina, Innovative Dining Group, Mastro\'s and ESquared Hospitality. Our second quarter sales this year were up 5x over the first quarter and the third quarter is off to an equally fast start. We\'re in the early stages of crafting channel partnerships with large industry players that we expect to announce in the fall. \n\nEarlier this year did a capital raise led by an early-stage VC fund with participation from Cornell University, several of our restaurant customers who thought our software was so compelling they also invested, and a high quality group of angel investors including Alicia Aloe, founder of Table Maestro. \n\nIf you\'re interested in hearing more about our progress, I\'d be happy to chat sometime and catch up. \n\nRegards,\nSam\n\nSam von Pollaro\nCEO, Venga \n703-261-4182 \nwww.getvenga.com\nAngelList Twitter LinkedIn\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-08-28 22:51:57','2013-10-08 14:23:47','0',0,'2013-09-10 09:30:00','2013-09-10 10:30:00'),(18305,207,'p7j1dp6qubof1a3h9dsflhq3d0_20130918T150000Z',NULL,'Send Usher Reminder','2013-09-18 16:00:00','2013-09-18 16:30:00',0,'Hey Team,\n\nHappy Holy Week! Here\'s your friendly reminder that our ushering month starts next week. Please go to http://servant.citychurchweb.org/ to sign-up for 3 spots in April.\n\nThanks!',NULL,'Tom Rikert','tom@a16z.com','2013-04-02 15:43:35','2013-04-17 17:52:21','0',0,'2013-09-18 08:00:00','2013-09-18 08:30:00'),(18070,239,'tmbdubp49baj30qgd1n3q6dd70',NULL,'Bikram Yoga San Jose','2013-09-21 06:00:00','2013-09-21 07:30:00',0,'Phone: 408.255.9910',NULL,'Lacy Reiss','fig.assistant@gmail.com','2013-07-29 20:42:58','2013-07-29 20:42:58','0',0,'2013-09-21 06:00:00','2013-09-21 07:30:00'),(18469,204,'t1q40gtvablsah7p9n0t5kfp84_20130909T070000Z',NULL,'Sleep','2013-09-09 08:00:00','2013-09-09 16:00:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-06-20 16:58:00','2013-06-20 16:58:00','0',0,'2013-09-09 00:00:00','2013-09-09 08:00:00'),(18333,212,'so00irmvk03aqec9et6mc8t17c',NULL,'Nancy Murphy Spicer via Zelah','2013-09-20 16:30:00','2013-09-20 17:30:00',0,NULL,NULL,'David Evans','david@jeditrainers.com','2013-09-09 23:19:36','2013-09-09 23:19:36','0',0,'2013-09-20 08:30:00','2013-09-20 09:30:00'),(18298,267,'k6fa79ug57eee5mqb34d04jt1o',NULL,'With eadvance','2013-09-19 22:00:00','2013-09-19 23:00:00',0,NULL,NULL,'Jon Deane','jdeane@summitps.org','2013-08-10 06:07:48','2013-08-10 06:07:48','0',0,'2013-09-19