rated strong traction in their initial go to market with\n>>>> 20 paid customers including Marketo, Lithium, Kony Mobile, and ServiceMax.\n>>>> Here is the link on Marketoâ€™s LaunchPoint about the offering:\n>>>>\n>>>>\n>>>>\n>>>> http://launchpoint.marketo.com/leandata-inc/1030-data-quality-as-a-service\n>>>>\n>>>>\n>>>>\n>>>> The company\'s initial solution utilizes algorithms for fuzzy matching and\n>>>> then enhanced with the combination of workflow and on demand cloud labor to\n>>>> deliver call-ready leads.  The go to market strategy is a freemium model\n>>>> focused on mid to large sized enterprises that have integrated with 3rd\n>>>> party applications like marketing automation.  The companyâ€™s vision has\n>>>> extended to include add on products that provide the marketer reporting on\n>>>> the effectiveness of their marketing programs.\n>>>>\n>>>>\n>>>>\n>>>> Let me know if I may introduce Evan to you.\n>>>>\n>>>>\n>>>>\n>>>> Ravi\n>>>>\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-06 21:19:42','2013-10-08 14:23:48','0',0,'2013-09-11 14:00:00','2013-09-11 15:00:00'),(18400,313,'0hg7o6sifaava0jhm5daefh3q0',NULL,'Dry run: fintech POV','2013-09-09 19:45:00','2013-09-09 20:30:00',0,NULL,NULL,'Frank Chen','frank@a16z.com','2013-09-09 16:50:10','2013-10-08 14:23:48','0',0,'2013-09-09 11:45:00','2013-09-09 12:30:00'),(18401,313,'hhbo37ntvbvgeoblckqclg93bk',NULL,'Review Payments Deck ','2013-09-09 20:00:00','2013-09-09 20:30:00',0,'On Wed, Sep 4, 2013 at 10:17 AM, Tom Rikert <tom@a16z.com> wrote:\nHi Michelle,\n\nCan you schedule 30 mins for Rob Mazzoni (rmazzoni@a16z.com) and I to meet with Scott this week or early next week?  We would like to take Scott through a Payments point-of-view deck that Rob has put together as his summer intern project.  I had already mentioned this to Scott and he was enthusiastic to meet.  We believe our research could be helpful to Dwolla in particular.\n\nAdditional background: our goal for these point-of-view decks is to provide tho