3-09-28 15:00:00'),(18408,313,'mul30ip2e0v8fmttivd6m5if14',NULL,'Neil Ahlsten // NewCo advice','2013-09-11 18:30:00','2013-09-11 19:00:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-09-09 01:31:45','2013-10-08 14:23:48','0',0,'2013-09-11 10:30:00','2013-09-11 11:00:00'),(18409,313,'6gnic22tc8gk6mb9jqseb8jpnc',NULL,'Prepared Mind/Process','2013-09-09 23:30:00','2013-09-10 00:30:00',0,' (Frank/Research team + GPs only)',NULL,'Meredith Donahue','meredith@a16z.com','2013-09-06 19:49:48','2013-10-08 14:23:48','0',0,'2013-09-09 15:30:00','2013-09-09 16:30:00'),(18410,313,'d6q92t6elncv9q6br24r83vhuo',NULL,'Meeting with Dmitry Grishin, Mail.ru Group','2013-09-10 21:00:00','2013-09-10 22:00:00',0,'Hi Arsho,\n\nYes, Mr. Grishin be there at 1pm.\nUnfortunately I got sick and could not attend the meeting, Mr. Grishin is likely to be one.\n\nPavel\n\nPavel Sukhorukov \nGeneral Partner | I\'m VC | I\'m VC - Investments\ne: pavel@imvcny.com | http://imvcny.com\n+1 (646) 504-5355 | Skype: imvc-nyc \nNew York, NY | Los Angeles, CA | Moscow, RU\n-------\n BIO\n\nDmitry Grishin (born October 15, 1978) is a Russian investor and Internet entrepreneur. He is best known as co-founder, Chairman and CEO of Mail.ru Group and he make a big contribution to Runet. Grishin is founder of investment company Grishin Robotics.\n\nDmitry Grishin was born in 1978 in Kapustin Yar. He graduated from Bauman Moscow State Technical University in 2001. He had been woking in manufacturer software company Axiom Int(USA) as Design Engineer, Senior Software Developer, IT-consultant since 1998. In March 2000 he began to work in netBridge company (further Mail.Ru) as a head of project development division of online auction Molotok.ru. In May 2001 he became head of Mail.Ru\'s service center, in December Grishin became the technical director of Mail.Ru. He became executive director of Mail.ru in June 2002 and CEO in April 2003. In 2005 Dmitry Grishin beame co-founder of Mail.ru Groupe and was appointed as Chief Executive Officer in November 2010 after Yuri Milner.\nIn June 2012 He founded an investment company Grishin Robotics and get for it $25 millions from his personal funds. The company plans to invest in projects in the field of personal robotics worldwide. Now Dmitry Grishin learn Chinese language, do preference and tennis.\n\nAbout Mail.ru Group\n\nMail.ru Group - Market Cap (M USD) 6,595.15\n\nMail.ru is the largest free e-mail service of the Runet. The business was originally owned by Port.ru, a company founded in 1998 by Eugene Goland, Michael Zaitsev and Alexey Krivenkov as spin-off from DataArt. It received an initial investment of USD 1 million from the well-known investor (and fencing champion) James Melcher.\nThe Mail.ru business expanded rapidly to reach the No. 1 market position in Russia by 2000. Attempts to fund the companyâ€™s expansion in 2000-2001 were thwarted by the collapse of the technology bubble and Mail.ru was forced to seek merger partners.\nIn 2001, Yuri Milner, who was managing NetBridge (the owner of less popular internet brands) persuaded the well-known entrepreneur Igor Linshits to back a merger of the Mail.ru business with NetBridge. Igor Linshits subsequently took an active role in the development of the Mail.ru business. In connection with the merger, Milner became Mail.ru CEO.\nThe company started to operate under its present name on 16 October 2001. Before that time its brand name was owned by Port.ru. It is headed by Dmitry Grishin. As of 2009, its global Alexa rating is 29.\nIn 2003, Milner resigned from Mail.ru and subsequently set up another internet venture, Digital Sky Technologies (DST). In 2006, Igor Linshits sold his stake in Mail.ru to Tiger Fund and Milner\'s DST for more than $100 million. In September 2010, DST changed its name to Mail.ru Group. Dmitry Grishin became one of the Mail.ru Group co-founders.\n\nIn October 2010, Mail.ru announced plans for an IPO via the London stock market listing of a subsidiary â€“ also called Mail.ru â€“ worth more than $5bn. The IPO will offer a stake of about 17% of the subsidiary. The subsidiary will include about a quarter of the groupâ€™s shareholding in Facebook, stakes in Russiaâ€™s two biggest social networking sites and Mail.ru. The company has hired Goldman Sachs, JP Morgan, Morgan Stanley and VTB Capital to run the listing.\nIn March 2012, Yuri Milner has stepped down from the role of Chairman of Mail.ru and from the Board of Directors.[8] Dmitry Grishin was elected to the Board of Directors and appointed as Chairman of the Board while retaining his CEO position. There were no other changes to management or to the Board.\n\nDigital Sky Technologies (DST) is an international investment firm focused solely on the Internet sector. The firm was founded by Yuri Milner and emerged out of Mail.ru Group. Today, DST is fully independent of Mail.ru Group and its investments include Facebook, Zynga and Groupon.\n\nYuri Milner is the founder of both Mail.ru Group and DST. In case of Mail.ru group another co-founder was current company\'s CEO Dmitry Grishin. In March 2012, Yuri Milner has stepped down from the role of Chairman of Mail.ru and from the Board of Directors. Dmitry Grishin was elected to the Board of Directors and appointed as Chairman of the Board while retaining his CEO position. There were no other changes to management or to the Board. Mail.ru Group was originally called Digital Sky Technologies and started making international investments from its balance sheet. As part of Mail.ru Groupâ€™s IPO the company renamed itself to its current name. DST was formed as a separate entity, initially called DST Global to co-invest with Mail.ru Group. Post Mail.ru Groupâ€™s IPO, DST is the sole vehicle for further international investments. The company is now fully independent of Mail.ru Group.',NULL,'Arsho Avetian','arsho@a16z.com','2013-08-15 22:09:18','2013-10-08 14:23:48','0',0,'2013-09-10 13:00:00','2013-09-10 14:00:00'),(18411,313,'3cevutd955mdbrajthdtfk500k_20130911T000000Z',NULL,'Daily stand-up meeting','2013-09-11 00:45:00','2013-09-11 01:00:00',0,'Guys,\n\nScheduling a standing meeting time to sync on your projects.  Let\'s meet in the 2875 library.  This will be quick and informal.  Please be ready with a summary of what you\'ve been working on, next steps, and any blockers where I can provide help/guidance.  \n\nTom',NULL,'Tom Rikert','tom@a16z.com','2013-06-24 16:21:15','2013-10-08 14:23:48','0',0,'2013-09-10 16:45:00','2013-09-10 17:00:00'),(18412,313,'fat85efq7onif66diijhmv6ok0',NULL,'Cortica references call','2013-09-11 00:30:00','2013-09-11 00:45:00',0,'Igal to call Tom at 415-336-5568',NULL,'Tom Rikert','tom@a16z.com','2013-09-10 06:04:55','2013-10-08 14:23:48','0',0,'2013-09-10 16:30:00','2013-09-10 16:45:00'),(18413,313,'c6nf8m5kdgq7ang8uoq7biqfm4',NULL,'Glass Collective - \"Pristine\" Pitch','2013-09-19 18:00:00','2013-09-19 19:00:00',0,'Kyle,\nI wanted to introduce you to Megan and Tom who are a part of the Glass Collective and the representatives from KPCB & a16z who will be at the meeting next Thurs.  I will be in Boston that morning - landing and heading to a meeting during the time slot - so I will try to call in but may not be there for the full time.  Feel free to connect with Megan on the day of for any questions.\n\nWe have 9-11am blocked off on Thursday 9/19 for Glass Collective meetings so if you can plan to be in the office by 10:15am that would be great.  The meeting will be held at the KPCB offices in Menlo Park, CA 2750 Sand Hill Road, directions here.\n\nPlease let us know if you have any questions.\nBest,\nShanna',NULL,'Tom Rikert','tom@a16z.com','2013-09-10 06:01:15','2013-10-08 14:23:48','0',0,'2013-09-19 10:00:00','2013-09-19 11:00:00'),(18414,313,'eir7gcvhnq5pceulodik0cgqas',NULL,'Room for call','2013-09-10 17:30:00','2013-09-10 18:30:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-09-10 16:25:41','2013-10-08 14:23:48','0',0,'2013-09-10 09:30:00','2013-09-10 10:30:00'),(18415,313,'cskn41s2lv3b7q7o6tt06fs80s',NULL,'Call Greg @ Cisco','2013-09-12 02:30:00','2013-09-12 03:00:00',0,'call my mobile (312.952.7320)',NULL,'Tom Rikert','tom@a16z.com','2013-09-11 23:53:48','2013-10-08 14:23:49','0',0,'2013-09-11 18:30:00','2013-09-11 19:00:00'),(18416,313,'c896udcoptc840go0dgcmip598',NULL,'CALL:  Brian Brackeen, Kairos','2013-09-11 19:00:00','2013-09-11 19:30:00',0,'Brian Brackeen <brian@kairos.io\n\nHi Brian, thanks for the update - we\'d like to take a closer look and our partner Tom will take the lead.  Lisa, also cced, can help set up a 30 min call to get things started.\n\nWe appreciate the opportunity!\nJuliet\n\n\nOn Tue, Sep 3, 2013 at 4:38 AM, Brian Brackeen <brian@kairos.io> wrote:\nJuliet, \n\nIt\'s been a long time, and so much has changed. Amanda is no longer with Kairos, and I wanted to reach out to chat with you and your team about an exciting pivot that we have made as well as some updates. \n\nI\'ve attached our latest deck, we have become a enterprise facial recognition company, solely focused on enterprise (our expertise) as opposed to government and military uses. We aggregate the best commercial facial rec SDK\'s in the world, make them cloud based, and sell them as SaaS at lower prices then they could have been had by individual developers...\n\nIt\'s a pure API play, 1 set of API\'s for any developer to learn, and you get benefit of the best FR in the world. \n\nBasically, we make facial recognition affordable and easy for everyone in the world. \n\nWe have some good traction, our challenge is that we  have too many orders than we can fill at our size. We need a partner like a16z to help us grow this company intelligently. (There are 189 companies in our pipeline across the products)\n\nArsenal Venture Partners has a fund and is interested in 50% of the round, we also have interest from In-Q-Tel, CNF, and Vocap Ventures as well as 2-3 Angels in the Miami area. \n\nI\'d love to update you & team more on a call. \n\nBest,\n\nBrian Brackeen\nKairos, CEO\nbrian@kairos.io\n(786) 472-1242\nwww.kairos.io\n\nWe are very proud to share, that Kairos has been selected by the Wall Street Journal as one of 20 startups participating in â€˜WSJ Startup of the year\" You can vote for Kairos here: http://projects.wsj.com/soty/startup/kairos\n\n\n\nOn Oct 23, 2012, at 10:11 PM, Juliet Pullis <juliet@a16z.com> wrote:\n\nHi Amanda, thanks for the additional information - I\'ve shared it with the team here.  It sounds like you are off to a very promising start and we will certainly keep you on our radar.  \n\nBest,\nJuliet\n\nOn Fri, Oct 12, 2012 at 8:05 PM, Juliet Pullis <juliet@a16z.com> wrote:\nHi Amanda, I\'m a member of the deal team at a16z and received your information from Margit.  Thanks for reaching out to us and congrats on your success thus far!\n\nWe think Kairos has devised a very interesting solution, but would like to respectfully decline the opportunity at this point.  We would love to keep in touch and hear how things progress nonetheless.  As you continue to grow the business and gain further traction, we\'d be happy to take another look.\n\nBest of luck,\nJuliet\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-05 20:37:16','2013-10-08 14:23:49','0',0,'2013-09-11 11:00:00','2013-09-11 11:30:00'),(18417,313,'43vgumtdmmbkdr8ok2m9dadhbk',NULL,'Pitch Meeting | Inder Singh, Kinsa Health','2013-09-10 23:00:00','2013-09-11 00:00:00',0,'9.9. confirmed...amc\n\n---------- Forwarded message ----------\nFrom: Inder Singh <inder@kinsahealth.com>\nDate: Thu, Aug 15, 2013 at 9:14 PM\nSubject: Re: Intro\nTo: Chris Dixon <cdixon@gmail.com>\nCc: Ana Marie Corona <AnaMarie@a16z.com>\n\nChris, great speaking today.  I am in the Bay Area in early September.  How about meeting on Sept 3 afternoon, Sept 4 AM, or Sept 10 or 11 afternoon? \n\nOn Wed, Jun 19, 2013 at 3:43 PM, Inder Singh <inder@kinsahealth.com> wrote:\nThanks Chris.  \n\nAna, let me know what times work for Chris.  How about one of these (times below are Eastern): \n\nThursday (tomorrow) 9-11, noon-2, 3-6 Eastern\nFriday, 9-noon, 2-3, 4:30 - 6\nMonday 2 - 5:30\n\nInder\n\nOn Tue, Jun 18, 2013 at 8:20 PM, Chris Dixon <cdixon@gmail.com> wrote:\nHi Inder\nNice to meet you and happy to set up a time to chat.\nChris\n\nOn Sun, Jun 16, 2013 at 5:53 PM, Inder Singh <inder@kinsahealth.com> wrote:\nThanks Eric (bcc\'ed).\nChris, It\'s nice to be in touch. It would be a pleasure to tell you more about Kinsa. Would Thursday or Friday between 10 and 4 pacific present a good opportunity. I\'ve just left the Bay Area back for NYC so perhaps we can start with a Skype call?\n\nThanks\n\nInder\n415 812 4633 \n\nSent from my iPhone\n\nOn Jun 16, 2013, at 11:30 AM, Eric Paley <eric@foundercollective.com> wrote:\n\nChris - Please meet Inder Singh, CEO of Kinsa Health.\n\nInder - Chris would love to learn more and determine whether Kinsa could be a fit for \nA16Z.\n\nWill leave it to you guys to follow up.\n\ne\n__________\nEric Paley | Founder Collective\n(o) 617-453-2250 x301 | 1 Mifflin Place | Cambridge MA 02138\nabout.me/epaley | @epaley | epaley.com\nwww.foundercollective.com | @fcollective\n\n',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-08-23 02:22:23','2013-10-08 14:23:49','0',0,'2013-09-10 15:00:00','2013-09-10 16:00:00'),(18418,313,'menej02v0rehgmg0nsvskhiej4',NULL,'Meeting:  Treena Pauls, Demeure','2013-09-17 23:00:00','2013-09-18 00:00:00',0,'Treena Pauls <tpauls@laurencegroup.com\n\nHi Treena, thanks for the follow-up.  We\'d like to try for a meeting with our partner Tom who\'s best suited to take a closer look at the opportunity.  Lisa, also cced, can help with scheduling.\n\nWe look forward to it!\n\nJuliet\n\n\nOn Wed, Sep 4, 2013 at 6:23 AM, Treena Pauls <tpauls@laurencegroup.com> wrote:\nHello Juliet, I\'m getting in touch with you to determine if you or anyone from your team is interested in meeting with Demeure while they are in San Francisco on Sept. 16 afternoon or September 17th morning.  Please let me know and I can make the arrangements.  I\'m currently working on the agenda for the trip and booking several meetings.  If you are interested, please let me know and I\'ll hold a slot for you.  Thank you, Treena Pauls, Assistant to Peter Schwartz\n\nFrom: Peter Schwartz <pschwartz@laurencegroup.com>\nDate: Tue, 27 Aug 2013 13:43:33 -0400\nTo: Juliet Pullis <juliet@a16z.com>\nCc: Scott Johns <scott.johns@demeure.com>, Treena Pauls <tpauls@laurencegroup.com>\nSubject: Re:\n\nThank you for your note \n\nI have added Scott Johns here our CFO\n\nOur pitch deck and model will be along in 2 weeks and then we will follow up\n\nI have also ccd Treena Pauls here and if you are interested in meeting on Sept 16, 17 I know she is working thru the itin full speed when she returns from holidays next week. Please let us know\n\nPeter \n\nOn 2013-08-27, at 12:34, Juliet Pullis <juliet@a16z.com> wrote:\n\nThanks Ashvin (moving to bcc).  Hi Peter, nice to meet you virtually.  We\'re looking forward to learning more about Demeure - we\'d like to be able to review your pitch deck in advance so we can determine the right fit here.  If that works for you, I\'ll keep an eye out for it, and be in touch shortly thereafter on next steps.\n\nBest,\nJuliet \n\n\nOn Mon, Aug 26, 2013 at 3:24 PM, Ashvin Bachireddy <ashvin@a16z.com> wrote:\nPeter - I\'ll ask Juliet Pullis who runs our deal team to find the right individual from our team to chat with you.\n\nThanks!\n\nAshvin\n\n\nOn Fri, Aug 23, 2013 at 3:57 PM, Peter Schwartz <pschwartz@laurencegroup.com> wrote:\nHello Ashvin I hope you are well.  I apologize for missing your call last week.  We have been busy over here.  We just launched a significant site update at www.demeure,com.  I hope you have a few minutes to review the content.  We have something pretty special.  The future of commerce in online travel.  At the heart of our offering is an MMS (Marketplace Management System) connected to our vibrant multi-sided marketplace where privacy is at the heart of it.  We have a new product and pricing lineup.  The consumer value prop is well laid out on the site, and we go to market entirely through channel partners whereby we license the platform (branded or white label) and also share fees as they transact in the marketplace.  We have re-wired the travel market and we have pretty significant momentum as we take our existing community up the value chain with the new product lineup.  As of the end of this calendar year we will have 8000 properties, 100+ channel partners including some very large demand pools, and just over 5000 active subscribers.  Revenue run-rate will be approximately 9mm USD (proforma including results of acquisition closing in Oct) and we are forecasting significant growth.\n\nBased on the management team\'s past experience we have two paths we would like to explore this fall for a larger raise to accelerate our growth and capitalize on our time to market advantage and our plans for market consolidation.  I was the chair and ceo of www.descartes.com cross-border listed on the TSX and the NASD so we are also working with a short list of investment banks to explore plans.\n\nI am also attaching an internal corporate positioning deck.  We will have a full pitch deck and updated model in two weeks and I will forward when it is ready.\n\nIf you would like to arrange a call for this week, please let me know\n\nHave a great weekend.\n\nPeter\n\n\n\n\n\n\n\n-- \nAshvin Bachireddy\nPartner | Andreessen Horowitz\no: 650.798.5819 | m: 415.350.5170 \nEmail: ashvin@a16z.com | Skype: ashvin.bachireddy\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-05 20:30:50','2013-10-08 14:23:49','0',0,'2013-09-17 15:00:00','2013-09-17 16:00:00'),(18647,286,'2kdlvqhbid88456bnh6cks5tho_20130927T140000Z',NULL,'TEST - 8 hours','2013-09-27 15:00:00','2013-09-27 23:00:00',0,NULL,NULL,'Hennie Strydom','270win@gmail.com','2013-06-22 18:45:58','2013-06-22 18:46:19','0',0,'2013-09-27 07:00:00','2013-09-27 15:00:00'),(18752,309,'_60q30c1g60o30e1i60o4ac1g60rj8gpl88rj2c1h84s34h9g60s30c1g60o30c1g6oo48ca16cp3ae1m8l0k6e9g64o30c1g60o30c1g60o30c1g60o32c1g60o30c1g6ks3aghl70ojaci169130h9k8914cdhj6h13gghm6cp4cg9l6kog_20130916',NULL,'Bikul, Robin\'s Birthday','2013-09-16 08:00:00','2013-09-17 08:00:00',0,NULL,NULL,'Kevon Saber','ksaber@gmail.com','2010-08-31 18:49:41','2010-10-10 01:17:43','0',0,'2013-09-16 00:00:00','2013-09-17 00:00:00'),(18699,303,'2jjaan9ovmkrlfi2isiag6sft4_20130926T230000Z',NULL,'Spend some time with #SX folks','2013-09-27 00:00:00','2013-09-27 03:00:00',0,NULL,NULL,'HMS Strydom','ribbok@gmail.com','2013-02-25 17:10:30','2013-02-25 17:10:30','0',0,'2013-09-26 16:00:00','2013-09-26 19:00:00'),(18419,313,'72tnuvvkqp3p1qjb2l5rr8m16s',NULL,'Meet with Ciaran OÂ´Leary, Earlybird Venture Capital','2013-09-10 22:00:00','2013-09-10 23:00:00',0,'9.10. confirmed.\nOn Aug 20, 2013, at 1:23 AM, \"Golke, Claudia\" <Golke@earlybird.com> wrote:\n\nHi Ana Marie,\n \nI believe the meeting with Chris and Ciaran has not been fixed yet.\nCiaran can be available e.g. on Sept. 10th at 3pm Pacific Time. Would this also be a good date and time for Chris?\nLooking forward to hearing from you.\n \nBest\nClaudia\n \nClaudia Golke\nEarlybird Venture Capital\nMaximilianstr. 14   80539 MÃ¼nchen   Germany\nTel +49-89-290702-0 \nwww.earlybird.com\nwww.twitter.com/EarlybirdVC\nwww.facebook.com/EarlybirdVC\nwww.linkedin.com/company/earlybird-venture-capital\n \n__________________________________________________\n\nEarlybird Venture Capital GmbH & Co. KG\nGeschÃ¤ftsfÃ¼hrer/ Managing Partners: Dr. Hendrik Brandis   Roland Manger   Rolf Mathies   Dr. Christian Nagel    \nHRA 100365   PHG Earlybird Venture Capital Verwaltung GmbH  HRB 203769\n \nFrom: OÂ´Leary, Ciaran <OLeary@earlybird.com>\nSubject: Re: In the Valley / September\nDate: July 11, 2013 5:07:49 PM GMT+02:00\nTo: Juliet Pullis <Juliet@a16z.com>\nCc: Chris Dixon <Chris@a16z.com>, Ana Marie Corona <AnaMarie@a16z.com>\n \nHey Juliet,\n \ngreat - looking forward. Funny, when I got your response I was just sitting beside Onno, the founder of DingDong - and he mentioned Chris had tweeted about it being the next nerd-app a while back. To make a long story shot - we just led a seed round in the company (on the plans to move beyond a nerd-app ;)) & here\'s a link to the beta if you\'re interested:  http://www.dingdongapp.com/beta/pink-elephant  \n \nIn any case looking forward to meeting up,\n \nCiarÃ¡n \nhttp://berlinvc.com/\nwww.twitter.com/ciaranoleary\n \nOn Jul 10, 2013, at 9:59 PM, Juliet Pullis <Juliet@a16z.com> wrote:\n \n(moving Marc to bcc).  Hi Ciaran, great to meet you virtually.  We\'d love to meet during your Sept trip.  I\'m adding Ana Marie who manages Chris\' calendar - she will help us find a time that works.\n \nLooking forward to it.\n \nJuliet\n \nOn Wed, Jul 10, 2013 at 9:08 AM, Marc Andreessen <pmarca@a16z.com> wrote:\nHi Ciaran -- thanks for the note -- please meet or re-meet my partners\nJuliet and Chris who are best points of contact!\n\nBest,\nMarc\n\nOn Thu, Jun 13, 2013 at 12:22 PM, OÂ´Leary, Ciaran <OLeary@earlybird.com> wrote:\n> Hi Marc,\n>\n> hope all is well. I\'ll be in the Valley from the 5th until the 11th of September; would love to drop by & say hi for a general quick exchange - calendar is still pretty flex - let me know what works for you or one of your partners!\n>\n> All the best,\n>\n> CiarÃ¡n (EarlybirdVC)\n\nMarc Andreessen\npmarca@a16z.com\n\n	\n',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-08-20 17:30:06','2013-10-08 14:23:49','0',0,'2013-09-10 14:00:00','2013-09-10 15:00:00'),(18420,313,'bq515m2c8s2pn3eagiht70kkrs',NULL,'AutoReturn pitch w/ Weiss','2013-09-10 23:00:00','2013-09-11 00:00:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-09-10 22:59:07','2013-10-08 14:23:49','0',0,'2013-09-10 15:00:00','2013-09-10 16:00:00'),(18421,313,'dosngdq86hcdeidevv5nrcaorc_20130911T000000Z',NULL,'Deal/Research team meeting','2013-09-11 01:00:00','2013-09-11 02:00:00',0,'=== Sean will join for us for a few minutes each meeting to talk through deal terms ===\n\nStanding agenda:\n- Deal term of the week\n- Sourcing update\n- Most interesting (or funny) deal of the weekâ€”and why\n- What you learned at a market dev meeting\n- Staff passdown/discussion\n- Open mic\n\nItems for 4/3\n- Welcome Sebastian\n- Team name: Research vs. deal. vs intelligence vs. investment vs. ??\n- SaaS\n',NULL,'Lisa Orr','Lisa@a16z.com','2012-03-23 17:51:35','2013-10-08 14:23:49','0',0,'2013-09-10 17:00:00','2013-09-10 18:00:00'),(18422,313,'0ie356aej6t0lrjhp8jc2nsss4',NULL,'Breakfast w/ Josh Gray // BigMachines','2013-09-11 15:45:00','2013-09-11 16:30:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-09-11 05:48:21','2013-10-08 14:23:49','0',0,'2013-09-11 07:45:00','2013-09-11 08:30:00'),(18423,313,'ml5v0ilr38igr3kn1hndl71tmk',NULL,'Meeting:  Jake Winebaum, Brighter ','2013-09-11 17:30:00','2013-09-11 18:30:00',0,'Jake Winebaum <jake@brighter.com>\n\nHi Jake, no worries.  We\'re excited to learn more about what you\'re building - our partner Tom is best suited to take a closer look so he\'ll take the lead on next steps.  To get things started Lisa, also cced, will help schedule time for you to meet.\n\nThanks!\nJuliet\n\n\nOn Tue, Sep 3, 2013 at 10:10 AM, Jake Winebaum <jake@brighter.com> wrote:\nJuliet,\n\nSorry about the name mix up : )\n\nJake\n\nOn Sep 2, 2013, at 2:53 PM, Jake Winebaum <jake@brighter.com> wrote:\n\nThanks Jeff and have a great time on the boat in Turkey.\n\nSusan,\n\nI\'m going to be in the bay area 9/10 and am open from 3PM on if that works on your end. \n\nJake\n\nOn Sep 1, 2013, at 9:25 PM, Jeff Jordan <jj@a16z.com> wrote:\n\nHey Jake,\n\nThanks for reaching out. We\'d love to talk about Brighter. This week is tough for me - I\'m currently writing this from a boat off of the coast of Turkey, we\'re having a final family holiday before our twins go off to college. I\'m scheduled to be back in a week.\n\nI\'ve copied Juliet Pullis who runs the deal team that on-boards all of our prospective investments, she can get things started. \n\nSent from my iPhone\n\nOn Sep 2, 2013, at 2:56 AM, Jake Winebaum <jake@brighter.com> wrote:\n\nJeff,\n\nHope all is well with you and your family.  I wanted to update you on Brighter.  We last talked just before we were raising our last round with Bill at Benchmark and you were about to start at Andreessen Horowitz.  We are about to start the fundraising process and wanted to know if you are interested.  Health care is big and complex and it has taken us a bit to figure out the right model, but now we\'ve nailed it and are on to something really big.  You\'ll find lots of interesting similarities to Open Table.\n\nBrighter is the first true healthcare marketplace where providers compete for patients based on price, quality and convenience.  Think Castlight meets ZocDoc.   We started in dental because it is a big $115 billion cash-pay market with nearly half the population uninsured and paying for their dental care without the benefit of any price transparency or negotiating leverage.  We launched the new free service in May in Los Angeles with 500 dentists in our network and it has really taken off.  We are saving patients an average of over 50% on their dental costs.  We\'ve got a great team with a proven track record in ecommerce and healthcare, a solid board (Jason Killar Hulu founder, Matt Coffin, Bill from Benchmark and Navin Chaddha from Mayfield) and we are looking to raise capital to take Brighter national following our successful launch in LA.\n\nLet me know if you are interested and when would be a good time to talk this week.\n\nJake\n\nJake Winebaum\nFounder and CEO\njake@brighter.com\nhttp://www.brighter.com\n(310) 489-8887\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-03 21:42:37','2013-10-08 14:23:49','0',0,'2013-09-11 09:30:00','2013-09-11 10:30:00'),(18424,313,'uig9e8hkk72r9qou20mcbiuk6g',NULL,'Pitch Meeting | Diesel Peltz','2013-09-11 19:00:00','2013-09-11 20:00:00',0,'<9.10. confirmed>\nDiesel Peltz\nmobile:  914-40-9823\n\n Fri, Sep 6, 2013 at 6:12 AM, Ronny Conway <ronny@a16z.com> wrote:\nHi Ana Marie,\n\nI spoke to Chris yesterday about meeting Diesel while he\'s up here next week.  Can you please let him know what times Chris is available to meet in sf wed?  I\'ll also join and will make whatever time work so just add it to my calendar and I\'ll work around it.\n\nThanks!\n\nRonny Conway\nPartner\nAndreessen Horowitz\n2865 Sand Hill Rd\nMenlo Park, CA 94025\nSuite 101\nph. 650-798-5811\n',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-09-10 16:58:05','2013-10-08 14:23:49','0',0,'2013-09-11 11:00:00','2013-09-11 12:00:00'),(18425,313,'k02pfqu4oq71d8thaa0vrudrn0',NULL,'CALL:  Daniel Goldberg, Surgiview','2013-09-11 21:00:00','2013-09-11 21:30:00',0,'Daniel Goldberg <daniel@surgiview.com\n\nHere is the link and dial-in for Tom to meet us during the 1pm PT call today.\n\nI am also sending a calendar invite right now.\n\nDISCUSSION-LINK (requires Adobe Flash on a Mac or PC)\nDIAL-IN:  303.952.0843\n\n\n\nHi Daniel --\n\nMy apologies for the delay getting back to you. We would love to learn more about Surgiview. To that end, I would like to introduce you to one of our deal team partners, Tom Rikert, so he can have an intro call with you. Lisa (cc\'d) can help with scheduling. Thanks\n\nBest,\nMark\n\n\nOn Tue, Aug 27, 2013 at 12:34 PM, Daniel Goldberg <daniel@surgiview.com> wrote:\nMark,\n\nSURGiVIEW is closing a Joint Development/Commercialization deal with the most prestigious Healthcare Institution in the country, which includes a potential $4-6MM sale of our new 2nd Generation product.\n\nWe have innovated a new software technology tied to strong federal drivers (EMR/Meaningful Use, etc) with an ARR model that delivers capabilities no one has brought to Healthcare the way we do it.\n\nAs we round up partners for our $6MM Series-A, could you please let me know if we can re-kindle our conversation from before?\n\n\nThanks,\n\nDanny\n\n\nDaniel Goldberg\nCEO & Co-Founder\nSURGiVIEW\n\n877.649.2711\nwww.surgiview.com\n\n\nOn Jul 23, 2012, at 9:24 AM, Mark Valdez wrote:\n\nJason and Daniel,\n\nThanks so much for reaching out and introducing us to Surgiview. The business has experienced great progress to date -- congratulations! After reviewing the investment opportunity with the partnership, we have unfortunately decided to pass on a potential investment in this round. Even though you have made tremendous progress that has been validated by a first class list of customers, Surgiview\'s target market is one we don\'t yet understand very well. This is makes it difficult for us to be real value add investors. Though we may not be the right financial investor at this point in time, we will definitely be cheering you on from the sidelines. Also, as the company continues to grow we would be happy to reevaluate again in the future at a much higher valuation of course! Thanks very much for thinking of us\n\nBest regards,\nMark\n\nOn Tue, Jul 17, 2012 at 3:42 PM, Jason Ressler <jason.ressler@bhpmedia.com> wrote:\nHi Mark,\n\nThanks - I believe there are some truly unique aspects of Surgiview, which is why I thought this would be an interesting early stage investment for you. Surgiview has proprietary technology, investment and customer capital coming in with strong margins, blue chip customers (like Johnson & Johnson) and a leading position in the market where they\'re disruptive and well ahead of the curve.\n\nI\'ve copied the CEO, Daniel Goldberg, on this and there are links to relevant information in the below e-mail. We\'re looking to move quickly (but smartly) and look forward to your thoughts.\n\nThanks again,\n\nJason\n\n\n\n\n\n\n---------- Forwarded message ----------\nFrom: Daniel Goldberg <daniel@surgiview.com>\nDate: Tue, Jun 19, 2012 at 3:17 PM\nSubject: SURGiVIEW, tech investment\nTo: Jason Ressler <jason.ressler@bhpmedia.com>\n\n\n\nOn SURGiVIEW\n\nSURGiVIEW has innovated media management technologies & services for Healthcare- focused on secure video archiving, live surgery broadcasting and collaboration. \nOver the past four years we have deployed & proven our tools to Hospitals, Medical Device Companies and Medical Societies in the US and Europe to help these customers save money, sell products and train better, and we have done this for companies such as Olympus, J&J, Intuitive Surgical, and our new hardware product with annual recurring revenue is in place at our first Hospital customer in the US.\n\nIn order to grow the business and seize more opportunities presented to us we are starting a $3M capital raise and have one firm that wishes to lead this round.\n\n\nPlease let me know if you can find a party that wants to get involved with SURGiVIEW at this early opportunity, and see info about our Business and the $15B TAM we face in the LINKS below,\n\nDanny\n\n\n\nLINKS\n\nSURGiVIEW 2012\n2012 Business Summary\n2012 Marketing Brochure\n2012 SURGiVIEW 1-Pager\n\n\nOTHER\nSURGiVIEW on BLOOMBERG\nRECENT PR COVERAGE\nOUR SITE\n\n\n\n\n\nDaniel Goldberg\nCEO & Co-Founder\nSURGiVIEW\n\n877.649.2711\nwww.surgiview.com\n\n\nOn Jul 17, 2012, at 10:33 PM, Mark Valdez wrote:\n\nJason,\n\nMarc forwarded your email to me. Thanks so much for reaching out. We have focused our investing efforts on computer science companies in particular. We generally do not invest in healthcare companies or because it is beyond the scope of our internal expertise. That being said, please feel free to forward materials to me and I would be happy to take a look. Thanks very much for thinking of us.\n\nBest regards,\nMark\n \n-- \nMark Valdez\nAndreessen Horowitz\nmvaldez@a16z.com\n\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-05 20:39:15','2013-10-08 14:23:49','0',0,'2013-09-11 13:00:00','2013-09-11 13:30:00'),(18426,313,'k1hmge6p45daa23qn2nk1ec8no',NULL,'Pitch Meeting | Ron Palmeri, Layer','2013-09-17 18:00:00','2013-09-17 19:00:00',0,'ron.palmeri@gmail.com',NULL,'Minerva Munoz','minerva@a16z.com','2013-09-16 19:24:28','2013-10-08 14:23:49','0',0,'2013-09-17 10:00:00','2013-09-17 11:00:00'),(18668,309,'b5bbif5p842ka3kgh7i82o5kjs_20130914T190000Z',NULL,'Cook for A&K','2013-09-14 20:00:00','2013-09-14 21:00:00',NULL,NULL,NULL,'Lacy Reiss','fig.assistant@gmail.com','2012-12-17 16:52:00','2013-09-20 01:14:47','0',0,'2013-09-14 12:00:00','2013-09-14 13:00:00'),(18427,313,'s3u5j727gcnelv06plnarlkb78',NULL,'Cortica diligence discussion','2013-09-12 23:30:00','2013-09-13 00:00:00',0,'Tom to call Blake @ 650.521.6012',NULL,'Tom Rikert','tom@a16z.com','2013-09-12 00:51:44','2013-10-08 14:23:49','0',0,'2013-09-12 15:30:00','2013-09-12 16:00:00'),(18428,313,'tsu3d367bbphvrbm5bhful4ui0',NULL,'Meet with Tom Rikert & Mark Cranny- discuss Beckon & Airphrame','2013-09-17 19:20:00','2013-09-17 20:00:00',0,'Lars Dalgaard\n6:54 PM (2 hours ago)\n\nto Jeff, me, Tom, Mark \nit did. thanks. Anamarie let\'s meet them stat after the offsite, Tuesday, and I would like to meet with Tom to discuss all of his findings in depth. then I will find JJ and C for a quick completion of thought\n\nOn Fri, Sep 13, 2013 at 2:06 PM, Jeff Jordan <jj@a16z.com> wrote:\njust want to make sure this didn\'t get lost in your inbox.\n\n---------- Forwarded message ----------\nFrom: Tom Rikert <tom@a16z.com>\nDate: Fri, Sep 6, 2013 at 10:44 AM\nSubject: Re: follow up\nTo: Jeff Jordan <jj@a16z.com>\nCc: Lars Dalgaard <lars@a16z.com>, Mark Cranney <mcranney@a16z.com>\n\nLars,\n\nAttached are initial customer metrics I got from Jenny the CEO.  It\'s really early on: 6 POC customers, and still difficult to see the patterns of user engagement.  My customer diligence calls have been with CMO\'s, and for the same reason Jeff cites from his personal experience, they love this.  But I would feel even better if we could see a broader audience from marketing/ops/sales engaging with Beckon on a regular basis.  This would be an indicator of product expansion and upsell opportunities.\n\nAnother question on my mind is how much the CMO will be willing to pay.  If the McDonald\'s CEO and CMO were excited, and Beckon could save them millions in wasted marketing budget, then a high water mark for their solution should be high $100k\'s to low millions.\n\nAs next steps, Ramu and I will meet with Beckon next week for an architecture deep dive, and I\'m also getting in touch with some folks from our portfolio company Apptio (the dashboard for the CIO) since I think there are many parallels that could inform our view of Beckon.  Below are also some additional perspectives that I had shared with Jeff.  \n\nTom\n\n---------- Forwarded message ----------\nFrom: Tom Rikert <tom@a16z.com>\nDate: Sat, Aug 31, 2013 at 11:39 AM\nSubject: Re: follow up\nTo: Mark Cranney <mcranney@a16z.com>\nCc: Jeff Jordan <jj@a16z.com>\n\nI wasn\'t in the room with McDonalds, but I\'ve come to believe this is a strong deal based on my diligence findings.  Their reference customers say the solution is delivering a lot of value (even if the data is just directionally correct) and the Beckon team knows this domain cold.  Beckon is empowering the marketing dept with \"big boy\" data so they can engage with the executive team in a more influential way and with less paperwork overhead, and customers are loving that.  Jenny has a smart vision, treats her team really well, and her people are extremely loyal.  There aren\'t any significant competitors.  The competition has been no solution or in-house solutions of dubious quality, both scenarios the CMO is unhappy about.  \n\nOne of my concerns persists however: they haven\'t really figured out how to deal with unstructured data, which I think is a big part of the secret sauce they\'re pitching to us and customers and will be necessary to scale.  A couple customers said Beckon is using a bunch of people to manually enter much of the data that comes through the cc: beckon email address, which has been a governor on how much and how fast the customer can put data into the system.  A second concern is that I feel Jochen is very hand-wavy whenever we\'ve pressed him on the technology and roadmap.  Maybe not a deal killer since they\'re still in beta mode, but I would like to see more thoughtful answers from them to get comfortable doing a Series B.  I\'ll coordinate an architecture deep dive with Ramu and Frank to get to the bottom of it.\n\nTom\n\nOn Thu, Sep 5, 2013 at 10:09 PM, Jeff Jordan <jj@a16z.com> wrote:\nHey Lars,\n\nA former eBay employee has developed a SaaS biz targeting the CMO and marketing org.  It\'s currently early stage but is showing what feels like good early traction.   I would have killed for this product at eBay where I managed a marketing budget of hundreds of millions which I strongly felt wasn\'t optimized.  Cranney has spent time with the entrepreneur and is very positive on the deal.  And Tom\'s calls to their early customers have been positive, although all also state it\'s early.\n\nWould you have an interest in meeting with Jenny?  You\'ve likely forgotten more about go-to-market on SaaS than I\'ll ever know. \n\nI\'ve copied Mark and Tom.\n\nSent from my iPad\n\nOn Sat, Aug 31, 2013 at 12:24 PM, Jeff Jordan <jj@a16z.com> wrote:\nVery much appreciate the perspectives.  Glad she presented well - her investment pitch wasn\'t the most succinct.  \n\nI would have killed for this as the owner of a big marketing budget.\n\nI agree I\'m not the logical guy for this by background, and that Lars (assuming he likes it) would be great.  I\'ve already told her she needs to meet him.\n\nSent from my iPad\n\nOn Aug 31, 2013, at 8:33 PM, Mark Cranney <mcranney@a16z.com> wrote:\n\nJenny is a REALLY good presenter.  \n\nMcDonald\'s CEO, CMO  and CIO liked it,  the VP of Marketing who does the buys and would be held accountable says that \"everyone says they can give that type of visibility, but she\'d have to see more\"  She tried to throw water on everything she saw in the briefing\" so I don\'t take too much stock in her opinion as Don, the CEO kicked the shit out of her a couple of times.  \n\nI really like Jenny and Jochen.  Their VP sales is bad.  Jenny really gets the problem and \"I think has learned the secret\" \nI like this deal a lot.  I REALLY like the CEO and her grasp of the problem which is a big one.  I think Jochen has the Tech Chops but it\'s really early on the product.  \n I\'ve already communicated this to Tom, but I\'d love to see a deep dive (with Ramu and frank in the room) on the tech and arch roadmap)  I think we\'ll see a lot of holes there, but that\'s the case always with SaaS co\'s at this stage.  \nI\'d promote this one to All GP.  And if it were me, I\'d do the deal.    If you don\'t have BOD capacity, this one may also fit w Lars.  \n It will require a REALLY good VP of Eng, VP\'s of sales and Marketing, to round out the team, but I think the CEO and CTO cofounders are the right ones for this with their Scout and Lithium dna.     \n\nOn Fri, Aug 30, 2013 at 6:45 PM, Jeff Jordan <jj@a16z.com> wrote:\nHow\'d they do?\n\nSent from my iPad\n\nBegin forwarded message:\n\nFrom: Jennifer Zeszut <jennifer@beckon.com>\nDate: August 31, 2013, 4:16:30 AM GMT+03:00\nTo: Mark Cranney <mcranney@a16z.com>\nCc: Jeff Jordan <jj@a16z.com>, Tom Rikert <tom@a16z.com>, Nicole Lazar <nicole@a16z.com>, \"marketdev@a16z.com\" <MarketDev@a16z.com>, Jochen Frey <jochen@beckon.com>, Karen Orton <karen@beckon.com>\nSubject: Re: follow up\n\nMark and team,\n\nThank you so much for letting us to be involved in the McDonald\'s presentations today. What an incredibly nice and smart group of people! and the quality of the event was amazing. Thank you on behalf of all of us entrepreneurs for doing the incredibly hard work of pulling these things together. As always, feedback on our presentation and demo is welcome, but I just wanted to say thank you before the long weekend.\n\nJenny and the Beckon team\n..............\nJennifer Zeszut\nCEO, Beckon\n415.508.4700\njennifer@beckon.com\nTwitter: @jenniferland\nwww.beckon.com\n\nPlease excuse the brevity and lack of punctuation...sent from my iPhone (and sometimes typed by Siri!)\n\nOn Aug 6, 2013, at 12:01 PM, Mark Cranney <mcranney@a16z.com> wrote:\n\nJenny,\n\nWe\'d love to plug you into our Exec Briefing Program.  I\'m copying my team and Nicole our program coordinator to get the process started.  \n\nI\'d suggest we start with an in person pitch to our team to best position you with the large company CMO\'s we have coming in the next few weeks.  but if an opportunity arises before that happens, we can also cover that on a call/webex to get the ball rolling.  \n\nLooking forward to it,\n\nMark\n\nOn Fri, Aug 2, 2013 at 11:12 AM, Jeff Jordan <jj@a16z.com> wrote:\n\nhey Jenny,\n\nthanks for forwarding.  we discussed Beckon at our deal review last night and would love to dig in on the company.  there are a couple of next steps we\'d propose:\n\n- would it be OK if we were to chat with a few of your paying customers?  we\'d love to understand their perspectives on the company and the product\n\n- Mark Cranney is our partner in charge of our market development function, the group that manag',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-09-14 04:03:01','2013-10-08 14:23:49','0',0,'2013-09-17 11:20:00','2013-09-17 12:00:00'),(18429,313,'irv2q80dhu5n0rnf2dth2gg2ns',NULL,'Pitch Meeting | Alex Selig, SoundFocus','2013-09-12 19:00:00','2013-09-12 20:00:00',0,'Alex Selig\nCEO - SoundFocus\n650-384-5871\n\nAlex Selig\n1:50 PM (4 minutes ago)\n\nto me \nHi Ana,\n\nThank you for confirming. We don\'t have an official deck but we have what we presented at demo day plus a few annotations (attached). In addition I have two videos that would help frame the conversation for Chris. \n\n1. SoundFocus Presentation from Demo Day: http://youtu.be/OFYPECwimmg\n2. SoundFocus Customer Reactions Video: http://www.youtube.com/watch?v=RUTYDs43zZU\n\nI hope this helps. Please let me know if you have any questions or need any further information from me.\n\nThanks again,\nAlex\n\nAlex Selig\nCEO - SoundFocus\n650-384-5871\n\nOn Mon, Aug 26, 2013 at 5:28 PM, Alex Selig <alex@soundfocus.com> wrote:\nHi Ana Marie,\n\nThank you for following up. I am wide open on Sept. 9 and free in the morning of Sept 10th. Just as a heads up, this timing will make it quite late for our round as we are deep in conversations with investors right now. \n\nI look forward to hearing from you soon.\n\nThanks again,\nAlex\n\nAlex Selig\nCEO - SoundFocus\n650-384-5871\n\nOn Mon, Aug 26, 2013 at 4:11 PM, Scott Kupor <scott@a16z.com> wrote:\nAlex - \n\nAs promised, I wanted to circle back following our meeting the other day.  I discussed the Soundfocus opportunity with the broader team and Chris Dixon - one of our general partners - would be interested in meeting you to learn more.\n\nI have copied his EA (Ana Marie) here as she can help with calendaring.\n\nThanks,\nScott\nScott Kupor\nManaging Partner\nAndreessen Horowitz\n2865 Sand Hill Road\nMenlo Park, CA 94025\n(o) 650 798 5813\n(m) 650 464 4624',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-08-27 17:09:53','2013-10-08 14:23:49','0',0,'2013-09-12 11:00:00','2013-09-12 12:00:00'),(18430,313,'8hhlofm19srioomdoin4guacg8_20130912T234500Z',NULL,'Enterprise Deal Review','2013-09-13 00:45:00','2013-09-13 01:30:00',0,'Required Attendees: GP\'s, Kupor, Shawn, Chaz, Valdez, Ashvin, Frank, Ramu\nOptional Attendees: Margit, Jeff, Shannon, and Mark.\n\nDial-in: (650) 242-4369\nParticipant Pin: 49199\nOrganizer Pin (Juliet to enter): 53309',NULL,'Meredith Donahue','meredith@a16z.com','2012-02-13 23:05:56','2013-10-08 14:23:49','0',0,'2013-09-12 16:45:00','2013-09-12 17:30:00'),(18431,313,'2ic4v8dalru903o6afpr5f0uvg',NULL,'Meeting with Dalton Caldwell, App.net','2013-09-12 20:30:00','2013-09-12 21:30:00',0,'\nOn Sat, Sep 7, 2013 at 10:33 AM, Scott Weiss <weiss@a16z.com> wrote:\nHey frank and Mark - Dalton is launching a competitive product to Urban Airship and wants to get feedback on a go-to-market deck this week. I would like to set up an hour meeting with me and at least one representative from your respective groups to provide feedback. Sound good? Michelle can you reach out to dalton and find a time that works?\nThanks!\n',NULL,'Michelle Mundy','michelle@a16z.com','2013-09-09 21:29:03','2013-10-08 14:23:49','0',0,'2013-09-12 12:30:00','2013-09-12 13:30:00'),(18432,313,'v2ld8t0pstj0jra0n64etcsu8g',NULL,'DNS - Deal Followups','2013-09-25 00:00:00','2013-09-25 01:00:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-09-22 17:45:22','2013-10-08 14:23:49','0',0,'2013-09-24 16:00:00','2013-09-24 17:00:00'),(18472,117,'792mmth56dfiidn64vsj871ads_20130920T200000Z',NULL,'Clean up email. Vimbli. ','2013-09-20 21:00:00','2013-09-20 21:30:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-08-04 23:28:56','2013-08-04 23:28:56','0',0,'2013-09-20 13:00:00','2013-09-20 13:30:00'),(18433,313,'7h772679jdvn755kh2sm9v2m04',NULL,'Call with Bret // Airphrame','2013-09-17 17:00:00','2013-09-17 17:30:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-09-17 18:01:50','2013-10-08 14:23:49','0',0,'2013-09-17 09:00:00','2013-09-17 09:30:00'),(18561,239,'_60q30c1g60o30e1i60o4ac1g60rj8gpl88rj2c1h84s34h9g60s30c1g60o30c1g60o3gchl8cq38di671246g9g64o30c1g60o30c1g60o30c1g60o32c1g60o30c1g6h33ahhj6kp3gh216l1k8dpk890j8gpm60r4ah9p68o44h1l8d20_20130930T030000Z',NULL,'Semiweekly Grooming','2013-09-29 22:00:00','2013-09-29 22:30:00',0,NULL,NULL,'saber_kevon@gsb.stanford.edu','saber_kevon@gsb.stanford.edu','2010-08-31 18:27:08','2013-04-30 19:03:22','0',0,'2013-09-29 22:00:00','2013-09-29 22:30:00'),(18434,313,'sm3pj16dpn51los8b735o9a4g8',NULL,'Beckon tech review meeting','2013-09-17 21:30:00','2013-09-17 22:30:00',0,'\n---------- Forwarded message ----------\nFrom: Tom Rikert <tom@a16z.com>\nDate: Fri, Sep 6, 2013 at 11:03 AM\nSubject: Meeting for tech review\nTo: Jennifer Zeszut <jennifer@beckon.com>, jochen@beckon.com\n\n\nHi Jenny and Jochen,\n\nCongrats on the good meeting with McDonald\'s!\n\nI\'d like to find an hour to meet and review your technical architecture and roadmap as part of our standard diligence process.  Our goal is to understand your technology stack, major architectural components, and development process, with an eye to how you will scale.  A summary of your roadmap for major new features would also be helpful.  My colleague Ramu who has deep experience at the architectural level will join us.  Would any of the following times work next week?\n',NULL,'Tom Rikert','tom@a16z.com','2013-09-11 15:51:43','2013-10-08 14:23:49','0',0,'2013-09-17 13:30:00','2013-09-17 14:30:00'),(18636,313,'cpa5mbnivl0u00ekdgvmknli1c',NULL,'1:1 Meeting | Tom/Shan','2013-09-17 20:30:00','2013-09-17 21:00:00',0,NULL,NULL,'Megan Kristalyn','megan@a16z.com','2013-09-13 19:32:11','2013-10-08 14:23:49','0',0,'2013-09-17 12:30:00','2013-09-17 13:00:00'),(18637,313,'6mu4rh5ji5gdmrr60fmasnrlcg',NULL,'Rob\'s last day','2013-09-13 08:00:00','2013-09-14 08:00:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-08-29 17:29:25','2013-10-08 14:23:49','0',0,'2013-09-13 00:00:00','2013-09-14 00:00:00'),(18638,239,'_8cs3egpj8kr46da36ssj8di38p144e1p8d0kag9k60rjegi1851j0c1g60o30c1g60o30c1g60o30c1g60o30c1g60o30c1g60o30c0_20130919T023000Z',NULL,'Wednesday night dinner!','2013-09-18 21:30:00','2013-09-18 23:00:00',0,'Changing the time to 7:30pm to accommodate more people. \n\n\nUpdating this to occur once every 2 weeks (instead of each week).  \n\n\n\nHey folks!\n\nIt would be great idea to have a weekly group dinner on our calendars for whoever can show up that week!  \n\nWeâ€™ll pick a location each week!  Suggestions can be sent to me and Iâ€™ll update the calendar invite accordingly.\n\nPlease forward this to other GSBâ€™ers / friends in the area in case Iâ€™m missing someone. \n\nThanks!\n-Amanda\nView your event at http://www.google.com/calendar/event?action=VIEW&eid=XzhjczNlZ3BqOGtyNDZk