n\nScheduling a standing meeting time to sync on your projects.  Let\'s meet in the 2875 library.  This will be quick and informal.  Please be ready with a summary of what you\'ve been working on, next steps, and any blockers where I can provide help/guidance.  \n\nTom',NULL,'Tom Rikert','tom@a16z.com','2013-06-24 16:21:15','2013-10-08 14:23:50','0',0,'2013-09-11 17:00:00','2013-09-11 17:15:00'),(18450,313,'45e2sbi1pba45568rdvuch02bc_20130912T230000Z',NULL,'Consumer Deal Review','2013-09-13 00:00:00','2013-09-13 00:45:00',0,'Required Attendees: GP\'s, Kupor, Shawn, Frank, Chaz, Valdez, Ashvin, Ronny, Connie, Brian\nOptional Attendees: Margit, Jeff, Shannon, and Mark\n\nDial-in: (650) 242-4369\nParticipant Pin: 49199\nOrganizer Pin (Juliet to enter): 53309',NULL,'Meredith Donahue','meredith@a16z.com','2012-05-15 23:57:03','2013-10-08 14:23:50','0',0,'2013-09-12 16:00:00','2013-09-12 16:45:00'),(18451,313,'q5oglq98p9ljkrrfp7ko35e754',NULL,'Academic Roundtable Event','2013-09-28 16:00:00','2013-09-28 21:00:00',0,'9/10 agenda and guest attached',NULL,'Karen Webb','kwebb@a16z.com','2013-09-11 18:49:26','2013-10-08 14:23:50','0',0,'2013-09-28 08:00:00','2013-09-28 13:00:00'),(18754,309,'dv1f5kv3imcogsq7g50cibvaas',NULL,'Brunch with Cheryl Kovacs','2013-09-21 18:00:00','2013-09-21 19:00:00',NULL,NULL,NULL,'Annie Saber','anniesaber@gmail.com','2013-09-20 11:40:43','2013-09-20 11:41:09','0',0,'2013-09-21 10:00:00','2013-09-21 11:00:00'),(18452,313,'h82oaqsfpug2bngqi03s54t1q4',NULL,'All GP Pitch Meeting | Pramod John, Oration','2013-09-24 00:30:00','2013-09-24 01:30:00',0,'Meeting attendees: \nPramod John, Darin Buxbaum, VP of Product Management, and \nMike Reisler, VP of Finance\n\nPramod John\nDirect: +1 510.397.8768 | \nMobile: +1 650.533.5275 | \npramod.john@oration.com\n\nPeter Levine  is sponsor',NULL,'Meredith Donahue','meredith@a16z.com','2013-09-10 23:57:45','2013-10-08 14:23:50','0',0,'2013-09-23 16:30:00','2013-09-23 17:30:00'),(18536,117,'3pjn745lo8ovf3v3i98meuj894_20130914T043000Z',NULL,'Reflect. Celebrate now. Plan. ','2013-09-14 05:30:00','2013-09-14 06:00:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-01-23 07:09:03','2013-08-04 23:00:30','0',0,'2013-09-13 21:30:00','2013-09-13 22:00:00'),(18453,313,'9k3s6tf33dcrckobm994sg56vs',NULL,'Human Rights Watch event','2013-09-26 01:00:00','2013-09-26 03:00:00',0,'Please Join Human Rights Watch and Andreessen Horowitz for an exciting conversation on Wednesday, September 25. Human Rights Watchâ€™s, Peter Bouckaert, discusses technologyâ€™s emerging role in the realization of human rights and as a tool for accountability. Peter will share his knowledge and expertise on human rights issues and the ways in which technology interacts with them.\n\nâ€œNew technologies are changing the landscape of human rights activism. Satellite technology has enabled Human Rights Watch to collect evidence in countries like Syria, Ethiopia, and China that are desperate to hide their human rights abuses. In Libya, video forensics and meta-data analysis from citizen-gathered videos have helped us to identify the perpetrators of crimes. And a stronger reliance on social media has helped to expand our global audience. But as human rights abusers also use increasingly more sophisticated technologies to attack and censor human rights groups, we must continue our efforts to defend our work and protect our local partners. Join us for a session that will explore the technological innovations and the technological challenges that are altering the human rights movement today.â€\n-Peter Bouckaert\n\nPeter Bouckaert, Human Rights Watch\'s emergencies director and an expert in humanitarian crises, is responsible for coordinating the organization\'s response to major wars and other human rights crises. A Belgian-born Stanford Law School graduate, specializing in the laws of war, Bouckaert is a veteran of fact-finding missions to Lebanon, Kosovo, Chechnya, Afghanistan, Iraq, Israel and the Occupied Palestinian Territories, Macedonia, Indonesia, Uganda, Sierra Leone, and many other war zones. Mr. Bouckaert\'s previous assignments have included investigating the September 28, 2009 stadium massacre and rapes in Guinea, the 2006 Israel-Hezbollah conflict, and the 2005 massacre of hundreds of protesters in Andijan, Uzbekistan. Most recently, Mr. Bouckaert investigated human rights abuses during the 2011 conflict in Libya, including the use of landmines and arbitrary arrests of African migrant workers. He has testified about war crimes before the United States Senate, the Council of Europe, and at the Yugoslav Tribunal (ICTY) in the Hague, and has written opinion pieces for papers around the world. His work has been profiled in Rolling Stone, The Washington Post, The Stanford Lawyer, and The Santa Barbara Independent Newspaper.\n \n',NULL,'Jeanne Moeschler','jeanne@a16z.com','2013-09-04 22:04:43','2013-10-08 14:23:50','0',0,'2013-09-25 17:00:00','2013-09-25 19:00:00'),(18454,313,'obsa5rv5lqeplq43cb1acpggv4',NULL,'Pitch Meeting | Carter Cleveland, Artsy ( 2:30pm ET/ 11:30am PT)-NYC','2013-09-19 19:30:00','2013-09-19 20:30:00',0,'deck included..amc\n\nCarter Cleveland\n3:25 PM (3 hours ago)\n\nto Chris, me \nSure, I\'m open after 11am. Happy to host at our offices, 401 broadway, 25th flr, btw canal and walker. \n\n[A.]		Carter Cleveland | Artsy\n                Twitter\n\nSummary of Artsy\'s recent progress in Forbes: Putting the Art World Online \n\nWe\'re hiring!! Artsy seeks engineers, data scientists, product designers, specialists, and gallery liaisons (New York, London, LA, Paris, Berlin, and Hong Kong)\n\n\nOn Sun, Sep 15, 2013 at 6:11 PM, Chris Dixon <cdixon@gmail.com> wrote:\nHey Carter - I\'m in NYC this week if you want to get together. Maybe Wed?\nChris\n\n\nOn Tue, Sep 10, 2013 at 9:07 PM, Carter Cleveland <carter@artsymail.com> wrote:\n> Chris, one of the things I wanted to discuss on our call was the series B\n> we\'ll be raising this fall. However things are moving faster than expected\n> and we\'ll be in the valley Sept 23rd through the 27th. I\'m not actually sure\n> who is best to go through for A16Z since Scott was our champion last time,\n> but you\'ve been a long-time supporter and investor. Let me know if you have\n> thoughts.\n>\n> I\'m copying in some info about recent traction below. If I don\'t hear back\n> in the next 24 hours, I\'ll reach out to Scott since otherwise I worry\n> scheduling may get tough.\n>\n> Carter\n>\n> We\'re making a big bet that we\'ll be the first to fully penetrate the art\n> world which has yet to embrace a single online platform. So far, we have 400\n> of the top 500 galleries, and we\'re on the way to half of the major global\n> art fairs. We have more galleries represented and investment grade work for\n> sale than any other platform in the world, and in the next 9 months we\'re on\n> track to see 10x more collector inquiries then we\'ve seen in the last 1.5\n> years.\n>\n> [A.] Carter Cleveland | Artsy\n>\n>                 Twitter\n>\n>\n> Summary of Artsy\'s recent progress in Forbes: Putting the Art World Online\n>\n>\n> We\'re hiring!! Artsy seeks engineers, data scientists, product designers,\n> specialists, and gallery liaisons (New York, London, LA, Paris, Berlin, and\n> Hong Kong)\n>\n>\n>\n> On Fri, Sep 6, 2013 at 3:03 PM, Carter Cleveland <carter@artsymail.com>\n> wrote:\n>>\n>> Chris, sorry for the delay. You sent this right after I left for Burning\n>> Man so just getting to it now. Things have been going very well. Would love\n>> to catch up. Are you in NYC next week? Otherwise, let\'s do a Skype call. I\'m\n>> pretty open next week.\n>>\n>> Carter\n>>\n>> [A.] Carter Cleveland | Artsy\n>>\n>>                 Twitter\n>>\n>>\n>> Explore the Art Rio 2013 art fair on Artsy: http://artsy.net/artrio\n>>\n>>\n>> Artsy\'s open source projects: http://artsy.github.com/open-source/\n>>\n>>\n>>\n>> On Tue, Aug 27, 2013 at 11:49 PM, Chris Dixon <cdixon@gmail.com> wrote:\n>>>\n>>> Hey Carter - Thanks! Honestly, I don\'t think I\'ll be able to talk\n>>> nearly intelligently about art, especially for your audience. So I\n>>> probably won\'t be the best person to ask.\n>>> How are things? I\'d love to catch up sometime. I keep hearing good\n>>> things.\n>>> Chris\n>>>\n>>>\n>>> On Thu, Aug 22, 2013 at 8:13 PM, Carter Cleveland <carter@artsymail.com>\n>>> wrote:\n>>> > Hi Chris, hope all is well and sorry we didn\'t get to connect in June.\n>>> > I\n>>> > know this might be a long-shot for you, but the editorial team at Artsy\n>>> > just\n>>> > asked me if we could reach out to you for an interview. They\'d be\n>>> > really\n>>> > excited to connect and have a fun/casual chat about your interest in\n>>> > art,\n>>> > the intersection of art and technology, maybe pick your favorite\n>>> > artworks on\n>>> > Artsy, etc...nothing too serious. We\'ve been mostly focused on the art\n>>> > world\n>>> > (interviewing major artists like JR, Nick Cave, Cai Guo-Qiang, Vito\n>>> > Acconci,\n>>> > as well as curators and collectors) and are hoping to branch out and\n>>> > engage\n>>> > influencers in the tech community, like yourself. Let me know if you\'d\n>>> > be\n>>> > interested and I can put you in touch.\n>>> >\n>>> > [A.] Carter Cleveland | Artsy\n>>> >\n>>> >                 Twitter\n>>> >\n>>> >\n>>> > Explore 1,600+ works from 120+ galleries at Art Basel 2013 on Artsy:\n>>> > http://artsy.net/art-basel\n>>> >\n>>> >\n>>> > Artsy\'s open source projects: http://artsy.github.com/open-source/\n>>',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-09-16 02:24:44','2013-10-08 14:23:50','0',0,'2013-09-19 11:30:00','2013-09-19 12:30:00'),(18455,313,'arf2fv9uhkupt3jdqgq8s3mb1k',NULL,'Pitch Meeting | William (Bill) Santana Li, Dr. Arne Stoschek, Stacy Dean Stephens, Knightscope (CD,BH)','2013-09-25 21:00:00','2013-09-25 22:00:00',0,'Ana Marie,\n\nYes, we will make it work!  Thanks for following up and for the help.  I will have Dr. Arne Stoschek (VP