eptember 10, 2013 10:07 AM\nTo: Kyle Samani; Tom Rikert\nCc: Shanna Tellerman; Erin Lens\nSubject: Re: Pristine.io presentation to Glass Collective\n\nLooking forward! Adding Erin who can help with details.\n\nFrom: Kyle Samani <kyle@pristine.io<mailto:kyle@pristine.io>>\nDate: Tue, 10 Sep 2013 11:48:18 -0500\nTo: Tom Rikert <tom@a16z.com<mailto:tom@a16z.com>>\nCc: Shanna Tellerman <shannat@google.com<mailto:shannat@google.com>>, Megan Quinn <mquinn@kpcb.com<mailto:mquinn@kpcb.com>>\nSubject: Re: Pristine.io presentation to Glass Collective\n\nShanna Tom and Megan\n\nNice to virtually meet!\n\nCan you send me the exact office address and suite number I\'ll be heading to? I want to make sure I go to the right place.\n\nMy flight lands at 8:14AM that morning, so I\'ll probably be in by 9:30 AM. I\'ll hang around, and hopefully bump into some other Glass-wielding compatriots to share ideas. If you\'re ready for me early, I\'ll be there.\n\n\nKyle Samani\nFounder, CEO, Pristine<http://Pristine.io>\nBlogger, HIStalk<http://www.histalk.com>\nPristine\'s blog<http://blog.pristine.io>, Twitter<https://twitter.com/pristineio>, and AngelList<https://angel.co/pristine-1>\nMy blog<http://www.kylesamani.com>, Twitter<http://www.twitter.com/kylesamani>, AngelList<https://angel.co/kyle-samani>, and more about me<http://www.about.me/kylesamani>\ne: kyle@pristine.io<mailto:kyle@pristine.io>        c: 512 293 6021\n\n\nOn Tuesday, September 10, 2013 at 11:16 AM, Tom Rikert wrote:\nHi Kyle,\n\nI look forward to meeting you and learning more about Pristine!\n\nTom\n\nOn Tue, Sep 10, 2013 at 9:12 AM, Shanna Tellerman <shannat@google.com<mailto:shannat@google.com>> wrote:\n\nKyle,\nI wanted to introduce you to Megan and Tom who are a part of the Glass Collective and the representatives from KPCB & a16z who will be at the meeting next Thurs.  I will be in Boston that morning - landing and heading to a meeting during the time slot - so I will try to call in but may not be there for the full time.  Feel free to connect with Megan on the day of for any questions.\n\nWe have 9-11am blocked off on Thursday 9/19 for Glass Collective meetings so if you can plan to be in the office by 10:15am that would be great.  The meeting will be held at the KPCB offices in Menlo Park, CA 2750 Sand Hill Road, directions here<http://www.kpcb.com/contact>.\n\nPlease let us know if you have any questions.\nBest,\nShanna\n\n\n\n\n--\nTom Rikert\nPartner\nAndreessen Horowitz\n2865 Sand Hill Road, Suite 101\nMenlo Park, CA 94025\no: 650.798.5875 | m: 415.336.5568 | tom@a16z.com<mailto:tom@a16z.com>\n\n\n\n',NULL,'Tom Rikert','tom@a16z.com','2013-09-10 18:15:45','2013-10-08 14:23:51','0',0,'2013-09-19 10:00:00','2013-09-19 10:45:00'),(18756,313,'1vkdj17fk1vrl9riks35350rr4',NULL,'Meeting with Tom Rikert, Andreessen Horowitz / Victoria Cheng, Arjan Schutte, Core Innovation Capital','2013-09-24 23:00:00','2013-09-25 00:00:00',0,'Victoria\'s mobile: 240-997-2838\nArjan\'s mobile: 612-805-6227\nTom\'s mobile: 415-336-5568 ',NULL,'Joelle Nadjari','admin@corevc.com','2013-09-11 07:46:15','2013-10-08 14:23:51','0',0,'2013-09-24 15:00:00','2013-09-24 16:00:00'),(18812,207,'m6i6uor8glt8otfqh141s533kg',NULL,'Girl and the Fig','2013-09-30 02:15:00','2013-09-30 04:15:00',0,'Dear Tom Rikert,\n\nThank you so much for choosing the girl & the fig - Sonoma! Your reservation for a party size of 2 at Sunday, September 29, 2013 at 6:15 PM is confirmed.\n\nYour confirmation number is: cityeats-odr-4bc7-1aefc2\n\nWe are so looking forward to you joining us.  If there is something we can do to make your dining experience more pleasurable or any changes you need to make to your reservation, please don\'t hesitate to let us know by calling 707.938.3634 ext.10\n\nSee you soon in Sonoma!!\n',NULL,'Tom Rikert','tom@a16z.com','2013-09-22 19:15:12','2013-09-22 19:15:12','0',0,'2013-09-29 18:15:00','2013-09-29 20:15:00'),(18759,172,'l5v3h0c72cpsj2cv492mj76flc_20130916T050000Z',NULL,'Sleep Dec 1','2013-09-16 