kqpu16rbu773qnol0i5n4sbs',NULL,'Kat Knecht/ David Evans IGNITE 1:1 coaching session','2013-10-10 23:30:00','2013-10-11 00:15:00',0,NULL,NULL,'Rachel Aube','rachel@jeditrainers.com','2013-10-05 16:02:46','2013-10-09 13:44:47','0',0,'2013-10-10 15:30:00','2013-10-10 16:15:00'),(19076,212,'tacs5d8fsjhbnatu6fk4op9es0',NULL,'Schedule Mary?','2013-10-12 00:30:00','2013-10-12 01:30:00',0,NULL,NULL,'Rachel Aube','rachel@jeditrainers.com','2013-10-05 16:04:34','2013-10-05 16:04:42','0',0,'2013-10-11 16:30:00','2013-10-11 17:30:00'),(19167,207,'s9u9aal8q9ia349v3dj5fhdol4',NULL,'Dinner at Promod\'s','2013-10-03 03:00:00','2013-10-03 05:00:00',0,'Hi Tom,\n\nThanks for spending time with me and Neil Ahlsten the other day for Carpenters and the prayer app.  We were encouraged and motivated by your feedback and questions, and look forward to keeping you apprised.\n\nSeparately, a few friends and I would like to invite you to a dinner we\'re organizing with Promod Haque.\n\nPromod Haque, senior managing partner at Norwest Venture Partners, is graciously hosting a dinner for Christians in venture capital.  The festivities will be held at his office in Palo Alto on Wednesday, Oct 2 at 6:30pm.\n\nOur intention is to form a community of believers to deepen and mature in our vocational calling to venture capital, learn together how to navigate the integrated life of faith and work, pray for each other and Silicon Valley, and support each other as we seek to emulate Jesus in the marketplace.  We plan to limit the party to a dozen people so that we can hold a \"Jeffersonian Dinner\" in which everyone participates in a single conversation.\n\nIdeally we\'ll have a mixture of people in the early stages of their careers with people well established in the industry.  We welcome your suggestions for other people who would enjoy a dinner with fellow believers in venture capital.\n\nPlease RSVP quickly to reserve your seat at dinner.  We\'d love for you to be there --Thanks!\n\nPS -- As we try to build out this community, your feedback is appreciated.\n\nSincerely,\n\nEdward Tsai (VP, DCM)\nDaniel Shi (Corp Dev, Tencent)\nJosh Kwan (Co-Founder, Praxis)',NULL,'Tom Rikert','tom@a16z.com','2013-09-22 17:13:52','2013-10-06 02:59:04','0',0,'2013-10-02 19:00:00','2013-10-02 21:00:00'),(19077,313,'u9pqaq254br2jrgpheopvllf00',NULL,'OOO','2013-09-30 08:00:00','2013-10-01 08:00:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-09-22 20:02:56','2013-10-08 14:23:51','0',0,'2013-09-30 00:00:00','2013-10-01 00:00:00'),(19078,313,'7c0u40mhn3idbh7can85hd45ko',NULL,'Meeting: Nick Weir, Blue Kangaroo','2013-10-01 21:00:00','2013-10-01 22:00:00',0,'Nick Weir <nick@bluekangaroo.co\n\nNick,\n\nThanks for the updates - my calendar has been swamped this week.  Sounds like you are making some good progress, with some big events taking place in Oct / Q4.  Would it make sense to connect in 4-8 weeks? If you\'d prefer to chat now,  Lisa cc:ed can help find a time for a 30min call next week.\n\nBest,\n\nTom\n\n\nOn Wed, Sep 11, 2013 at 5:12 AM, Nick Weir <nick@bluekangaroo.co> wrote:\nHi Tom,\n\nHope you had a great summer!  I wanted to provide a brief update on the Roo and see if you might like to catch up.\nActive users:  Over 600k today, 1M expected by October, 5M by year-end\nDistribution:  Already pre-loaded on AT&T and Sprint; distribution with Verizon, AVG, and Canada Post commences Q4\nData/Engagement:  Collecting >10 commercial events per week per user, with a 7% CTR on offer listings.  (A top 20 internet brand indicated that for their highest-valued customers, they have less than 1/10th the data that the Roo has.)\nProduct:  Releasing v3 of app in Q4, with innovative social shopping features and more\nLaurence and I will be in the Bay area next Tues and Wed, the 17th and 18th, if you might happen to have time available.  Otherwise, happy to meet online whenever you like.\n\nCheers!\nNick\n\nNick Weir\nCEO\n logo_with_text-signature1%229x0%228-01+copy.jpg\n\nOffice:  855.320.4490, x500\nMobile: 917-916-8181\nSite:      www.BlueKangaroo.com\n\nFrom: Tom Rikert <tom@a16z.com>\nDate: Monday, May 13, 2013 7:48 PM\n\nTo: Laurence Marks <laurence@bluekangaroo.co>\nCc: Nick Weir <nick@bluekangaroo.co>\nSubject: Re: Blue Kangaroo\n\nNick and Laurence,\n\nIt was great meeting you and thanks for the continued updates on the business. \n\nI discussed the opportunity further with my partners, including details from our most recent meeting and the updates you\'ve shared since.  We were impressed by the progress you\'ve made, including the focus on mobile-first use cases, the impressive real estate you\'ve garnered in mobile browsers across multiple carriers, and the email and notification touch points to foster on-going engagement.  The 8% CTR on offers also seems strong.\n\nNotwithstanding the progress, we aren\'t quite ready to make a Series B bet given the limited set of 50k users today.  The offer views/user/month figure also felt low to us, and for a Series B that is a bet on consumer adoption, we typically look for a clear trajectory with many users and increasing engagement.  \n\nWe are very excited about the team and progress to-date, and I would definitely like to keep in touch and receive updates as you roll out to additional carriers in the coming quarters.   We appreciate the opportunity to have met with you and would certainly consider investing at a later stage if the opportunity becomes clearer to us. \n\nBest,\n\nTom\n\n\nOn Mon, May 13, 2013 at 11:58 AM, Laurence Marks <laurence@bluekangaroo.co> wrote:\nThanks Tom-\n \nLots going on here last week with follow-up meetings with Sprint (initial feedback on launch), Verizon (prepping for launch), Rogers (planning Q3-Q4 work together), ePost (Canada launch prep), etcâ€¦   And this week Nick is in town for VC/partner meetings. \n \nLet us know if it makes sense to get together again while he is here.\n \nLaurence\n \n \nFrom: Tom Rikert [mailto:tom@a16z.com] \nSent: Monday, May 13, 2013 10:47 AM\nTo: Laurence Marks\nCc: Nick Weir\nSubject: Re: Blue Kangaroo\n \nLaurence,\n \nThanks very much for the steady stream of updates.  Congrats on the latest launch with Sprint!  I\'ve been using the toolbar on my ATT One X and it works quite well. \n \nI\'ll aim to update you later today on our status.\n \nBest,\n \nTom\n \n \n\nOn Fri, May 3, 2013 at 2:19 AM, Laurence Marks <laurence@bluekangaroo.co> wrote:\nHi Tom-\n \nWe wanted to follow-up with a brief update on The Roo and to see whether you have any feedback.\n \nSprint began selling the new Galaxy S4 devices last Saturday with Blue Kangaroo pre-loaded as a browser extension next to the Facebook, Twitter and Google Apps extensions.  So, we have AT&T and Sprint live, with Verizon preparing to launch by July.\n \nNick will be back in town the week of May 13th.  Please let us know if you and your colleagues would like to meet either  Tuesday 5/14 or 5/15.\n \nWe look forward to talking again soon,\n \nLaurence\n \n \nLaurence Marks\n \nChief Revenue Officer \n\nWhatâ€™s the Roo found for you? â„¢\n \nMobile:  650-248-9828\nEmail:  laurence@bluekangaroo.co\nwww.BlueKangaroo.com\n \n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-20 20:30:03','2013-09-23 17:52:02','0',0,'2013-10-01 13:00:00','2013-10-01 14:00:00'),(19079,313,'2mvv87mo62gd2ti5d9m3r88hfs',NULL,'Meeting:  Eric Roach, Everyone Social ','2013-10-01 22:30:00','2013-10-01 23:30:00',0,'Eric Roach <eroach@everyonesocial.com\n\nHi Eric, we look forward to meeting.  I\'d to introduce you to our partner Tom who focuses on SaaS and will take the lead on next steps.  Lisa, also cced, can help coordinate schedules.  \n\nWe will keep Lars in the loop as well.\n\nBest,\nJuliet\n\n\nOn Tue, Sep 17, 2013 at 12:05 PM, Eric Roach <eroach@everyonesocial.com> wrote:\nJuliet,\n\nPleasure to meet. We are indeed going to be in the valley in a few weeks. We will be there between the 30th and the 4th. When would be a good time to meet in person? I\'ll try and get something down in the meantime. \n\n\nV Eric Roach\nCEO & Co-founder\nEveryoneSocial.com\n\n408.431.8000\n@veroach\n\n\nOn Mon, Sep 16, 2013 at 7:15 PM, Juliet Pullis <juliet@a16z.com> wrote:\nThanks Nick (moving to bcc).  Hi Eric, its great to meet you virtually.  We\'re looking forward to learning more about your progress and plans - could you send an overview or exec summary as a next step?  And please let me know what level of fundraising you\'re seeking - that will help us match you with the right team here.\n\nBest,\nJuliet\n\n\nOn Mon, Sep 16, 2013 at 8:59 AM, Nick Efstratis <nick@epicvc.com> wrote:\nEric,\n\nMeet Juliet at A16Z. She and Lars are part of the SaaS team there and asked that I connect you. \n\nNick\n\n\nOn Saturday, September 14, 2013, Marc Andreessen wrote:\nThanks Nick!  Our partner Juliet will connect directly and run the process.  Also CCing Lars who is our most SAAS-experienced partner.\n\nBest,\nMarc\n\n\n\nOn Fri, Sep 13, 2013 at 12:57 PM, Nick Efstratis <nick@epicvc.com> wrote:\nMarc and Mark,\n\nHope you are well.  Utah companies are on fire.  Been fun.  We seeded one thats ready for prime time.  Want to take a look?\n\nEveryoneSocial (ES) is an SaaS-based employee social advocacy platform.  Translated, leverage your employees social networks to build your company brand!  \n\nES has a bunch of small and mid-size customers but most interestingly, we also signed DELL and Citrix.  We started with just a small set of users at each of these accounts and are now rolling out organizationally to over 9,000 employees at each.  We recently sold Adobe and SAP as well...so expect larger roll-outs there soon.\n\nLet me know if you would like an intro to Eric Roach, the CEO.  Eric previously founded and sold Lombard Brokerage to Morgan Stanley and was on the Board of Altiris.  He\'s no first-timer.\n\nBest,\nNick\n\nNick Efstratis\nManaging Director\nEPIC Ventures\n\n\n\n-- \nMarc Andreessen\npmarca@a16z.com\n\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-23 20:35:44','2013-09-23 22:22:55','0',0,'2013-10-01 14:30:00','2013-10-01 15:30:00'),(19080,313,'a8jo7dnl22hvb0ansujct85qcc',NULL,'Pouyan - Tom coffee','2013-10-01 16:30:00','2013-10-01 17:15:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-09-24 14:48:10','2013-09-24 17:19:48','0',0,'2013-10-01 08:30:00','2013-10-01 09:15:00'),(19081,313,'rvdk8q7ps1fge1b9471n6s3tv8',NULL,'Dinner at the Jain Casa','2013-10-13 02:00:00','2013-10-13 04:50:00',0,NULL,NULL,'Vikas Jain','vijain@google.com','2013-09-24 20:23:13','2013-10-11 18:41:29','0',0,'2013-10-12 18:00:00','2013-10-12 20:50:00'),(19082,313,'i9lg1iqsjkjrh2bca9nqkvvsog',NULL,'Meeting:  Allen Romero ','2013-10-02 23:00:00','2013-10-03 00:00:00',0,'Allen Romero <allen@hanglocal.us\n\n\nHi Allen,\n\nGood to hear from you!  I\'d be happy to chat.  My schedule this coming week is packed except for Thu, but Lisa cc:ed from our team can coordinate a time for us either then or the following week.\n\nTom\n\n\nOn Sun, Sep 22, 2013 at 10:43 AM, Tom Rikert <tom.rikert@gmail.com> wrote:\n\n\n---------- Forwarded message ----------\nFrom: Allen Romero <allen@hanglocal.us>\nDate: Wed, Sep 18, 2013 at 2:06 AM\nSubject: Catch Up and Hang Local\nTo: Tom Rikert <tom.rikert@gmail.com>\n\n\nHey Tom!\n\nCongrats on joining Andreessen Horowitz. I just realized that recently! :)\n\nI\'m about to start fundraising for Hang Local. I\'d love your\ninvaluable feedback.\n\nLink to current Goog Preso Deck\n\nhttp://bit.ly/17gZpwa\n\nCan we chat this week?\n\nCheers bro!\n\nAllen\n\n\n\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-25 21:02:11','2013-09-26 19:47:33','0',0,'2013-10-02 15:00:00','2013-10-02 16:00:00'),(19317,172,'3pjn745lo8ovf3v3i98meuj894_20131012T043000Z',NULL,'Reflect. Celebrate now. Plan. ','2013-10-12 05:30:00','2013-10-12 06:00:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-01-23 07:09:03','2013-08-04 23:00:30','0',0,'2013-10-11 21:30:00','2013-10-11 22:00:00'),(19083,313,'84ng8c635vql729jgjm4h11htg',NULL,'Meeting with