nsy\n\no   Parul Batra: Insight\no   Ben Merewitz: Agile Devices\no   Rich Przekop: Liquor Picker\no   Jon Barker: Buoyancy\no   Meltem Demirors: Divya - solar search\no   Josep Marc Mignot: Datacademy\no   Akansh Murthy: Hermes Clinical\no   Rachel Patterson: Skej\no   Kiran Ratnapu: crop blight detection\n \no   Dave Hoyme: organizer\no   Mikesh Vora: organizer\no   Luke Tatone: organizer\no   Erica Swallow: organizer\no   Vanessa Anderson: organizer\no   Gerrit Hall: organizer\no   Victoria Young: organizer\n\nFrank, do you or someone on your team have time to meet with a small group of MIT students/entrepreneurs?\nWe could keep to an hour.\nThey\'ll be in the Bay Area from 13-15 of October.\nThanks!\ngrace\n\n\n---------- Forwarded message ----------\nFrom: Gerrit Hall <g@sloan.mit.edu>\nDate: Wed, Sep 18, 2013 at 10:19 AM\nSubject: Re: MIT Venture Capital Conference (MIT Sloan)\nTo: Grace Ellis <grace@a16z.com>\n\n\nWe\'d have five to eight students describe their idea or startup for up to a minute, and have Andreessen engage in q&a and provide constructive feedback.  Most other firms are also taking some time at the outset to describe their philosophy and how it differs from others in the valley.  We\'ve been booking an hour, but could do half an hour if this was necessary.\n\nThanks!\n\nOn Sep 17, 2013 4:48 PM, Grace Ellis\" <grace@a16z.com> wrote:\n>\n> Hi, Gerrit - \n> Not sure this is something we can accommodate at this time..\n> What kind of time commitment are we looking at here?\n> Thanks,\n> grace\n>\n>\n> On Tue, Sep 17, 2013 at 11:54 AM, Gerrit Hall <g@sloan.mit.edu> wrote:\n>>\n>> Thanks Severin (moved to BCC)\n>>\n>> Grace,\n>>\n>> We\'d actually previously been talking about this idea with Peter, and he was very enthusiastic, but unfortunately was traveling during the dates we will be in town.\n>>\n>> In short, we\'re inviting a select group of MIT entrepreneurs and taking them to the Bay Area to meet with top investors, understand their philosophies, and receive feedback on their concept and/or pitching skills.  The students all have promising concepts or early stage startups, and have been selected to join this trip as part of a pitch competition.\n>>\n>> We are hoping to include Andreesen Horowitz in the batch, but will need to find another of the investors since Peter was unavailable during the dates we\'ll be in town (Oct. 13-15).\n>>\n>> Please give me a call if you have any questions at 425.654.4256.  Best!\n>>\n>>\n>> On Tue, Sep 17, 2013 at 12:53 PM, SÃ©verin Hatt <severinhatt@gmail.com> wrote:\n>>>\n>>> Hi Grace,\n>>>\n>>> We are still working on the schedule to have Peter discuss earlier, we would get back to you as soon as we can confirm this.\n>>> We also have been working with the Entrepeneurship and Innovation Club from MIT for the conference, they will co-organize a panel with us and help us select the most promising start-ups form MIT to pitch during the conference.\n>>> They are also organizing a trip West with a select group of MIT startup, and I though it would to put you in contact with them. Gerrit, charge of the competition, is in CC.\n>>> Best,\n>>> SÃ©verin\n>>>\n>>>\n>>> On Tue, Sep 10, 2013 at 8:34 PM, Grace Ellis <grace@a16z.com> wrote:\n>>>>\n>>>> Here is Peter\'s bio:\n>>>>\n>>>> Peter Levine, Partner, Andreessen Horowitz\n>>>>\n>>>> Peter Levine is a partner at the venture capital firm Andreessen Horowitz. He was previously senior vice president and general manager of the Data Center and Cloud Division at Citrix where he was responsible for revenue, product management, business development and strategic direction. Peter joined Citrix in 2007 through its $500 million acquisition of XenSource, the leading provider of enterprise-class open source virtualization software, where he served as CEO, leading its 600 employees and establishing strategic agreements for the XenServer product family with customers such as Microsoft, Symantec, HP, NEC and Dell.\n>>>>\n>>>> Prior to XenSource, Peter was a general partner at the Mayfield Fund. Before Mayfield, he was an early employee of VERITAS Software. During his 11-year tenure with the company, he helped to grow the organization to over 5,000 employees and more than $1.5 billion in revenue. Peter served as executive vice president and was responsible for worldwide marketing, OEM sales, business development and several product divisions. He began his career as a software engineer at Spectrum Software and was later a software engineer at MITâ€™s Project Athena.\n>>>>\n>>>> Peter holds a B.S. in Engineering from Boston University and attended the Sloan School of Management at MIT.  He is currently a management lecturer at the Stanford Graduate School of Business and a former entrepreneurship lecturer at the Sloan School. Peter also serves on the boards of Actifio, Bromium, Convergent.io, DataGravity, GitHub, Instart Logic, Mixpanel and Udacity, and is on the board of trustees for Boston University and the National Outdoor Leadership Schoool (NOLS), and the Deanâ€™s Advisory board for MIT Engineering.\n>>>>\n>>>> Follow Peter on his blog, http://peter.a16z.com/, and on Twitter @Peter_Levine.\n>>>>\n>>>>  \n>>>>\n>>>>\n>>>>\n>>>> On Thu, Sep 5, 2013 at 2:28 AM, SÃ©verin Hatt <severinhatt@gmail.com> wrote:\n>>>>>\n>>>>> Hi Grace,\n>>>>>\n>>>>> This sounds great, we are putting together the Marketing effort, so we will not need the bio before the end of next week.\n>>>>> Best,\n>>>>> SÃ©verin\n>>>>>\n>>>>> SÃ©verin Hatt\n>>>>> MIT Sloan School of Management\n>>>>> MBA Candidate | Class of 2014\n>>>>> Cell | 857-250-1614\n>>>>> Email | severin.hatt@sloan.mit.edu\n>>>>>\n>>>>> Le 4 sept. 2013 Ã  19:39, Grace Ellis <grace@a16z.com> a Ã©crit :\n>>>>>\n>>>>>> Photo attached.\n>>>>>> I need to update his bio.\n>>>>>> Let me do that first.\n>>>>>>\n>>>>>>\n>>>>>> On Wed, Sep 4, 2013 at 2:11 PM, SÃ©verin Hatt <severinhatt@gmail.com> wrote:\n>>>>>>>\n>>>>>>> This sounds great. I will keep you up to date as soon as 