 in the market, one that is capable of supporting a $1B business.   \n\nTrapit has established early momentum and key Logo wins.  They have had three quarters of significant sequential growth, and a bona fide pipeline to continue this growth in 4Q13.  Current customers include Yahoo, Deloitte, Lenovo, Astro, Zeebox, Spin Media, SGI, and others.  Also, IBM has Trapit\'s SDK/API which they are evaluating for integration with Watson, as Trapit adds a dynamic discovery element.\n\nThey are seeking $10M in Series B financing to accelerate growth through additional marketing, sales staffing and selective machine learning skills.\n\nThe market for content curation is highly fragmented.  There is great interest in the space with numerous point solutions, each addressing only a portion of the customerâ€™s needs.  We believe the market requires a comprehensive solution that addressâ€™s content discovery, curation, delivery, and analysis â€“ all elements of Trapitâ€™s application.    \n\nTrapit is positioned to take leadership in this space based on:\nTechnology pedigree â€“ based on advanced AI and Machine Learning technology derived from a massive SRI/DARPA project.\nA comprehensive and powerful, yet intuitive, solution that is easily deployed.\nA seasoned/experienced team with a track record of success, particularly in SaaS enterprise software.\nUnique IP and significant barriers to entry: this implementation is not easily replicated\n\nTrapit pricing is a cloud-based subscription model, with annual contracts, though they are seeing success with multi-year contracts.  Monthly billing is banded around four tiers that are based on number of users of their Content Curation Center.  Pricing ranges from $2,975 - $17,500 per month, addressing their customersâ€™ ability to seed and grow - and Trapit\'s ability to \"land and expand,\" which, although early, they are experiencing.  Trapit also does business development partnerships licencing our API, which can generate much higher monthly fees. \n\nI\'ll leave it to Gary to follow-up.\n\nThanks,\n\n\nJohn Peters\nInterim CEO Services\n\n19450 Valle Vista Drive\nSaratoga, CA 95070\n(408)250-4960\njkp@jkpeters.com\n\n\n\n\n\n\nGary Griffiths | CEO\nTrapit, Inc\nMobile: 650-823-5066\nhttp://trap.it\n\n\n\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-26 20:55:55','2013-09-27 18:50:06','0',0,'2013-10-03 09:30:00','2013-10-03 10:30:00'),(19086,313,'o1rgv4r3vlbu0ldv2u1slcl01k',NULL,'Meeting:  Anders Frejo, Trust Pilot','2013-10-03 22:00:00','2013-10-03 23:00:00',0,'Anders Frejo JÃ¸rgensen <afj@trustpilot.com>\n\n(moving Chris to bcc).  Hi Anders, great to meet you virtually.  We would love to have you meet our partner Tom when you are in town.  He focuses on SaaS businesses.\n\nLisa, also cced, can help with scheduling.\n\nWe appreciate the opportunity!\n\nJuliet\n\n\nOn Wed, Sep 25, 2013 at 9:13 AM, Chris Dixon <chris@a16z.com> wrote:\nHey Anders -\nNice to meet you. I\'m going to be out of town then but I\'m cc\'ing my\npartners at a16z who can find a time to meet.\nThanks\nChris\n\n\nOn Fri, Sep 20, 2013 at 12:37 PM, Anders Frejo JÃ¸rgensen\n<afj@trustpilot.com> wrote:\n> Hi Chris,\n>\n> Just a quick follow-up to see if there is an opportunity to meet in the\n> first week of October? Let me know if you need more company background\n> beforehand.\n>\n> Have a great weekend!\n>\n> Regards\n> Anders\n>\n>\n> -----Original Message-----\n> From: Anders Frejo JÃ¸rgensen [mailto:afj@trustpilot.com]\n> Sent: 18. september 2013 09:15\n> To: \'Chris Dixon\'\n> Cc: \'Peter Holten MÃ¼hlmann\'; \'Ben Holmes\'\n> Subject: RE: Trustpilot / Index Ventures\n>\n> Hi Chris,\n>\n> A pleasure to meet you on e-mail and thanks for getting in touch.\n>\n> Peter and I will be in the Bay Area the week starting 30th September. Would\n> be great with an opportunity to meet with your team and present Trustpilot.\n>\n> Regards,\n> Anders\n>\n>\n> Anders Frejo JÃ¸rgensen\n> CFO\n>\n> www.trustpilot.com\n> 116 West 23rd Street, 