1:00:00','2013-10-13 21:30:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-08-04 23:28:56','2013-08-04 23:28:56','0',0,'2013-10-13 13:00:00','2013-10-13 13:30:00'),(19102,313,'55q1js5v6bt5ohksjvrp88lmj4',NULL,'HOLD: Sahil Jain ','2013-10-08 22:30:00','2013-10-08 23:30:00',0,NULL,NULL,'Lisa Orr','Lisa@a16z.com','2013-10-02 22:59:48','2013-10-08 14:23:51','0',0,'2013-10-08 14:30:00','2013-10-08 15:30:00'),(19103,313,'u5p5utg2l9dde1ghhp5s5o24h4',NULL,'Tech Summit | 2013','2013-10-10 16:00:00','2013-10-11 05:00:00',0,'http://techsummit.a16z.com\n\n5:00p\nCocktail Reception & Dinner\n7:30p\nFireside Chat\nAn informal discussion between Ari Emanuel, William Morris Endeavor + Marc Andreessen, Andreessen Horowitz\nThursday, October 10, 2013\n\n8:30a\nLearning to Innovate\nSPEAKER\nBen Horowitz, Andreessen Horowitz\n9:00a\nInnovator Pairings\nPerspectives on innovation from leaders of companies both large and small.\nMODERATOR\nMichael Copeland, Andreessen Horowitz\nSPEAKERS\nJeffrey Immelt, GE + Tom Preston-Werner, GitHub\nBen Silbermann, Pinterest + Rob Master, Unilever\n9:45a\nKeynote\nSPEAKER\nDanny Hillis, Applied Minds\n10:00a\nBreak\nCIO Track\n10:30a\nThe Departmentalization of IT\nKEYNOTE\nPeter Levine, Andreessen Horowitz\n10:45a\nSecurity Steps Out From the Shadows\nSecurity has gone from the domain of a vocal few to an issue that is at the center of business and society. It is the battle of our time. How do we face the increasing threats and the growing consequences?\nKEYNOTE\nMichael Chertoff, The Chertoff Group\nPANEL\nJohn Jack, Andreessen Horowitz\nCaleb Sima, Bluebox\nPravin Kothari, CipherCloud\nKevin Mahaffey, Lookout\nSimon Crosby, Bromium\n11:15a\nThe Cloud Won. Here\'s What\'s Next.\nIf the recent past has been about building technologies to provision the Cloud, the future will be about reimagining the buying and selling of enterprise computing.\nKEYNOTE\nRoss Meyercord, Salesforce\nPANEL\nPeter Levine, Andreessen Horowitz\nTodd McKinnon, Okta\nYuval Scarlat, Capriza\nChristian Gheorghe, Tidemark\nAlex Solomon, PagerDuty\n11:45a\nThe Hyperscale Age\nThe first step was the virtualization of the compute layer. What happens when the network, the storage and the whole data center become software-defined? Welcome to the data center in the hyperscale age.\nKEYNOTE\nAdrian Cockcroft, Netflix\nPANEL\nPeter Levine, Andreessen Horowitz\nRamana Jonnala, COHO Data\nTom Gillis, Bracket Computing\nAndrew Rubin, Illumio\nCMO Track\n10:30a\nKeynote\nKEYNOTE\nWilliam Lynch, Former CEO, Barnes & Noble Inc.\n10:45a\nA Social Complex\nYou hear itâ€™s a part of every business, but what does â€œsocialâ€ really mean? And in the end, what should you get for all your effort? The right elements and realistic results of a valuable social strategy.\nKEYNOTE\nAdam Bain, Twitter\nPANEL\nJeff Jordan, Andreessen Horowitz\nJim Gilliam, NationBuilder\nJames Beshara, Crowdtilt\nDalton Caldwell, App.net\n11:30a\nThe Changing Face of Commerce\nBetween mass-customization, crowd-funding and 24/7 access, you can develop deeper relationships, online and off, with customers than ever before. And yet customers swan off to some new crush with a wink from a special offer. What engenders loyalty? What builds a lasting brand? Can you have a long-term customer relationship in todayâ€™s (and tomorrowâ€™s) commerce environment?\nKEYNOTE\nJulie Bornstein, Sephora\nPANEL\nJeff Jordan, Andreessen Horowitz\nJane Park, Julep\nLogan LaHive, Belly\nDaniel Mattes, Jumio\nCIO + CMO Track\n12:15p\nLunch and Topic Tables\nTopic tables are available for deeper conversation in key innovation areas.\n1:45p\nMy friend. My foe.\nAre the CIO and the CMO partners or rivals in the race to innovate?\nSPEAKERS\nPeter Horst, Capital One\nRob Alexander, Capital One\nPeter Levine, Andreessen Horowitz\nJeremy Skule, The NASDAQ OMX Group, Inc.\nBrad Peterson, The NASDAQ OMX Group, Inc.\n2:15p\nAwash In a Sea of Data\nYou can track everything in your company. You can know (almost) everything about your customers. But do you? Should you? What Big Data means within different industries. How to wade through the morass of information, get answers to pivotal questions, and create new things with your most important asset: your data.\nSPEAKERS\nDon Duet, Goldman Sachs + Anthony Delvecchio, eBay Inc.\nPANEL\nPeter Levine, Andreessen Horowitz\nSuhail Doshi, Mixpanel\nJohn Joseph, DataGravity\nBen Werther, Platfora\nRoman Stanek, GoodData\n3:00p\nBreak\n3:30p\nIt\'s Mobile First...And Second...And Last.\nSure, there are still things to hammer out. All those gadgets everyone wants to bring to work for starters. But mobile is not some exotic technology form. It is computing. It is how we all work. Itâ€™s how we all play.\nKEYNOTE\nKim Stevenson, Intel\nSPEAKERS\nManav Mital, Instart Logic\nAlfred Chuang, Magnet Systems\nGeorg Petschnigg, FiftyThree\n4:30p\nA Conversation with Meg Whitman + Marc Andreessen\n5:00p\nInnovators Pavilion\nMeet the entrepreneurs creating the next wave of innovation and see live demos. Join us for cocktails and appetizers.\n7:00p\nDinner & Fireside Chat\nAn interview with Marissa Mayer, Yahoo! + Marc Andreessen, Andreessen Horowitz, led by Adam Lashinsky, Fortune',NULL,'Jeanne Moeschler','jeanne@a16z.com','2013-07-08 23:40:06','2013-10-10 00:15:54','0',0,'2013-10-10 08:00:00','2013-10-10 21:00:00'),(19104,313,'ghb3ka7b59knv8i40f62oukcco',NULL,'Meeting:  Matthew Greeley, ','2013-10-16 23:00:00','2013-10-17 00:00:00',0,'Matthew Greeley <mgreeley@brightidea.com\nEA:  Emily Rogan <erogan@brightidea.com>\n\n(moving Scott to bcc).  Thank you Matt.  Our partners Tom and Zal are interested in learning more - they both focus on SaaS.  Lisa, also cced, will help schedule a good time for you to meet.\n\nWe appreciate the opportunity!\n\nJuliet\n\n\nOn Thu, Oct 3, 2013 at 6:43 PM, Matthew Greeley <mgreeley@brightidea.com> wrote:\n\nScott/Juliet,\n\nHere is a brief intro. \n\nWe are profitable and growing Enterprise / SaaS / Collaboration platform,\nbased in SF.\n\nOur customers are starting to see very strong ROI from crowdsourcing and \ncrowdfunding internally, so we are raising money to accelerate growth and \nexpand our leadership position.\n\nMatt\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-10-07 21:38:06','2013-10-09 23:06:43','0',0,'2013-10-16 15:00:00','2013-10-16 16:00:00'),(19105,313,'_60q30c1g60o30e1i60o4ac1g60rj8gpl88rj2c1h84s34h9g60s30c1g60o30c1g70o3cc1p84p42ghh89346h9g64o30c1g60o30c1g60o30c1g60o32c1g60o30c1g6crkagho8op38hhn8opk2e9k890j0ci38p0j8h236csj2gq484rg',NULL,'GetFinancing Presentation','2013-10-08 19:00:00','2013-10-08 20:30:00',0,NULL,NULL,'stephane@empaytech.com','stephane@empaytech.com','2013-10-03 00:51:36','2013-10-08 14:23:52','0',0,'2013-10-08 11:00:00','2013-10-08 12:30:00'),(19186,172,'792mmth56dfiidn64vsj871ads_20131015T200000Z',NULL,'Clean up email. Vimbli. ','2013-10-15 21:00:00','2013-10-15 21:30:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-08-04 23:28:56','2013-08-04 23:28:56','0',0,'2013-10-15 13:00:00','2013-10-15 13:30:00'),(19187,172,'r0dqqej1ne9tgnbq8qp0hc86k4_20131007T000000Z',NULL,'Summarize my thoughts for Colton. Why does life matter? Why me? Why Vimbli? ','2013-10-07 01:00:00','2013-10-07 02:00:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-08-04 23:28:57','2013-08-04 23:28:57','0',0,'2013-10-06 17:00:00','2013-10-06 18:00:00'),(19188,172,'r0dqqej1ne9tgnbq8qp0hc86k4_20131013T000000Z',NULL,'Summarize my thoughts for Colton. Why does life matter? Why me? Why Vimbli? ','2013-10-13 01:00:00','2013-10-13 02:00:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-08-04 23:28:57','2013-08-04 23:28:57','0',0,'2013-10-12 17:00:00','2013-10-12 18:00:00'),(19189,172,'r0dqqej1ne9tgnbq8qp0hc86k4_20131015T000000Z',NULL,'Summarize my thoughts for Colton. Why does life matter? Why me? Why Vimbli? ','2013-10-15 01:00:00','2013-10-15 02:00:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-08-04 23:28:57','2013-08-04 23:28:57','0',