),(19112,313,'a9op8c4e8m2er33il5ivk4b6n8',NULL,'Meeting:  Stephane Touboul, GetFinancing Presentation','2013-10-08 22:30:00','2013-10-08 23:30:00',0,'Stephane Touboul <stephane@empaytech.com\n\n(moving Jeff to bcc).  Hi Stephane, great to meet you virtually.  We\'d like to have you meet with our partner Tom as a next step - he\'s best suited to take a closer look at your business and tech.  Lisa, also cced, can help with scheduling.\n\nWe appreciate the opportunity!\n\nJuliet\n\n\nOn Tue, Oct 1, 2013 at 5:46 PM, Jeff Jordan <jj@a16z.com> wrote:\nhey Steph,\n\ngood to meet you, and thanks for reaching out.  it\'s an interesting concept, we\'d be interested in learning more.  I\'ve copied Juliet Pullis who leads the deal team that on-boards all of our prospective investments.  she\'ll work with you on next steps.\n\nJeff\n\n\nOn Tue, Oct 1, 2013 at 5:40 PM, Stephane Touboul <stephane@empaytech.com> wrote:\nThank you Davies and Jim for the introduction;\n\n \n\nJeff, it is nice to meet you by e-mail for now. For your review and in order to illustrate our business model, please find attached our investor presentation deck. I certainly would welcome an introductory call at your convenience.  Please let me know of you availability either this week or next and I will arrange my schedule accordingly.\n\n \n\nThank you a looking forward to connecting.\n \nSteph\n \n\n-----Original Message-----\nFrom: Davies Beller [mailto:dbeller@stonekey.com] \nSent: Tuesday, October 01, 2013 8:22 PM\nTo: jj@a16z.com; Stephane (\"Steph\") Touboul (stephane@empaytech.com)\nCc: James Kissane\nSubject: INTRODUCING GET FINANCING TO ANDREESSEN HOROWITZ\n\n \n\nJeff and Steph:\n\n \n\nJim and I have mentioned each of you to the other, and we would like to introduce the two of you.  We think you would both find it mutually productive to meet and get to know each other.\n\n \n\nSteph - Andreessen Horowitz is one of the pre-eminent Venture Capital firms  in the world, with a stellar track record.  Jeff Jordan is a senior Partner, with extensive experience in payments, e- and m-commerce, both as an entrepreneur, senior executive and investor.  I have known Jeff for more than 30 years and he is one of the best in the industry with tremendous knowledge, experience and perspective.\n\n \n\nJeff - Stephane is the Founder and CEO of Emerging Payments Technologies (dba Get Financing) - a unique business model delivering dynamic credit issuance at the retail POS.  Jim and I believe this is a big unmet need, and Get Financing is potentially well-positioned for explosive growth in this attractive market.\n\n \n\nWe will leave it to the two of you to connect directly.  Please let either Jim or me know how we can help advance your discussions.  Thanks.  Best,\n\n \n\nJim and Davies\n\n \n\n \n\nDavies Beller\n\nPartner\n\nStone Key Partners LLC\n\n2 Sound View Drive - 2nd Floor\n\nGreenwich, CT 06830\n\n(203) 930-3755 OFFICE\n\n(310) 498-1001 MOBILE\n\n(203) 930-3799 FAX\n\ndbeller@stonekey.com<mailto:dbeller@stonekey.com>\n\n \n\n \n\n \n',NULL,'Lisa Orr','Lisa@a16z.com','2013-10-02 22:55:09','2013-10-07 23:26:18','0',0,'2013-10-08 14:30:00','2013-10-08 15:30:00'),(19322,172,'792mmth56dfiidn64vsj871ads_20131005T200000Z',NULL,'Clean up email. Vimbli. ','2013-10-05 21:00:00','2013-10-05 21:30:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-08-04 23:28:56','2013-08-04 23:28:56','0',0,'2013-10-05 13:00:00','2013-10-05 13:30:00'),(19206,117,'fnevk99fnvndvs0qmd0anpu0jc_20131008T183000Z',NULL,'Down-town Professionals','2013-10-08 19:30:00','2013-10-08 21:20:00',0,NULL,NULL,'Hennie Strydom','hennies@gmail.com','2013-04-15 00:35:41','2013-04-15 00:36:21','0',0,'2013-10-08 11:30:00','2013-10-08 13:20:00'),(19204,117,'k60bsod1p2scs5midngj3irfa8_20131008T143000Z',NULL,'Vimbil Board Call','2013-10-08 15:30:00','2013-10-08 16:00:00',0,'415-595-8641',NULL,'Tom Rikert','tomrikert@gmail.com','2013-01-04 17:18:49','2013-01-04 17:21:22','0',0,'2013-10-08 07:30:00','2013-10-08 08