ng','2013-10-06 00:00:00','2013-10-06 02:00:00',0,NULL,NULL,'Hennie Strydom','270win@gmail.com','2013-06-22 18:48:10','2013-06-22 18:48:10','0',0,'2013-10-05 16:00:00','2013-10-05 18:00:00'),(19625,286,'2522mfvcd7s85u30a4l9bgvis0_20131006T230000Z',NULL,'TEst - all overlapping','2013-10-07 00:00:00','2013-10-07 02:00:00',0,NULL,NULL,'Hennie Strydom','270win@gmail.com','2013-06-22 18:48:10','2013-06-22 18:48:10','0',0,'2013-10-06 16:00:00','2013-10-06 18:00:00'),(19626,286,'2522mfvcd7s85u30a4l9bgvis0_20131007T230000Z',NULL,'TEst - all overlapping','2013-10-08 00:00:00','2013-10-08 02:00:00',0,NULL,NULL,'Hennie Strydom','270win@gmail.com','2013-06-22 18:48:10','2013-06-22 18:48:10','0',0,'2013-10-07 16:00:00','2013-10-07 18:00:00'),(19627,286,'2522mfvcd7s85u30a4l9bgvis0_20131008T230000Z',NULL,'TEst - all overlapping','2013-10-09 00:00:00','2013-10-09 02:00:00',0,NULL,NULL,'Hennie Strydom','270win@gmail.com','2013-06-22 18:48:10','2013-06-22 18:48:10','0',0,'2013-10-08 16:00:00','2013-10-08 18:00:00'),(19628,286,'2522mfvcd7s85u30a4l9bgvis0_20131012T230000Z',NULL,'TEst - all overlapping','2013-10-13 00:00:00','2013-10-13 02:00:00',0,NULL,NULL,'Hennie Strydom','270win@gmail.com','2013-06-22 18:48:10','2013-06-22 18:48:10','0',0,'2013-10-12 16:00:00','2013-10-12 18:00:00'),(19629,286,'91kqmvk9u9chgbd3kui3fhtt6s_20131013T050000Z',NULL,'Test - Standalone','2013-10-13 06:00:00','2013-10-13 07:00:00',0,NULL,NULL,'Hennie Strydom','270win@gmail.com','2013-06-22 18:48:33','2013-06-22 18:48:33','0',0,'2013-10-12 22:00:00','2013-10-12 23:00:00'),(19630,313,'2b340vlf1upci6gvnntg1ileq4',NULL,'Meeting:  David Bloom, Ordrin','2013-10-02 00:00:00','2013-10-02 01:00:00',0,'David Bloom <david@ordrin.com\n\nto David, me, Tom \nHi David, apologies for the delayed response.  Our partner Tom is best suited to take a closer look and we\'d love to arrange a good time for you to call or meet.  Lisa, cced, will take point on scheduling.\n\nCan you please send us an exec summary or deck in advance.\n\nThank you for the opportunity!\n\nJuliet\n\n\nOn Mon, Sep 23, 2013 at 12:18 PM, David Bloom <david@ordrin.com> wrote:\nJuliet- I wanted to see if you have time for an intro call this week. Ordr.in is a Google Ventures-backed open platform for online food ordering. The good folks at Belly suggested we speak with A16z about our series A. They are probably using our APIs to add food ordering to the Belly app. \n\nLet me know what your schedule looks like.\n\nBest\nDavid\n\n-- \nDavid Bloom\nCEO, Ordr.in\nt. 646-522-8414\n@ordrin\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-24 21:07:34','2013-09-24 22:25:41','0',0,'2013-10-01 16:00:00','2013-10-01 17:00:00'),(19631,313,'e1m7ko12cgrhev82fjtd5oegro',NULL,'Meeting:   Samir Shah, ','2013-10-02 17:30:00','2013-10-02 18:30:00',0,' Samir Shah <shah.samir@me.com\ns 650 808 5151\n\n(moving Rajiv to bcc for next steps).  Hi Samir, thank you for the thoughtful outline.  We would love to arrange for you to meet our partner Tom when you are next in the valley - he led our research on Shapeways and will have a great perspective on what you\'re building.  Lisa, also cced, can help with scheduling.\n\nWe appreciate the opportunity.\n\nJuliet\n\n\nOn Mon, Sep 23, 2013 at 9:04 AM, Samir Shah <shah.samir@me.com> wrote:\nHi Juliet,\n\nThank you for engaging with us.  This should help focus further from the outline on one page that you have seen.\n\n3D Polymers: Efforts in making furniture have not yielded a business opportunity where polymers are used.  The dimensions and complexity of furniture makes it exhorbitant.\n\nWood paste:  Wooden furniture seems even more distant because 3DP results are neither attractive, nor sturdy, nor affordable as a final finished consumer product.  This is based on direction that individuals and institutions have taken ( MIT / UC Berkeley) and published / displayed information thereof.\n\nKnowledge: The reason why nobody saw us coming is because of the previous sentence.  Wood is not a material that can be made to imitate either polymers or inks.  I have designed and manufactured (or consulted for) real wood furniture for 27 years and I have a deep understanding of this material and its properties.\n\nOur focus was simply to find a combined solution that:\ntakes away pain of lost skills (therefore poor product) v/s hiring expensive skills and making furniture unaffordable\nfinds a method and/or material that can work for the foreseeable future (at least 20 years)\nkeeps us profitable and hopefully even lowers cost by harnessing (different) technology in a peaked industry\nWe looked at the Maker Movement, and 3DP.  To that I added my knowledge and innovation.\n\nWe not only found all three, but realized with surprise that we can transform an industry:\nOur furniture is attractive, is real wood (not a paste or powder), and therefore looks like solid wood.\nIt has limitless applications as a business.\nWith add.mfg and distributive production, it is actually a cheaper manufacturing alternative.\nPoint 3 above makes us the manufacturer and retailer keeping more control on business, quality and profit. (It is like being Stratasys and Shapeways at the same time).\nThe spinoffs are hugely profitable as well, from franchising to selling / licensing our IP.\nWe know the business, have the skills and experience to get this done effectively.  We have surprised experts with the simplicity and elegance of the solution.  We now need is a partner who is forward thinking and who would enjoy the process of pioneering with us.\n\n--\n\nSincerely,\nSamir Shah\n\nâ€¢ Founder - 4 AXYZ\nâ€¢ Principal - Corbel Design Inc. Canada\nâ€¢ Dir. Of Technology - Anglewood Furniture Solutions (P) Ltd. India\n\nE: shah.samir@me.com\nT: +1 (604) 961 1716\n\n\n\n\nOn Sep-21-2013, at 12:12 PM, Rajiv Dholakia <rajiv@villagetree.com> wrote:\n\nCc-ing Samir on this one - haven\'t had my morning cup of tea yet :-)).\n\n-Rajiv\n\n\nFrom: Rajiv Dholakia <rajiv@villagetree.com>\nTo: Juliet Pullis <juliet@a16z.com> \nSent: Saturday, September 21, 2013 12:11 PM\nSubject: Re: New venture in modern manufacturing...\n\nThanks Ben (moved to bcc:)  Nice to meet you Juliet.  I\'ve cc-ed here Samir Shah who founded 4AXYZ and leads it.  Quick introductions:\n\nJuliet is a partner at Andreesen-Horowitz.\n\nSamir is an architect-designer and consultant to the furniture industry.  He owned and operated a furniture manufacturing and distribution operation for many years and has deep insights into the market dynamics, technology, aesthetics and economics of the space.  Samir went to the same high school as I did and we\'ve stayed in touch off and on through the years.  He asked me to help vet the venture and advise on how to bring the idea to market. \n\nSamir is currently seeking feedback/input in anticipation of raising a round of capital for the venture.  Samir is based in Vancouver, Canada but visits here frequently.  I\'ll let Samir and you connect - and can participate in any discussion as required.\n\n-Rajiv Dholakia\nrajiv@villagetree.com\nrajiv@noknok.com\n650 400-2958 (M)\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-24 21:19:34','2013-09-25 18:16:42','0',0,'2013-10-02 09:30:00','2013-10-02 10:30:00'),(19632,313,'kiv8kk1ef5lgc0nnv91bgbr2kg',NULL,'Pitch Meeting | Tom Davidson, EverFi','2013-10-01 21:30:00','2013-10-01 22:30:00',0,'Thomas Davidson \n<tom@everfi.com>\nm: 202 674 2465',NULL,'Michelle Mundy','michelle@a16z.com','2013-09-27 17:17:05','2013-10-01 18:09:01','0',0,'2013-10-01 13:30:00','2013-10-01 14:30:00'),(19633,313,'41gc8aedevgig70tfvpp2r71b8',NULL,'Meeting: Amit Sharma, Narvar','2013-10-04 18:00:00','2013-10-04 19:00:00',0,'Amit Sharma <amit@narvar.com\n\n(moving Jeff and team to bcc).  Hi Amit, its great to meet you virtually.  We would like to have you meet our partner Tom as a next step - he\'s best suited on our team to take a closer look at what you\'re building.  Lisa, also cced, can help with scheduling.\n\nWe appreciate the opportunity!\n\nJuliet\n\n\nOn Fri, Sep 27, 2013 at 3:53 PM, Amit Sharma <amit@narvar.com> wrote:\nHi Jeff. Thanks for your email and look forward to working with Juliet.\n\nJuliet, nice to meet your over email.  I would love to connect and share what we are up to.  Would you have any availability to meet on Tue/Wed next week? \n\nThanks,\nAmit\n\n\n\n\nOn Fri, Sep 27, 2013 at 3:03 PM, Jeff Jordan <jj@a16z.com> wrote:\nthanks John, moving you to bcc.\n\nand good to meet you, Amit.  your venture sounds very interesting, we look forward to learning more.  I\'m copying Juliet Pullis who leads the deal team that on-boards all of our prospective investments.  she\'ll work with you on next steps!\n\nthanks.\n\nJeff\n\n\nOn Fri, Sep 27, 2013 at 2:51 PM, John Poisson <john@wantful.com> wrote:\nJeff, Sebastian:\n\nPlease meet Amit Sharma, founder and CEO of Narvar, who as I mentioned has big designs on solving a host of supply chain challenges. Having spent some time with him I do believe he\'s on to something, and his background certainly speaks for itself.\n\nAmit:\n\nJeff and his firm hardly need an introduction, but I know the entire team to be both thoughtful and insightful, and I\'m sure you\'ll all enjoy meeting.\n\nHave a great weekend everyone.\n\nBest,\nJohn\n\nJohn Poisson\nFounder, CEO\nWantful\n\nhttp://wantful.com\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-10-01 17:12:54','2013-10-01 19:20:38','0',0,'2013-10-04 10:00:00','2013-10-04 11:00:00'),(19634,313,'198ki3h6vrrgi86j93pcb97e2c',NULL,'Meeting:  Renee Morkos, Alice','2013-10-09 22:00:00','2013-10-09 23:00:00',0,'Rene Morkos <rmorkos@gmail.com>\n\n\nThanks Sten (moving to bcc).  Hi Rene, its great to meet you virtually - we\'re siked to learn more about what you\'re building.  Our partner Tom is going to take the lead on next steps - Lisa, also cced, can help schedule time for you to meet.\n\nWe appreciate the opportunity!\n\nJuliet\n\n\nOn Fri, Sep 27, 2013 at 4:13 PM, Sten Tamkivi <sten@a16z.com> wrote:\n\nDear Rene,\nI am a recent GSB grad & currently an EIR at Andreessen Horowitz. I saw your pitch for ALICE at Stanford Venture Studio and was quite impressed with your unique approach, progress this far and the promise for the construction industry. It wasn\'t for a lack of reason why you got a roomful of laughs for the question about construction projects finishing on deadline. :)\n\nI mentioned your idea to a few colleagues and Juliet (CC) from our investment team would love to set up a meeting to discuss more, if you would be up for it. So figured I\'d introduce you two to chat directly.\n\nBR,\nSten\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-10-01 22:02:40','2013-10-01 22:02:41','0',0,'2013-10-09 14:00:00','2013-10-09 15:00:00'),(19635,313,'cok0oo667o6a45mkllnugile3c',NULL,'Navid NewCo pitch','2013-10-02 16:00:00','2013-10-02 16:30:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-10-02 05:52:56','2013-10-02 05:52:56','0',0,'2013-10-02 08:00:00','2013-10-02 08:30:00'),(19636,313,'_6orjecho8go46b9i89334b9k8d346b9p8p246ba484ojcdpl70p3cd9n68',NULL,'MediaBrix/Andreessen Horowitz Intro Call','2013-10-04 19:00:00','2013-10-04 19:30:00',0,'When: Friday, October 04, 2013 2:00 PM-2:30 PM. (UTC-05:00) Eastern Time (US & Canada)\nWhere: Dial +1 (213) 493-0603, Access Code: 477-359-061 - GoTo Link & Info Below\n\n*~*~*~*~*~*~*~*~*~*\n\n1.  Please join my meeting, Oct 4, 2013 at 2:00 PM EDT.\nhttps://global.gotomeeting.com/join/477359061\n\n\n2.  Use your microphone and speakers (VoIP) - a headset is recommended. Or, call in using your telephone.\n\n\nDial +1 (213) 493-0603\nAccess Code: 477-359-061\nAudio PIN: Shown after joining the meeting\n\n\nMeeting ID: 477-359-061\n\n\nGoToMeetingÂ®\nOnline Meetings Made EasyÂ®\n',NULL,'Tom Rikert','tom@a16z.com','2013-10-02 16:24:13','2013-10-02 17:45:10','0',0,'2013-10-04 11:00:00','2013-10-04 11:30:00'),(19637,313,'qdmcriiif8pam7jf189n61c2mk',NULL,'Capital One CIO-CTO-CISO Briefing','2013-10-02 16:00:00','2013-10-02 21:00:00',0,'Capital One Financial Executive Briefing\nWednesday, 10.2.13 // 8a-1p\n\nCapital One Financial Executive Briefing\nWednesday, 10.2.13 // 8a-1p\n\nAGENDA: \n7:45-8:00     Arrivals \n8:00-8:30     Capital One Initiatives \n8:30-9:00     a16z Business, Portfolio & POV\n9:00-9:25     Factual\n9:25-9:50     SignalFuse\n9:50-10:00    Break \n10:00-10:25  SnapLogic\n10:25-10:50  Balanced Payments\n10:50-11:00  Break \n11:00-11:25  Magnet Systems\n11:25-11:50  PagerDuty\n11:50-12:00  Wrap Up & Next Steps \n12:00-12:30  Lunch w/ Shannon Callahan \n12:30-1:00    Networking\n\nATTENDEES:\nCapital One Financial\nRob Alexander - CIO\nMonique Shivanandan - CTO & CISO\nRudy Wolfs - SVP IT Office of the CIO\nDavid Wright - SVP Card Division CIO\nJim Dolphin - MVP & Commercial CIO\nChandra Dhandapani - MVP Financial Service\nSkip Potter - Sr Director Technology Innovation\nJames Peel - Scouting Director, Innovation Lab\nOthers TBD \n\nAndreessen Horowitz\nMark Cranney - Partner, Market Development\nTim Dombrowski - Partner, Business Development\nJamie McGurk - Partner, Corporate Development\nFrank Chen - Partner, Research & Deal Team\n\nFactual\nJohn Delacruz - Product Manager\n\nMagnet Systems\nIliana Quinonez - Director, Sales Engineering\nAnthony Tse - Director, Solution Services\n\nSnapLogic\nGaurav Dhillon - CEO/Founder\nEdiz Ertekin - VP Sales\n\nSignalFuse\nKarthik Rau - CEO\n\nPagerDuty\nTrenton Truitt - VP Sales\n\nCapital One Initiatives and Discussion Points:\nBecoming a Software Company / a Digital Company\nNew Data Center Strategies\nDevelopment Prouctivity\nCredit Card Business & Payment Innovation\nStaying Ahead of Markets\nLowering Customer Churn\nOffice of the CIO:  talent, agility, culture of innovation\n\nAreas of Interest Alignment to the A16Z Portfolio. \nBuiding for Mobile - Magnet Systems\nPayments - Dwolla, Stripe, Jumio\nAgile Development & Collaboration (recruiting) - GitHub\nOpen Source - Cumulus Networks, MesoSphere\nDev/Ops - SignalFuse, CliQr\nOperations - PagerDuty, SnapLogic\nAnalytics - TightDB\n\n\nACTIVITY TO DATE OVERVIEW:\nTech Advisory Board VII\n6/13 Portfolo:  GitHub, Magnet, SignalFuse, DataGravity, Illumio\nBriefing Name:  Tech Advisory Board V\n6/12 Portfolio:  Capriza, MixPanel, Platfora, Instart Logic, Bracket Computing\nCapital One CIO CTO Visit Q212\n6/12 Portfolio:  Apptio, Nicira, Platfora, CipherCloud\nCapital One Corp Visit Q411\n12/11 Portfolio:  Jumio, Okta, Boku, Actifio, Factual\nCapital One Corp Visit Q311\n9/11 Portfolio:  Apptio, Quantifind, GoodData, Bump\n\n\nACTIVITY TO DATE DETAIL:\nBriefing Name:  Tech Advisory Board VII\nDate: 6/12/13\nCorporate Attendees:\nMonique Shivanandan SVP, CTO, CISO\nPortfoloi:  GitHub, Magnet, SignalFuse, DataGravity, Illumio\n\nBriefing Name:  Tech Advisory Board V\nDate:6/20/12\nCorporate Attendees:\nMonique Shivanandan SVP, CTO, CISO\nPortfolio:  Capriza, MixPanel, Platfora, Instart Logic, Bracket Computing\n\nBriefing Name: Capital One CIO CTO Visit Q212\nDate: 6/28/2012\nCorporate Attendees:\nRob Alexander - EVP, CIO\nMonique Shivanandan SVP, CTO\nRudy Wolfs - SVP, Digital IT and CIO ING_Direct\nEd Page - MVP, Bank IT\nJulie Elberfeld - MVP, Commercial Bank IT\nChandra Dhandapani - MVP, Financial Services\nMark Tiltman - MVP, IT\nSkip Potter - Sr Director, Tech Innovation\nParesh Mutha - Sr Director, Tech Innovation\nJoshua Greenough - Senior Director, Technology Innovation\nPortfolio:  Apptio, Nicira, Platfora, CipherCloud\n\nBriefing Name: Capital One Corp Visit Q411\nDate: 12/8/2011\nCorporate Attendees:\nMonique Shivanandan: SVP and CTO\nMark Jamison, MVP, Head of Digital Innovation Lab\nToby Russell: VP, Digital Mobile\nPaul Sun: Director, Innovation Lab\nParesh Mutha: Sr Director, Technology Innovation\nAndy Wen: Director, Innovation Lab\nLakshmi Seetharaman: Director, Digital IT\nPaul Moreton: Senior Director, Digital Mobile\nSkip Potter: Senior Director, Technology Innovation\nPortfolio:  Jumio, Okta, Boku, Actifio, Factual\n\nBriefing Name: Capital One Corp Visit Q311\nDate: 9/30/2011\nCorporate Attendees:\nChris Newkirk â€“ SVP Card Customer Management\nTom Poole - SVP of Mobile and Emerging Channels\nMark Jamison - MVP, head of Digital Innovation Lab\nParesh Mutha â€“ Technology Innovations & Strategic Alliances\nPaul Sun â€“ Digital Innovation Lab\nPortfolio:  Apptio, Quantifind, GoodData, Bump\n\n\nREFERENCE:\nCapital One Financial Corporation\nA diversified financial services holding company with banking and non-banking subsidiaries. Capital One Financial Corporation and its subsidiaries offer an array of financial products and services to consumers, small businesses and commercial clients through branches, the Internet and other distribution channels. As of December 31, 2012, the Company\'s principal subsidiaries included Capital One Bank (USA), National Association (COBN), which offers credit and debit card products, other lending products and deposit products, and Capital One, National Association (CONA), which offers a spectrum of banking products and financial services to consumers, small businesses and commercial clients. On February 17, 2012, the Company acquired ING Direct business in the United States (ING Direct) from ING Groep N.V., ING Bank N.V., ING Direct N.V. and ING Direct Bancorp. \n\nRobert M. Alexander\nChief Information Officer of Capital One Financial Corp., since May 1, 2007 and served as its Head of Enterprise Customer Management since May 2007. Mr. Alexander is responsible for all Capital One Financial\'s accountabilities including enterprise-wide IT strategy, IT infrastructure and architecture, and central data management, information risk and business continuity and unites the IT and customer infrastructure at Capital One to help drive faster innovation and time to market while ensuring strong controls, greater efficiency and a more integrated customer experience. He served as an Executive Vice President for Internet and Enterprise Customer Management of Capital One Financial Corp. Mr. Alexander served as the Lead Executive for the largest information technology system replacement program in the history of Capital One. Mr. Alexander led a three-year, cross-functional effort to deliver the new infrastructure for Capital One\'s credit card businesses, replacing the billing system and ancillary systems and processes. Mr. Alexander had responsibility at various times for a number of Capital One\'s lending businesses, including the US Credit Card and Installment Loan businesses and provided oversight to all marketing, portfolio management and credit policy activities associated with these businesses. Mr. Alexander also led the formation and start up of Capital One\'s credit card e-commerce business. He joined Capital One in 1998 from Boston-based strategic consulting firm Bain & Company.\n\n',NULL,'Tim Dombrowski','tim@a16z.com','2013-06-27 04:12:00','2013-10-02 18:22:34','0',0,'2013-10-02 08:00:00','2013-10-02 13:00:00'),(19638,313,'uda69r7cdlf153hremroa1gog8',NULL,'Phone call: Jim Moar from Optimine with Tom & Zal','2013-10-02 19:00:00','2013-10-02 20:00:00',0,NULL,NULL,'Zal Bilimoria','zal@a16z.com','2013-09-27 15:34:23','2013-10-02 19:04:24','0',0,'2013-10-02 11:00:00','2013-10-02 12:00:00'),(19639,313,'oe84oc6v13pc4nnsveks9gchs8',NULL,'Pitch Meeting | Ofer Klein, WeFind ','2013-10-03 01:30:00','2013-10-03 02:30:00',0,'*deck included\nOfer Klein, CEO\nWeFind - tech\nEmail:   ofer@WeFind-tech.com\nMobile:  972-54-320-9191\nWeFind-Tech.com\n\nOn Fri, Aug 2, 2013 at 9:50 PM, ofer klein <ofer@wefind-tech.com> wrote:\n\nThanks Juliet.\n\nHi Lisa, Frank and Linus.\n\nLooking forward to our call, to share with you why we believe WeFind is so disruptive and exciting.\n\nAll the best and have a great weekend,\nOfer\n\nOn Aug 3, 2013 1:49 AM, \"Juliet Pullis\" <juliet@a16z.com> wrote:\n\nThanks Gilad (moving to bcc).  Hi Ofer, we\'re excited to learn more about your plans for WeFind.  Our partners Frank and Linus have been looking at this space most closely so they are going to take the lead on next steps.  \n\nLisa, also cced, can help schedule a call.  She is returning from vacation on Monday, so there may be an initial delay in her response.\n\nHave a great weekend!\n\nJuliet\n\nOn Fri, Aug 2, 2013 at 1:54 AM, ofer klein <ofer@wefind-tech.com> wrote:\n\nGilad, Thanks or the intro\n\nDear Juliet,\n\nNice to e-meet you.\n\nI would be very happy to coordinate a call with your team and elaborate on our exciting venture.\nWhen will it be best time for you ?\n\nBest regards,\nOfer\nOfer Klein\nCEO\nWeFind - tech\n Email:   ofer@WeFind-tech.com\nMobile:  972-54-3209191\n\n ----- Original Message -----\nTo: Gilad Garon\nSent: Thu Aug 01 07:54:29 2013\n Subject: Fwd: a16z/wefind\n\nHi Gilad, I\'m am a member of the deal team at Andreessen Horowitz - we learned about Wefind through Scott Kupor and we\'d love to learn more.  Could you introduce me to the CEO to coordinate a call with our team as a next step?\n\nMuch appreciated,\nJuliet\n\nJuliet Pullis\nAndreessen Horowitz\njuliet@a16z.com\n973-886-5965\n',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-09-17 21:44:27','2013-10-02 20:15:52','0',0,'2013-10-02 17:30:00','2013-10-02 18:30:00'),(19640,313,'rbfic7inv8r0q1nljcipvc0d7c',NULL,'Pitch Meeting | Pradeep Elankumaran, Kendsend','2013-10-03 00:00:00','2013-10-03 01:00:00',0,'deck attached\n\nhttp://www.crunchbase.com/person/pradeep-elankumaran\n\nOn Wed, Sep 25, 2013 at 9:09 AM, Chris Dixon <chris@a16z.com> wrote:\nHey Pradeep\nNice to meet you. Happy to get together. This week is tough but maybe next week?\nChris\n\nOn Sat, Sep 21, 2013 at 1:53 AM, Pradeep Elankumaran <pradeepe@gmail.com> wrote:\nPG, thanks for the intro (moving to bcc).\n\nChris, great to connect. Can we meet in the next two weeks? I\'m free Thu &\nFri PM.\n\nOn Thu, Sep 19, 2013 at 9:59 PM, Paul Graham <pg@ycombinator.com> wrote:\n\nPradeep, please meet Chris, who says he\'d be happy to meet with you.  --pg\n\nPradeep Elankumaran\nAbout Me\n',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-09-25 19:30:51','2013-10-02 22:07:10','0',0,'2013-10-02 16:00:00','2013-10-02 17:00:00'),(19641,313,'a89dv4chl4m2vo934plcst6950',NULL,'Liftoff.io pitch feedback','2013-10-02 21:00:00','2013-10-02 22:30:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-09-29 05:25:29','2013-10-02 23:30:12','0',0,'2013-10-02 13:00:00','2013-10-02 14:30:00'),(19642,313,'31ka7g0k4olb0p3qs1rd5qg86s',NULL,'1:1 Meet with Andrew Grinalds & Tom R review 3D printing','2013-10-03 01:00:00','2013-10-03 01:30:00',0,NULL,NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-09-24 23:05:55','2013-10-02 23:59:29','0',0,'2013-10-02 17:00:00','2013-10-02 17:30:00'),(19643,313,'bfort86cc1sccuffn72aaasuss',NULL,'Pitch Meeting with Max Hodak, Transcriptic','2013-10-03 19:30:00','2013-10-03 20:30:00',0,'Max Hodak <max@transcriptic.com> \n646-610-2432\nIntro Jude Gomila, Co Founder, Heyzap\n\nMarc -\n>>>>\n>>>> As Jude said, Transcriptic is \"cloud computing\" for the life sciences.\n>>>> Molecular and cell biology today require very expensive labs and are\n>>>> dependent on repetitive and error prone, though highly skilled, manual\n>>>> labor.  Our platform allows researchers to write their experimental\n>>>> protocols as code (or configure them graphically in the browser) and run\n>>>> them remotely on our automation.  There\'s no hardware to buy and runs are\n>>>> precisely repeatable; and, more importantly, runs are asynchronous so\n>>>> customers can do many things in parallel rather than being crushed at the\n>>>> bench working on one project at a time.\n>>>>\n>>>> For basic research and pharma, we\'re a \"force multiplier\" for each of\n>>>> their team members.  For small groups, we\'re able to decimate their startup\n>>>> costs and allow ideas to be tried out that would have been cost prohibitive\n>>>> before.\n>>>>\n>>>> We\'ve been publicly offering packaged cloning services on the website so\n>>>> far because it\'s easy to QC - you can just sequence the DNA - while we build\n>>>> a reputation.  The platform, though, is very flexible: rather than building\n>>>> the service in terms of different protocols, we see the lab as a collection\n>>>> of devices, and protocols are just compositions of those capabilities.  One\n>>>> of the key insights here is that the vast majority of an average biologist\'s\n>>>> workflow uses a small constellation of devices.  We currently support six\n>>>> core instruments, making us relevant to a large swath of day-to-day basic\n>>>> wet lab work.\n>>>>\n>>>> We\'re about a year and a half old, have one operational robotic work\n>>>> cell at our lab in Menlo Park, and have labs at Stanford and UCSF as paying\n>>>> customers.  We\'re currently eight people; my background is Duke Biomedical\n>>>> Engineering, and two of us have relevant PhDs from Cornell.  We raised a\n>>>> $1.3 million seed round last December, and though we still have about $600k\n>>>> left, we\'re looking to grow a bit and take the technology we\'ve built to\n>>>> market.',NULL,'Arsho Avetian','arsho@a16z.com','2013-09-12 21:14:10','2013-10-03 16:17:13','0',0,'2013-10-03 11:30:00','2013-10-03 12:30:00'),(19644,313,'go96e6gtu6dnit9flobub9i6hg',NULL,'Meeting:  Andre Wegner, Authentise','2013-10-03 23:00:00','2013-10-04 00:00:00',0,'Andre Wegner <andre@authentise.com>\n\n(moving Connie to bcc).  Hi Andre, great to meet you virtually.  We\'d like to arrange for you to meet our partner Tom as a next step.  He\'s spent a lot of time looking at the 3D space.  \n\nLisa, also cced, can help with scheduling.\n\nThank you for the opportunity!\n\nJuliet\n\n\nOn Sun, Sep 29, 2013 at 8:57 AM, Andre Wegner <andre@authentise.com> wrote:\nThanks Connie, for the kind introduction and your generous words. Do let me know when you\'re next at SU.\n\nJuliet, it\'s a pleasure to meet you. Please do let me know if you have any questions or would like to arrange a time for a more detailed introduction.  I look forward to hearing from you.\n\nYours, \nAndre\n\nOn 28 Sep 2013 16:12, \"Connie Chan\" <connie@a16z.com> wrote:\nAndre, it was such a pleasure to meet you! You have a genuine passion to make the world better and I really admire that. Also I\'m quite intrigued by your company and fully agree that 3D printing can solve many problems people don\'t even realize yet. Please meet my colleague Juliet who can help you with next steps.\n\nHave a fantastic weekend!\n\nBest,\nConnie\n\n\nOn Fri, Sep 27, 2013 at 4:23 PM, Andre Wegner <andre@authentise.com> wrote:\nHi Connie,\n\ngreat to meet you today at Singularity - it\'s a truly inspirational place and its wonderful when people get that. I hope you can Sophie can find ways to engage. \n\nAs I mentioned to you we\'re just midway through a 3 week phase of first conversations with funders about a $3MM venture round. A short description is below, an exec summary attached. If you, Chris or anybody else at AH has an interest in talking further, we\'d be delighted.\n\nAll the best,\nAndre\n\n\nAuthentise is a platform for apps serving the 3D Printing industry.\n\nAuthentiseâ€™s current API enables marketplaces to stream designs directly into the 3D printer of users, thus enabling a pay-per-print business model. The company is leveraging this streaming channel to build an app marketplace for the 3D printing industry.\n\nA small team founded Authentise at Singularity University in 2012 and has been fortunate to receive significant media attention and strong inbound sales demand prior to any outbound marketing. \n\nThe company seeks US$3MM investment to scale the business over the next 12-18 months, ideally from partners that understand the 3D Printing industry, are ready to invest through multiple rounds and have relationships in manufacturing.\n\n-- \nweb: authentise.com\nread: MIT Technology Review feature\nmob: +16506918615\nS: andre_wegner\nT: @apweg\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-09-30 21:48:06','2013-10-03 17:54:31','0',0,'2013-10-03 15:00:00','2013-10-03 16:00:00'),(19645,313,'i8ikenaj6b61pvmk78l7i3e134_20131003T170000Z',NULL,'Tom/Frank 1:1','2013-10-04 01:30:00','2013-10-04 02:00:00',0,NULL,NULL,'Lisa Orr','Lisa@a16z.com','2012-11-29 22:25:50','2013-10-03 18:09:55','0',0,'2013-10-03 17:30:00','2013-10-03 18:00:00'),(19646,313,'og5a3eifooeo4r9o40adru90v4',NULL,'City POV meeting','2013-10-03 16:30:00','2013-10-03 17:00:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-10-03 18:10:37','2013-10-03 18:10:37','0',0,'2013-10-03 08:30:00','2013-10-03 09:00:00'),(19647,313,'ltckj4734s1cdnv3rrkj23s7cs',NULL,'Meeting: Yasemin Denari Southworth, Barzo','2013-10-08 21:00:00','2013-10-08 22:00:00',0,'yasemindenari@alumni.gsb.stanford.edu> \n\nThanks Andrew (moving to bcc).  Hi Yasemin, apologies for the delayed response.  We\'re excited to learn more about what you\'re building - our partner Ramu is best suited to take a closer look and we\'d love to set up time for him to meet the team as a next step.  Lisa, also cced, can help with scheduling on our end.\n\nWe appreciate the opportunity!\n\nJuliet\n\n\nOn Thu, Sep 5, 2013 at 2:03 PM, Yasemin Denari Southworth <yasemindenari@alumni.gsb.stanford.edu> wrote:\nThank you Andrew!\n\nJuliet, it is nice to meet you. We\'d love to come by to talk and show you the technology. Are there any times next week that might work for you?\n\nBest regards,\nYasemin Denari Southworth\n\n\nOn Thu, Sep 5, 2013 at 12:38 PM, Andrew Grinalds <agrinalds@a16z.com> wrote:\nHey Yasemin -- Thank you for reaching out with Baarzo -- we are very excited to hear more about your team, product and technology!\n\nI\'d like to introduce you to Juliet Pullis who leads the on-boarding of all of our prospective investments. She will work with you on next steps.\n\nCan\'t wait to catch up,\n\nAndrew\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-10-03 18:27:49','2013-10-03 19:34:16','0',0,'2013-10-08 13:00:00','2013-10-08 14:00:00'),(19648,313,'m173qohqa0icrbrsga0im7g3kc',NULL,'Pitch Meeting | Nat Manning, BRCK','2013-10-03 21:00:00','2013-10-03 22:00:00',0,'On Tue, Sep 17, 2013 at 8:56 PM, Chris Dixon <chris@a16z.com> wrote:\nHey Nat - Sounds good. Ana Marie (cc\'d) can suggest some times.\nChris\n\nOn Mon, Sep 16, 2013 at 2:37 AM, Nathaniel Manning\n<nathaniel.manning@gmail.com> wrote:\nTom, thanks so much for the intro! Moving you to bcc to spare your inbox.\n\nChris, great to meet you as well. It would be great to get together. I am in\nParis for the week speaking at a conference, but next week is wide open.\nHappy to come down to your offices if that is most convenient, is there a time next week that would work for you?\n\nAttaching our slidedeck this a short paragraph about BRCK for context.\n\nLooking forward to it,\nNat\n\nBRCK is a hardware and cloud services technology company based in Nairobi,\nKenya, that spun out of Ushahidi, the data collection and visualization\ncompany that built Ushahidi, Crowdmap, and the iHub.\n\nThe BRCK is a redesign of the modem to connect people in infrastructure-poor\nenvironments, connect sensors to the web, and is infused with a software backend to support applications and for manage data from anywhere in the world.Whether running an office of developers or collecting sensor data from the field, the BRCK was designed to alleviate these connectivity issues by delivering a reliable data connection combined with a robust power source, and managed by a smart cloud-based software, to ensure that nothing gets in the way of being connected. After our successful Kickstarter, we are running a seed round.\n\nOn Mon, Sep 16, 2013 at 4:03 AM, Chris Dixon <chris@a16z.com> wrote:\n\nHey Nat -\nNice to meet you. It would be great to get together sometime!\nThanks,\nChris\n\nOn Sat, Sep 14, 2013 at 6:47 PM, Tom Preston-Werner <tom@github.com>\nwrote:\nHi Chris,\n\nI\'d like to introduce you to Nat who is working on the BRCK hardware\ndevice that I mentioned to you at dinner the other night.\nThey describe it as \"The easiest, most reliable way to connect to the internet, anywhere in the world, even when you donâ€™t have\nelectricity\". They raised almost $175k on Kickstarter to get the project started and are now looking for a seed round.\n\n>> > http://www.kickstarter.com/projects/1776324009/brck-your-backup-generator-for-the-internet\n\nNat - meet Chris Dixon who is a partner at Andreessen Horowitz. He\'s an awesome guy and has a special affinity for hardware companies. I think it\'d be great for the two of you to meet and discuss where you\n want to take BRCK. I\'ll let you take it from here!\n\n Tom\n\nNathaniel Manning\n\nUSA: +1-484-832-0359 | Skype: natmanning | @natpmanning\n www.natmanning.com | www.moraltech.wordpress.com',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-09-17 21:53:44','2013-10-03 19:55:41','0',0,'2013-10-03 13:00:00','2013-10-03 14:00:00'),(19649,313,'5te19dih7ogb6ai155oe6gn6r0',NULL,'Augmate Pitch Session with Frank Chen of Andreessen Horowitz','2013-10-03 21:00:00','2013-10-03 22:00:00',0,NULL,NULL,'Pete Wassell','pete@augmate.com','2013-09-30 17:03:18','2013-10-03 19:59:48','0',0,'2013-10-03 13:00:00','2013-10-03 14:00:00'),(19650,313,'p1a6skb6o8dbpp56v39u3bqr04',NULL,'Welcome lunch','2013-10-04 20:00:00','2013-10-04 21:00:00',0,'[Rescheduled so people can attend the Academic Conference.]',NULL,'Frank Chen','frank@a16z.com','2013-09-19 17:57:34','2013-10-04 18:57:32','0',0,'2013-10-04 12:00:00','2013-10-04 13:00:00'),(19651,313,'bk90h4qum4iic8cv613np949dc',NULL,'Meeting:  Shakeel Avadhany, Levant ','2013-10-04 23:30:00','2013-10-05 00:30:00',0,'Shakeel Avadhany <shakeel@levantpower.com\n\n(moving Alison - thank you! and Margit to bcc).  Hi Shak, great to meet you virtually.  Our partner Tom is best suited to take a closer look and we will try to make a meeting happen tomorrow.  Lisa, cced, will help with scheduling.\n\nTo be fully transparent, your company is a bit outside our sweet spot from a investment perspective, but we are very interested in learning more and getting to you know you.   If you