48','0',0,'2013-10-15 16:00:00','2013-10-15 19:00:00'),(19694,212,'eoj4s9j842t8qdv4hor0vmn510',NULL,'Kristen Pronger / David Evans','2013-10-16 19:00:00','2013-10-16 21:00:00',0,NULL,NULL,'Rachel Aube','rachel@jeditrainers.com','2013-10-08 17:51:19','2013-10-08 19:22:42','0',0,'2013-10-16 11:00:00','2013-10-16 13:00:00'),(19695,267,'bv5kcldfi0pbv9vekr4eprf4ok',NULL,'Building the Story of a Self-Directed Learner','2013-10-15 23:00:00','2013-10-16 00:30:00',0,'Context: \nBruce and the Info Team are currently working on a data profile of case study students based on the resources they use and the content assessments (formative and summative) that they pass.  They will be bringing these initial data pictures to this meeting so that we can consider trends.\n\nAfter looking at that information, we will brainstorm data (qualitative and quantitative) that would help build a clearer picture of how content learning occurs at Summit, with the hope that we can codify and encourage best practices so that all students can accelerate their learning.  Examples of the types of information we could collect to build a complete narrative of self-directed learning includes:  student interviews, mentor interviews, peer interviews, teacher interviews, project time observations, CLT observations, # of times the student accesses help from a peer/teacher/mentor/playlist resource/non-playlist resource, etc.\n\nThe action steps after this meeting is to divide and conquer:  we all have a part to play in collecting information, and then we come back together to build more comprehensive pictures of how kids are learning.  The hope is that, after collecting tihs information and refining the observable behaviors that seem to promote learning, we can begin another round of data collection with the hope of generalizing the story of self-directed learning at SPS.',NULL,'Adam Carter','acarter@summitps.org','2013-10-03 21:44:52','2013-10-04 17:02:28','0',0,'2013-10-15 15:00:00','2013-10-15 16:30:00'),(1