993','2013-10-10 14:30:00','2013-10-10 15:00:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-10-09 19:27:44','2013-10-09 19:27:44','0',0,'2013-10-10 06:30:00','2013-10-10 07:00:00'),(19749,313,'r66l5dmvfqusvh157pq9au0ja4',NULL,'Room for Fundbox pitch','2013-10-09 20:30:00','2013-10-09 21:30:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-10-09 19:30:39','2013-10-09 19:30:39','0',0,'2013-10-09 12:30:00','2013-10-09 13:30:00'),(19750,313,'adkgvl359vcd9ecajth2in7am4',NULL,'Interview:  Jed D. Christiansen','2013-10-15 19:15:00','2013-10-15 20:00:00',0,'Schedule:  \nFrank 10:30-11:15am\nTom 11:15am-12:00pm\n\nJed D. Christiansen <jed.christiansen@gmail.com\n\nHey Jed:\n\nHappy to meet while you\'re out here. Lisa can find a time. We\'ll see if we can thread the needle, as I\'m typically scheduled 4-6 weeks out. Lisa, let\'s have Jed meet me + Connie and/or Tom.\n\nThanks.\n\n--f\n\n\n\nOn Tue, Oct 8, 2013 at 8:03 AM, Jed D. Christiansen <jed.christiansen@gmail.com> wrote:\nHello, Frank.\n\nMy name is Jed Christiansen, and I\'m the founder/creator of Seed-DB.  I\'m fairly sure you\'re knowledgeable about my work because you signed up for my Seed Accelerator Newsletter!\n\nI saw the tweets that you, Chris Dixon and others sent yesterday about hiring for the deal team at Andreessen Horowitz.  I just wanted to let you know personally that I sent my CV through; it\'s attached below.  I\'m passionate about startups, doing analysis on startups, and the world of venture which is hopefully obvious by my work on Seed-DB.  I would love to be considered and interview as a candidate for the team.\n\nI\'m going to be in SFO next week (Monday to Wednesday), so it would be fantastic that if I was a good candidate I could meet people in person then.  Normally I\'m based in London, so this comes at an auspicious time.\n\nBest regards,\nJed\n\n--------------------------------------------\nJed D. Christiansen\n+44 (0) 796 358 3663\nhttp://about.me/jedc\n\n\n---------- Forwarded message ----------\nFrom: Jed D. Christiansen <jed.christiansen@gmail.com>\nDate: Tue, Oct 8, 2013 at 3:50 PM\nSubject: Joining the a16z deal team\nTo: jobs.research@a16z.com\n\n\nHello!\n\nMy name is Jed Christiansen, and I\'m writing to request that you consider me for the a16z deal team.  I\'m passionate about startups, have had my own startup(s), and want to work to find the best startup opportunities for Andreessen Horowitz.\n\nTo demonstrate my passion, please check out Seed-DB.  I created the world\'s first global database of seed accelerator programs, their companies, and the investors in those companies.  For example, you can see the list of companies that Andreessen Horowitz has invested in here: http://www.seed-db.com/investorgraph/investorview?investorid=361533  (Though this only includes rounds that are public on Crunchbase.)  I\'ve personally sourced/curated key segments of Seed-DB data, and am intimately familiar with accelerators.\n\nIn addition to my work creating Seed-DB (the first webapp I\'ve ever built), I\'ve got a degree in Aerospace Engineering, experience in both nuclear and solar power, and have four years of experience at Google building sales partnerships from nothing to >$60m/year.  (That\'s the total I\'m directly responsible for in emerging markets.)\n\nI hope to hear from you.\n\nBest regards,\nJed\n\nPS - I\'m based in London, but will be in SFO on Mon 14 Oct - Wed 16 Oct if there\'s an opportunity to meet in person.\n\n--------------------------------------------\nJed D. Christiansen\n+44 (0) 796 358 3663\nhttp://about.me/jedc\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-10-09 19:31:12','2013-10-09 21:46:28','0',0,'2013-10-15 11:15:00','2013-10-15 12:00:00'),(19751,313,'aaej2hqbaiqbito7nbvqajfrqg',NULL,'Room for pitch','2013-10-09 23:30:00','2013-10-10 00:30:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-10-09 22:29:39','2013-10-09 22:29:39','0',0,'2013-10-09 15:30:00','2013-10-09 16:30:00'),(19752,267,'1kj9bat5u2s0ue3tfpavcejlng',NULL,'JD and Mira','2013-10-10 17:00:00','2013-10-10 18:00:00',0,NULL,NULL,'Jon Deane','jdeane@summitps.org','2013-10-09 22:56:39','2013-10-09 22:59:05','0',0,'2013-10-10 09:00:00','2013-10-10 10:00:00'),(19753,267,'cujov9epjbdd8vqqlj7u30v5lg',NULL,'Be at Everests LT meeting','2013-10-11 00:00:00','2013-10-11 00:30:00',0,NULL,NULL,'Jon Deane','jdeane@summitps.org','2013-10-09 23:02:30','2013-10-09 23:02:30','0',0,'2013-10-10 16:00:00','2013-10-10 16:30:00'),(19754,313,'r680nbo94vvffu5u2pe8upioe4',NULL,'Pitch Meeting | Kyle Kirchhoff, Leap Transit ','2013-10-16 21:00:00','2013-10-16 22:00:00',0,'confirmed\n\nKyle Kirchhoff\n7:11 PM (15 hours ago)\n\nto me \nSounds great, thanks Ana Marie!\n\nOn Tue, Sep 17, 2013 at 4:56 PM, Ana Marie Corona <anamarie@a16z.com> wrote:\nHello Kyle,\n\nNice to e-meet you.  First availability for Chris is Tuesday, Oct. 8 at 1pm PST in Menlo Park.  Will this work?\n\nBest,\n\nAna Marie\n\nOn Tue, Sep 17, 2013 at 12:53 AM, Kyle Kirchhoff <kyle@leaptransit.com> wrote:\nHey Chris -\n\nLikewise. Next week sounds great. Monday?\n\nKyle\n\nOn Mon, Sep 16, 2013 at 9:14 PM, Chris Dixon <chris@a16z.com> wrote:\nHey Kyle - Great to meet you. I\'m going to NYC this week but perhaps we could meet next week if you have time?\nLooking forward to it,\nChris\n\nOn Sep 16, 2013, at 7:33 PM, David Lee <david@svangel.com> wrote:\n\nChris,\n\nPls meet Kyle of Leap Transit. We\'re investors along with Balaji and Scott Bannister.\n\nKyle, Please meet Chris Dixon of A16Z!\n\n-David\n\nMy blog: daslee.me\n',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-09-17 23:55:47','2013-10-16 18:08:52','0',0,'2013-10-16 13:00:00','2013-10-16 14:00:00'),(19755,313,'lh3giobu7b368voh51dgts5pto',NULL,'1:1 Tom R & Lars, Discuss 3-Dprinting','2013-10-16 21:30:00','2013-10-16 22:00:00',0,'Ana Marie,\n\nCan you find 30 mins for Lars and I?  I\'m going to brief him on 3D printing, per his request.  Not urgent but would be good to do it relatively soon.\n\nThanks,\n\nTom',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-10-07 16:56:55','2013-10-16 00:36:25','0',0,'2013-10-16 13:30:00','2013-10-16 14:00:00'),(19756,313,'i8ikenaj6b61pvmk78l7i3e134_20131017T170000Z',NULL,'Tom/Frank 1:1','2013-10-17 22:00:00','2013-10-17 22:30:00',0,NULL,NULL,'Lisa Orr','Lisa@a16z.com','2012-11-29 22:25:50','2013-10-15 21:56:19','0',0,'2013-10-17 14:00:00','2013-10-17 14:30:00'),(19757,262,'t1q40gtvablsah7p9n0t5kfp84_20131017T070000Z',NULL,'Sleep','2013-10-17 00:00:00','2013-10-17 08:00:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-06-20 16:58:00','2013-06-20 16:58:00','0',0,'2013-10-17 00:00:00','2013-10-17 08:00:00'),(19758,262,'lcc5fvso3oiccav2i7du2n8v8c_20131017T070000Z',NULL,'TEST for calculation','2013-10-17 00:00:00','2013-10-17 23:59:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-06-21 21:43:07','2013-06-21 21:46:23','0',0,'2013-10-17 00:00:00','2013-10-17 23:59:00'),(19759,313,'331e6n224sqqjgr28cvrd79gr0',NULL,'BLOCK','2013-10-17 21:30:00','2013-10-17 23:00:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-10-09 05:26:57','2013-10-15 18:27:14','0',0,'2013-10-17 13:30:00','2013-10-17 15:00:00'),(19760,204,'t1q40gtvablsah7p9n0t5kfp84_20131017T070000Z',NULL,'Sleep','2013-10-17 08:00:00','2013-10-17 16:00:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-06-20 16:58:00','2013-06-20 16:58:00','0',0,'2013-10-17 00:00:00','2013-10-17 08:00:00'),(19761,278,'bke5gh2un9ea37dnn9jrgdlptg_20131017T140000Z',NULL,'TEST - 8 hours recurring','2013-10-17 15:00:00','2013-10-17 23:00:00',0,NULL,NULL,'Hennie Strydom','hms222@gmail.com','2013-06-22 16:23:35','2013-06-22 16:23:35','0',0,'2013-10-17 07:00:00','2013-10-17 15:00:00'),(19762,313,'v5tjrv5jrf1ql3q852vdf0h2e8',NULL,'Pitch Meeting | Gregg Brockway & Eric Grosse, Chairish','2013-10-17 18:30:00','2013-10-17 19:30:00',0,'Gregg Brockway \n<gbrockway@gmail.com>\nm: 415-596-6218',NULL,'Michelle Mundy','michelle@a16z.com','2013-10-08 22:55:07','2013-10-17 16:57:04','0',0,'2013-10-17 10:30:00','2013-10-17 11:30:00'),(19763,204,'lcc5fvso3oiccav2i7du2n8v8c_20131016T070000Z',NULL,'TEST for calculation','2013-10-16 08:00:00','2013-10-17 07:59:00',0,NULL,NULL,'Hennie Strydom','hms007@gmail.com','2013-06-21 21:43:07','2013-06-21 21:46:23','0',0,'2013-10-16 00:00:00','2013-10-16 23:59:00'),(19764,313,'lv8kdcufq6ac6q39q5btol6kcc',NULL,'Pitch Meeting: CRS Systems | Chaitanya Kodeboyina','2013-10-17 00:00:00','2013-10-17 01:00:00',0,'chaitk@gmail.com\n408.836.0345\n\nOn Thu, Sep 26, 2013 at 9:51 AM, Ramu Arunachalam <ramu@a16z.com> wrote:\nHi Chaitanya,\nGood news. I discussed with the partnership and Peter Levine and John Jack expressed interest in meeting and learning more. June (copied) can help coordinate calendars for a meeting with Peter. \n\nJune - please also make sure to check with John Jack on his availability. He\'d like to join as well.\n\nBest,\nRamu\n\n\n\nOn Tue, Sep 24, 2013 at 10:04 PM, Chaitanya Kodeboyina <chaitk@gmail.com> wrote:\nHi Ramu -\n\nSorry to bother you, but I just wanted to know if you had any feedback on the updated slides or the funding ask. I really think we fit well into the disruption that A16Z is trying to bring to networking from the enterprise LAN/WAN to the datacenter.\n\nThanks a lot,\n-cK\n\n\nOn Mon, Sep 23, 2013 at 12:18 PM, Chaitanya Kodeboyina <chaitk@gmail.com> wrote:\nHi Ramu -\n\nHere is the updated deck with the seed ask of $2M. We have cut our expenses by optimizing on hiring and cutting salaries for founders through the seed phase. The seed + series-A ask is $8M for just the SDWAN stuff (assuming we are not picking up SDLAN with AP) as part of series-A. Here is the updated slide deck with the funding ask.\n\nPlease let us know that you got the deck and if you have any questions on the ask. If you need us to tweak the slides, we can do it before the next pitch.\n-cK\n\nPS: Ignore the $3M request in the last deck I sent you\n\n\nOn Mon, Sep 23, 2013 at 1:27 AM, Chaitanya Kodeboyina <chaitk@gmail.com> wrote:\nHi Ramu -\n\nAttached is the updated version of the slides that I presented on Friday. I have made the updates we talked about. Please let me know if you need me to fix anything.\n\nWe would really prefer to raise Series-A. But in the interest of time, we would be fine to move ahead with seed and come back with Series-A at a later point of time. I\'ll fine tune my seed & Series-A projections tomorrow.\n\nI am hoping you can talk to Peter today (Monday) and get us a chance to pitch to the GPs. Please let me know if you need anything else from me.\n\nThanks a lot for your direction. We love working with you.\n-cK\n',NULL,'June Chan','june@a16z.com','2013-09-27 16:30:34','2013-10-16 22:54:27','0',0,'2013-10-16 16:00:00','2013-10-16 17:00:00'),(19765,313,'2gge285bik37tj6948qf4jtluc',NULL,'Pitch Meeting | Louay Eldada, Quanergy','2013-10-16 23:00:00','2013-10-17 00:00:00',0,'From our side, the entire founding team will attend:\n - Louay Eldada - CEO\n - Angus Pacala - Director, Engineering\n - Tianyue Yu - Director, System Integration\n\n\nOn Mon, Oct 7, 2013 at 2:56 PM, Zal Bilimoria <zal@a16z.com> wrote:\nLouay,\n\nReally appreciate the detailed response to my questions.\n\nAs promised, I reviewed the opportunity with the rest of the partners here, and good news: Marc and Chris are interested in meeting you (and your founding team, if possible).\n\nI\'m copying Ana Marie to help find a time that works for you.\n\nThanks, and look forward to seeing you again!\nZal\n\nOn Fri, Oct 4, 2013 at 1:53 PM, Louay Eldada <louay.eldada@quanergy.com> wrote:\nZal, we will have a GPS chip (~$10) for redundancy and for knowing roughly where the vehicle is and which maps it needs -- however localization with our cm-accurate maps, which are built over time, does not require exact correlation to GPS maps, the system will recognize the environment and location within our maps.  The general approach is SLAM (Simultaneous Localization And Mapping).\n\nBest,\nLouay\n\n\nOn Fri, Oct 4, 2013 at 11:43 AM, Zal Bilimoria <zal@a16z.com> wrote:\nQuick follow-up question, Louay...\n\nHow will you build out map data given that LiDAR provides you the point cloud of what\'s around the car but not GPS info? Or does your device also have location data?\n\nThanks!\nZal\n\n\nOn Thu, Oct 3, 2013 at 5:39 PM, Louay Eldada <louay.eldada@quanergy.com> wrote:\nThanks Zal.\n\nBest,\nLouay\n\n\nOn Thu, Oct 3, 2013 at 5:33 PM, Zal Bilimoria <zal@a16z.com> wrote:\nLouay,\n\nThank you for sharing this information with so much detail. I will\nreview this with our partnership team and get back to you shortly.\n\nBest,\nZal\n\n\n> On Oct 2, 2013, at 5:41 PM, Louay Eldada <louay.eldada@quanergy.com> wrote:\n>\n> Zal,\n>\n> It was a pleasure meeting with you and Frank, and experiencing the\n> Andreessen Horowitz culture first hand.  It was refreshing.\n>\n> I couldn\'t agree more that it is mostly about the team, and at this point\n> in my career I paid more attention than ever to having the right team of\n> founders.\n>\n> The other two co-founders are Tianyue Yu (Director, System Integration) and\n> Angus Pacala (Director, Engineering).  We worked together for a year at\n> Amprius, where we dealt with office politics and favoritism that drove\n> decisions that often made no technical or business sense.  It was in this\n> challenging environment that it became clear that the three of us have\n> similar values, ethics, belief in transparency, straight talk, and doing\n> the right thing for the business -- we took a stand and walked out when the\n> person on top was stuck in his ways and supported what a small group of\n> people he favored wanted to do, even when data supported making different\n> decisions.  Angus, Tianyue and I respect each other because of our\n> capabilities and characters, and agree on having a company with a culture\n> of transparency and ethics, where attracting and retaining top talent will\n> happen because of the culture -- people will feel appreciated and\n> encouraged to speak up their minds with no negative consequences, and\n> data/logic/business sense drive decisions.  We basically know how to make\n> sure the workforce is happy and energized, and we expect that they will\n> bring the brightest people they know.\n>\n> The resumes of all three of us are attached.  I am also attaching the\n> resume of Ryan Thomspon, our Director of Software Development, though he is\n> not a founder (he is employee #1 after the founders).\n>\n> My previous start-ups:\n> - Started the telecom photonics business at Honeywell (Morristown, NJ) in\n> 1994, it became Honeywell Photonics, it was acquired by Corning in 1999 --\n> products: photonic integrated circuits (PIC) for telecom\n> - Started Telephotonics (Boston) in 2000, was CTO/VP Eng, it was acquired\n> by DuPont in 2002, it became DuPont Photonics, where I stayed for an\n> additional 6 years; we scaled up and manufactured our chips in the US, our\n> components in Shenzhen, China, and our modules in Thailand -- products:\n> PIC-based components and modules for telecom\n> - Joined solar company HelioVolt (Austin, TX) in 2008 as CTO, was brought\n> in by NEA to turn company around (Scott Sandell had written off the 100MM+\n> investment); proved with data that process window based on founder\'s\n> technology was zero, developed new technology that is manufacturing worthy,\n> filed new patents, laid off 2/3 of workforce and brought in key hires with\n> the right industry experience, gutted and redesigned the inside of $70MM\n> worth of equipment, scaled up process, achieved high efficiency and high\n> yield (narrow distribution), and sold the company to SK Energy, Korea --\n> product: monolithic CIGS solar panels printed directly on glass (not\n> sandwiched hand-picked foils)\n> - Joined SunEdison (Belmont, CA) in 2011 as CSO (Chief Science Officer)\n> and VP of Global R&D; my global team (in several US locations and two India\n> locations [Chennai & Bangalore]) built (a) SunEdison\'s own silicon solar\n> panels [SunEdison used to be a construction company before they brought\n> me], which we transferred to Flextronics in Malaysia for manufacturing, (b)\n> Solar in a Box (full containerized solar power plants for rural/off-grid\n> areas, independent military bases, etc.), and (c) ancillary products\n> (energy storage solutions, power management solutions, etc.).\n> - Joined Amprius (lithium ion storage company in Sunnyvale) in 2012; this\n> was my only job that dis not involve photons, and my experience in this\n> space came from having led the energy storage activities at SunEdison;\n> Amprius is where I worked with Angus and Tianyue, per the story above\n>\n> When Angus, Tianyue and I left Amprius, we decided:\n> - We will build a company that leads in innovation and corporate culture\n> - We will build a company where we can use our unique combination of\n> diverse skills in a space that is not crowded -- after telecom, solar and\n> lithium ion, it was time to lead in a space where we saw a real need in a\n> large market about to take off, as opposed to follow a hot trend -- no more\n> \'bubble\' companies\n>\n> The annual revenues ranged from $5MM to $50MM at exit (except for\n> HelioVolt, it was a long-term play, no CIGS company had significant sales),\n> and they grew to several hundred million dollars after the acquisitions\n> (again, except for HelioVolt, SK is still building the mfg facility).\n>\n> The team sizes at acquisition ranged between 20 and 50 people.\n>\n> Hopefully this gives you a better idea of what we are about.  We are a team\n> with good chemistry, and at the same time we challenge each other\n> constantly (we do it with respect, always attacking the issue not the\n> person).  We are data-driven, and practice structured development.  I am\n> attaching an additional file on our Team, Values, Culture and Processes.\n>\n> Regards,\n> Louay\n>\n> --\n> Louay A. Eldada, Ph.D.\n> CEO, Founder\n> Quanergy Systems, Inc.\n> 1419 Pointe Claire Court\n> Sunnyvale, CA 94087\n> T: +1 (512) 965-6151\n> F: +1 (408) 542-9584\n> louay.eldada@quanergy.com\n> linkedin.com/in/louayeldada\n> tweets: twitter.com/louel\n> www.quanergy.com\n>\n>> On Wed, Oct 2, 2013 at 1:10 PM, Zal Bilimoria <zal@a16z.com> wrote:\n>>\n>> Louay,\n>>\n>> Once again, it was a pleasure meeting you last week here at Andreessen\n>> Horowitz. We are certainly very intrigued with your technology and the\n>> company you\'re building but would like to learn a bit more about the team.\n>>\n>> Could you please send me some additional info regarding the Quanergy\n>> founding team? We\'d like to know their names, backgrounds, how you met each\n>> other, etc.\n>>\n>> Also, could you give us some additional commentary regarding your previous\n>> startups?\n>>\n>>   - What were the names of the companies that you founded that were\n>>   acquired?\n>>   - Who were they acquired by? (Honeywell and Corning, I believe?)\n>>   - What products and technologies did you build at those startups?\n>>   - How many employees did they have prior to acquisition?\n>>   - What were the revenues, if any? Any other metrics that you can share?\n>>\n>> As we discussed, Andreessen Horowitz really wants to support founders with\n>>',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-10-09 21:27:01','2013-10-16 04:27:55','0',0,'2013-10-16 15:00:00','2013-10-16 16:00:00'),(19766,212,'ckfp7rdiqrvgihc89eqd3uapsc_20131017T171500Z',NULL,'Yoga at 10:30','2013-10-17 18:15:00','2013-10-17 20:15:00',0,NULL,NULL,'David Evans','david@jeditrainers.com','2013-08-22 03:35:55','2013-09-01 14:50:17','0',0,'2013-10-17 10:15:00','2013-10-17 12:15:00'),(19767,212,'rlmraaejiq63df2lrn7q77b8g0_20131017T152500Z',NULL,'Standups - 100pts + 1 other task','2013-10-17 16:25:00','2013-10-17 16:30:00',0,NULL,NULL,'David Evans','david@jeditrainers.com','2013-10-01 00:27:53','2013-10-02 16:58:55','0',0,'2013-10-17 08:25:00','2013-10-17 08:30:00'),(19768,212,'hl3vt7naeivgjv2k1v0eto6r5o',NULL,'TKCS coach t