ail.com> wrote:\nHey David\nYeah, sorry, didn\'t have time this trip. But let\'s catch up next time your in CA or I\'m in NY.\nHope things are well\nChris\n\nOn Thu, Aug 15, 2013 at 4:14 PM, David Hammer <mrdhammer@gmail.com>wrote:\n\nHey chris,\nHope you\'re well. Apologies for the nudge but figured I\'d check in again -- got a free slot in this trip? Otherwise, would love to catch up\nnext  time.\n\nD\n\nOn Wed, Aug 14, 2013 at 12:11 PM, David Hammer <mrdhammer@gmail.com>wrote:\n Hey Chris,\nHope you\'re well. I was hanging out with Aaron Harris the other day\nand he mentioned you\'re in town this week. If you have 30 minutes whileyou\'re here, I\'d love to sit down and talk a bit -- we\'ve made a bunch of progress with Emissary and I\'m looking for perspective on a few things. We\'re based in the West Village but I can head anywhere -- let me know if you\'ve gotsome time.\n\nD\n\n',NULL,'Ana Marie Corona','AnaMarie@a16z.com','2013-09-18 21:37:08','2013-10-11 08:07:48','0',0,'2013-10-11 07:00:00','2013-10-11 08:00:00'),(19863,313,'1pd3dg38n008nsb0f37o42noms_20131018T163000Z',NULL,'Volunteer/ Philanthropy Meeting','2013-10-18 17:30:00','2013-10-18 18:00:00',0,NULL,NULL,'Minerva Munoz','minerva@a16z.com','2012-12-07 23:25:27','2013-10-18 15:57:05','0',0,'2013-10-18 09:30:00','2013-10-18 10:00:00'),(19864,313,'dadb21dtgf4pdi1qeb2s3u5vts',NULL,'Meeting:  Lynda Ward Pierce, Compsaavy ','2013-10-17 23:00:00','2013-10-18 00:00:00',0,'Lynda Ward Pierce <lynda@compsavvy.com>\n\nThanks Anne (moving to bcc).  Hi Lynda, its great to meet you virtually - we\'re excited to learn more about CompSaavy and would like to have you meet our partners Tom and Zal as a next step.   Lisa, also cced, can help with scheduling on our end.\n\nWe appreciate the opportunity!\n\nJuliet\n\n\nOn Tue, Oct 8, 2013 at 4:56 PM, Anne Fazioli-Khiari <anne.m.fazioli@gmail.com> wrote:\nJuliet,\n\nThanks for your email.  I\'m copying Lynda on this email so she can offer her available times.\n\nBest,\n\nAn