ce: (877) 714-4828 | Fax: (877) 567-7828\nwww.airware.com\n',NULL,'Nicole Lazar','nicole@a16z.com','2013-10-14 15:46:56','2013-10-18 15:41:41','0',0,'2013-10-23 11:30:00','2013-10-23 12:30:00'),(20182,313,'2d7ibqpcj3947se2rfapuvbslg',NULL,'GigaOM Wearables Session','2013-10-16 23:30:00','2013-10-17 00:30:00',0,'GigaOM Research Mapping Session: Wearables â€” whatâ€™s needed to make them mainstream\n*You must be registered for Mobilize to attend this event\nWeâ€™ve seen smart watches, Google Glass, Fitbit and Nike+ FuelBand. We havenâ€™t seen Apple, of course. So far these look like interesting niche markets. Everybodyâ€™s getting a smartphone, and glanceable data and apps make sense. But what, if anything, makes wearables a mass-market product in the next 12 to 24 months?\nQUESTIONS\nPlatform precedes content. Is there a killer app for the existing hardware?\nIs this a device business, or is there money to be made in apps? Advertising? Shopping? Search? Augmented reality? Sex toys?\nWhatâ€™s the real social media play? Status updates, sure, but what about photos and check-ins?\nWhich form factors will prevail? Will wearables be general- or special-purpose?\nMust we wait for Apple? Or are Samsung, startups and Nike-types going to drive this space?\nMODERATOR\nDavid Card, VP, GigaOM Research\nSPEAKERS\nColin Gibbs - Mobile Analyst and Consultant, GigaOM Research \nHans Hartman - Principal, Suite 48 Analytics and Analyst, GigaOM Research \nAaron Watkins - Co-Founder, Appency and Analyst, GigaOM Research\nLOCATION\nMission Bay Conference Center\nWednesday, October 16\n3:30 PM - 4:30 PM\nRoom: Conference Room 4, Level 2\nWhat happens in a Mapping Session? We tap the collective wisdom of our analysts and other thought leaders in the market sector we are researching in order to identify the most disruptive trends and their relative importance in shaping a market or industry over the next 12 to 24 months. We also examine which companies are in the best and worst positions to drive these trends â€” which we call disruption vectors â€” and gain market share and revenue.\n',NULL,'Tom Rikert','tom@a16z.com','2013-10-15 22:59:33','2013-10-15 22:59:33','0',0,'2013-10-16 15:30:00','2013-10-16 16:30:00'),(20183,313,'papag9m2rcv9t0jhutoj3n27n4',NULL,'Dave-Tom call','2013-10-18 21:30:00','2013-10-18 22:00:00',0,'Dave to call Tom\'s cell: 415-336-5568',NULL,'Tom Rikert','tom@a16z.com','2013-10-16 00:51:57','2013-10-16 00:53:03','0',0,'2013-10-18 13:30:00','2013-10-18 14:00:00'),(20184,313,'3jvjg3bogjhh5losoho5clds14',NULL,'Coffee: Tom/Zal','2013-10-22 22:30:00','2013-10-22 23:00:00',0,NULL,NULL,'Zal Bilimoria','zal@a16z.com','2013-10-16 01:05:16','2013-10-16 01:25:28','0',0,'2013-10-22 14:30:00','2013-10-22 15:00:00'),(20185,313,'5pc11uc07d39me1d8vphihn0c8',NULL,'Pitch Meeting | Nitin Mangtani, PredictSpring','2013-10-23 18:30:00','2013-10-23 19:30:00',0,'Nitin Mangtani\nnitin@predictspring.com\nm:408-218-1344',NULL,'Michelle Mundy','michelle@a16z.com','2013-10-10 23:21:56','2013-10-17 16:57:31','0',0,'2013-10-23 10:30:00','2013-10-23 11:30:00'),(20186,313,'hmp24dib027rm3k6kg9fs23nho',NULL,'Pitch Meeting | Robert Wang, Threegear','2013-10-16 22:00:00','2013-10-16 23:00:00',0,'confirmed...amc\nOn 10/3/2013 12:44 PM, Gil Shafir wrote:\n\n Hi Robert,\n\nGreat meeting with you as well.  We\'re excited by what you\'re building and would like to take the next step by having you come in to meet with Chris Dixon, one of our general partners.  Ana can help coordinate a time that works for you.\n\nThanks,\nGil\n\n        On Wed, Oct 2, 2013 at 9:28 PM, Robert Wang\n        <rywang@threegear.com <mailto:rywang@threegear.com>\n        <mailto:rywang@threegear.com <mailto:rywang@threegear.com>>> wrote:\n\n\nHi Gil,\n\n It was a pleasure meeting you, and I really appreciate your feedback. I\'ve attached a copy of our slides, a video showing a Leap comparison, and a video showing some (very) early work with the front-facing pmdtec camera.\n\nSlides:\n        ht