-24 15:00:00','2013-10-24 23:00:00',0,NULL,NULL,'Hennie Strydom','270win@gmail.com','2013-06-22 18:45:58','2013-06-22 18:46:19','0',0,'2013-10-24 07:00:00','2013-10-24 15:00:00'),(20239,286,'l0h4f5mgm0qtp25earamnjdbgk_20131023T200000Z',NULL,'TEST - 8 hours, 2 hour overlap','2013-10-23 21:00:00','2013-10-24 05:00:00',0,NULL,NULL,'Hennie Strydom','270win@gmail.com','2013-06-22 18:47:01','2013-06-22 18:47:28','0',0,'2013-10-23 13:00:00','2013-10-23 21:00:00'),(20240,286,'2522mfvcd7s85u30a4l9bgvis0_20131023T230000Z',NULL,'TEst - all overlapping','2013-10-24 00:00:00','2013-10-24 02:00:00',0,NULL,NULL,'Hennie Strydom','270win@gmail.com','2013-06-22 18:48:10','2013-06-22 18:48:10','0',0,'2013-10-23 16:00:00','2013-10-23 18:00:00'),(20241,286,'91kqmvk9u9chgbd3kui3fhtt6s_20131024T050000Z',NULL,'Test - Standalone','2013-10-24 06:00:00','2013-10-24 07:00:00',0,NULL,NULL,'Hennie Strydom','270win@gmail.com','2013-06-22 18:48:33','2013-06-22 18:48:33','0',0,'2013-10-23 22:00:00','2013-10-23 23:00:00'),(20242,313,'in5htm3lt9u8fp336rc7hin3o4',NULL,'Meeting with Richard Tedlow','2013-10-24 00:30:00','2013-10-24 01:15:00',0,'Richard S. Tedlow\nClass of 1949 Professor of Business Administration, Emeritus\nHarvard Business School\nSoldiers Field\nBoston, MA  02163\nTel:  617-495-6688\n<reconf>\n\n---------- Forwarded message ----------\nFrom: Marc Andreessen <pmarca@a16z.com>\nDate: Wed, Jul 10, 2013 at 11:39 AM\nSubject: Re: a16z as Institute for Innovation - potential intro\nTo: Tom Rikert <tom@a16z.com>, Aa Arsho Avetian <arsho@a16z.com>\nCc: Ben Horowitz <ben@a16z.com>\n\n\nSure -- I\'ve read his books and would be happy to talk (when I get back).\nMarc\n\n\nOn Wed, Jul 10, 2013 at 11:14 AM, Tom Rikert <tom@a16z.com> wrote:\n> Marc, Ben,\n>\n> Over the break I was reflecting on the themes from LP Day and wanted to\n> explore an opportunity with you.  I love business history and found Ben\'s\n> historical compare and contrast of the auto industry, the tech industry, and\n> now a16z very interesting.  I feel we\'re creating a new category beyond a\n> venture firm or operating company, and it\'s exciting to pioneer this\n> together!  What we\'re building isn\'t an incubator, accelerator, university,\n> or consulting firm either, though these organizations have valuable aspects\n> that we could include in our new institute for innovation.\n>\n> I suspect there are more lessons to learn from the past as we develop this\n> new organizational model, and it reminded me of one of my favorite\n> professors at HBS who we may want to engage.  Richard Tedlow teaches\n> business history and has studied many of the franchise companies of the last\n> 100 years.  In particular he\'s looked at how companies have structured and\n> marketed themselves within industries experiencing disruption.  Compared to\n> other professionals or academics, I think Richard has a unique long-term\n> perspective that could help us build an enduring institution.  Let me know\n> if you\'d be interested in connecting with him and I\'d be glad to make the\n> introduction.  He could also be an engaging speaker for an internal event.\n>\n> By way of background, Richard is also a good friend of Sheryl.  He has\n> written best-selling biographies for tech leaders, most recently Andy Grove\n> and the IBM Watson Family.  He\'s a good person to know in the event that\n> anyone is looking for a biographer someday and Walter Isaacson doesn\'t suit\n> to taste :)\n> http://www.hbs.edu/faculty/Pages/profile.aspx?facId=6564&facInfo=pub\n>\n> Best,\n>\n> Tom\n>\n> --\n> Tom Rikert',NULL,'Arsho Avetian','arsho@a16z.com','2013-10-08 16:49:49','2013-10-21 16:00:44','0',0,'2013-10-23 16:30:00','2013-10-23 17:15:00'),(20243,313,'nof5185gn8as2s3il0ss5vfr9k',NULL,'Group preso: Max Skibinsky, candidate for consumer','2013-10-24 18:00:00','2013-10-24 18:45:00',0,'Max Skibinsky <max@skibinsky.com\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-10-09 18:27:41','2013-10-18 15:41:25','0',0,'2013-10-24 10:00:00','2013-10-24 10:45:00'),(20244,313,'lr57g6lds6s0v5653bc6qcr2qo',NULL,'Meeting:  Prof Monica Lam ','2013-10-24 21:00:00','2013-10-24 22:00:00',0,'Monica Lam <lam@cs.stanford.edu\n\nGreat! Very much looking forward to it.\n\nI am moving you to bcc and cc\'ing Lisa who can figure out the best time on our end.\n\nOn Fri, Aug 9, 2013 at 12:44 PM, Kunle Olukotun <kunle@stanford.edu> wrote:\nSam,\n\nI\'d be glad to talk with you and Frank Chen.  Next week I\'m available after 2pm on Monday or 10AM-Noon on Wednesday and Thursday.\n\nKunle\n\n-----------------------------------------------------\nKunle Olukotun\nProfessor, EE and CS\nDirector, Pervasive Parallelism Lab (PPL)\nGates Computer Science Bldg 3A\nRoom 302\nStanford University\nStanford, CA 94305\n(650) 725-3713\n\n\n\n\nOn Aug 9, 2013, at 10:02 AM, Sam Gerstenzang <sam@a16z.com> wrote:\n\nHi Professor Olukotun,\n\nI\'m a partner on the research team at Andreessen Horowitz. Together with Frank Chen, head of venture investing at the firm, I\'ve been meeting with Stanford professors to learn about their research, what areas they find most interesting, and if we can be helpful in anyway (either via investment, a partnership or introducing you to one of our portfolio companies.)\n\nIf you are interested, we would love to stop by your office to chat. We\'ve been spending a lot of time recently trying to understand the next generation data center and we think low power chips will likely play a large part in that. Plus, your name keeps coming up when we ask who we should meet at Stanford :)\n\nThanks so much,\n-Sam\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-08-16 18:26:01','2013-10-21 18:40:13','0',0,'2013-10-24 13:00:00','2013-10-24 14:00:00'),(20245,313,'n61vpa0bhp6vk80itdongbc8bk',NULL,'Conf. room for interview Stefano Bernardi','2013-10-24 22:15:00','2013-10-24 23:00:00',0,NULL,NULL,'Lisa Orr','Lisa@a16z.com','2013-10-15 19:28:35','2013-10-15 23:08:18','0',0,'2013-10-24 14:15:00','2013-10-24 15:00:00'),(20246,313,'vj1jc8rbhqaunlgn3c6krbidgg',NULL,'Interview:  Stefano Bernardi, candidate for consumer','2013-10-24 21:00:00','2013-10-24 23:30:00',0,'Stefano Bernardi <ste@bernardi.me>\n415-694-8824 \n\nSchedule:  \n\n12:30-1pm Weiss\n1-1:30pm Margit\n1:30-2:15pm Brian R2\n2:15-3pm Tom R2\n3-3:30pm Elizabeth Weil R2\n3:30-4pm Stump\n\n',NULL,'Lisa Orr','Lisa@a16z.com','2013-10-15 17:39:41','2013-10-18 15:40:29','0',0,'2013-10-24 13:00:00','2013-10-24 15:30:00'),(20247,313,'v9upts42ee1hsb9rsi6sunui4k',NULL,'Call with Alex Littlewood // co-founder advice','2013-10-15 20:30:00','2013-10-15 21:00:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-10-16 15:15:50','2013-10-16 15:15:54','0',0,'2013-10-15 12:30:00','2013-10-15 13:00:00'),(20248,313,'_88r30hhl89148e1l692j8dpi8h0jih1n70o36h268opk8gi164pj0c1g60o30c1g60o30c1g60o30c1g60o30c1g60o30c1g60o30c0',NULL,'Interview with Tom / Juan ','2013-10-18 21:00:00','2013-10-18 21:30:00',0,NULL,NULL,'Tom Rikert','tom@a16z.com','2013-10-16 17:39:32','2013-10-16 17:48:33','0',0,'2013-10-18 13:00:00','2013-10-18 13:30:00'),(20249,313,'k1rvvnr60aoquqrkvi1oj0eob8',NULL,'Meeting:   Alex Ermolaev, Alanta','2013-10-24 19:00:00','2013-10-24 20:00:00',0,'Alex Ermolaev <alex@alanta.com\n\nHi Alex, thanks for the additional information.  Our partner Tom is best suited to take a closer look; Lisa, cced, can help set up a call or meeting for you two as a next step.\n\nWe appreciate the opportunity!\n\nJuliet\n\n\nOn Tue, Oct 8, 2013 at 12:36 AM, Alex Ermolaev <alex@alanta.com> wrote:\n\nHello, Juliet,\n\nThank you very much for your email. I appreciate you reaching out to me.\n\nAttached please find a short version of Alanta presentation. It also has little video capture (no audio) of product in action on slide 2. I would be glad to add my personal narrative to those slides at your earliest convenience.  \n\nI hope we can take it from where we left it with Ronny. \n\nI am looking forward to talking with you!\n\nThanks,\nAlex\n\n\n\nOn Mon, Oct 7, 2013 at 2:22 PM, Jul