istration, Rates valid 4 days before and after the group official dates, 15% discount for the group on spa treatments, Group rooms will have preference in view assignments, 20% discount for the group on Restaurants and bar consumptions, and Late check out upon availability.\nTo secure this room rate, you will need to call 1.877.376.0724 from 9 a.m. to 5 p.m. Mountain Standard Time and give them the code: SGWED. More detailed info is below.\nNote:  If you decide to book rooms using a different method such as Starwood Points, etc., please let us know directly so that we can inform the wedding coordinator that you are part of the S & G Wedding to enjoy some of the perks!\n',NULL,'Tom Rikert','tom@a16z.com','2013-10-19 01:12:11','2013-10-19 17:24:34','0',0,'2013-10-25 17:30:00','2013-10-25 19:00:00'),(20335,278,'bke5gh2un9ea37dnn9jrgdlptg_20131026T140000Z',NULL,'TEST - 8 hours recurring','2013-10-26 15:00:00','2013-10-26 23:00:00',0,NULL,NULL,'Hennie Strydom','hms222@gmail.com','2013-06-22 16:23:35','2013-06-22 16:23:35','0',0,'2013-10-26 07:00:00','2013-10-26 15:00:00'),(20336,178,'6mkc2u460ub74s7ukle0l5njrc_20131026T163000Z',NULL,'Sleep Well','2013-10-26 16:30:00','2013-10-26 23:30:00',0,NULL,NULL,'Smartian Dehradun','smaartdatatest@gmail.com','2013-08-31 07:04:17','2013-08-31 07:04:17','0',0,'2013-10-26 22:00:00','2013-10-27 05:00:00'),(20337,212,'2qk53186vf9g3ggtmvf7tpaf1c',NULL,'in Napa','2013-10-25 16:00:00','2013-10-26 02:00:00',0,NULL,NULL,'David Evans','david@jeditrainers.com','2013-10-04 01:05:59','2013-10-09 17:12:24','0',0,'2013-10-25 08:00:00','2013-10-25 18:00:00'),(20338,212,'f421r79c6kjv40gt4b71uaqlmo',NULL,'Derek\'s going away party','2013-10-26 02:00:00','2013-10-26 07:00:00',0,NULL,NULL,'David Evans','david@jeditrainers.com','2013-10-09 17:14:48','2013-10-11 23:00:58','0',0,'2013-10-25 18:00:00','2013-10-25 23:00:00'),(20339,212,'flgiq2kqo6ctclpitdb5bgtk34',NULL,'Travel','2013-10-25 23:15:00','2013-10-26 00:00:00',0,NULL,NULL,'David Evans','david@jedi