jrromahf4impqg637dqmdoico_20131027T120000Z',NULL,'Craft day plan. Vimbli. ','2013-10-27 13:00:00','2013-10-27 13:30:00',0,' ',NULL,'Hennie Strydom','hennies@gmail.com','2013-08-04 23:28:55','2013-09-08 11:51:34','0',0,'2013-10-27 05:00:00','2013-10-27 05:30:00'),(20400,207,'or81dmh13i3ht9d483plrq0usg',NULL,'Taxi info','2013-10-26 00:30:00','2013-10-26 01:30:00',0,'A taxi to/from the airport to the Westin/Sheraton is ~$35-40 each way. The hotels are approximately 10-15 minutes from Cabo San Lucas and 10-15 minutes from San Jose del Cabo. Taxis are available 24 hours at the hotel.\nTaxis between the Sheraton and the Westin are ~$20 each way.\nIf you feel inclined, rental cars are very reasonably priced, and the roads are easy to drive on. When we travel to Cabo, we rent from the Hertz at the airport, and it usually runs ~$20-30/day. Note:  It is important to book your car ahead of time online to get a good rate.\nOn Friday evening, we will be providing a one-way shuttle from the Westin to the Sheraton for the Welcome Reception departing ~4:30 p.m.  We will be asking for an RSVP for this closer to the wedding date.\nOn Saturday evening, we will be providing a one-way shuttle from the Sheraton to the Westin for the Western Ceremony departing ~4:15 p.m.  We will be asking for an RSVP for this closer to the wedding date.  ',NULL,'Tom Rikert','tom@a16z.com','2013-10-19 17:24:08','2013-10-19 17:24:08','0',0,'2013-10-25 16:30:00','2013-10-25 17:30:00'),(20401,207,'3nnf82lsuouj9p2sf9k4i42lcs',NULL,'Wedding events','2013-10-26 18:00:00','2013-10-27 07:00:00',0,'Indian Ceremony\nSaturday, Oct 26, 2013\n10:00am to 11:30am\nWestin Hotel Beach\nWe will have a condensed Indian ceremony on the beach. If you have Indian attire, feel free to break it out! Otherwise, beach formal attire. It will be warm (75-85), so we will have a flavored water station to keep you hydrated but make sure to have your breakfast buffet in the morning as no food will be served. After the ceremony, go & enjoy some pool time before the evening festivities begin!\nWestern Ceremony\nSaturday, Oct 26, 2013\n5:00pm to 5:30pm\nWestin Arrecifes Patio\nA traditional Western ceremony in a beautiful open-air rotunda on a cliff. Formal attire.\nSunset Cocktails\nSaturday, Oct 26, 2013\n5:30pm to 7:00pm\nWestin Arrecifes Terrace\nEnjoy cocktails and hors d\'ouevres on this beautiful terrace overlooking the ocean. It will be just in time for sunset.\nReception\nSaturday, Oct 26, 2013\n7:00pm to 11:30pm\nWestin Arrecifes Restaurant\nEat, drink, and be merry (read: dance!!). Help us make the S&G Wedding a celebration to remember!',NULL,'Tom Rikert','tom@a16z.com','2013-10-19 17:39:29','2013-10-19 17:39:29','0',0,'2013-10-26 10:00:00','2013-10-26 23:00:00'),(20402,207,'a37637gkc6382t3b5p5crghltg',NULL,'Welcome Reception & Beach Bonfire','2013-10-26 00:00:00','2013-10-26 02:00:00',0,'Welcome Reception & Beach Bonfire\nFriday, Oct 25, 2013\n5:00pm to 8:00pm\nSheraton Hacienda Pitahayas Beach\nMexican Hors D\'ouevres (Tacos, Tostaditos, Quesadillas, Mini Burritos) + S\'mores Station. Beer, wine, margaritas, sodas. All invited & toasts welcome!',NULL,'Tom Rikert','tom@a16z.com','2013-10-19 17:39:01','2013-10-19 17:39:35','0',0,'2013-10-25 16:00:00','2013-10-25 18:00:00'),(20403,207,'tjlnbn69v8h6hl08pah7p5b32c',NULL,'Brunch','2013-10-27 17:00:00','2013-10-27 19:30:00',0,'Brunch\nSunday, Oct 27, 2013\n9:00am to 11:30am\nWestin Courtyard by La Cascada Restaurant\nThis will be an informal way to wrap-up our wedding weekend together. For those guests staying at the Westin, as brunch is included in your room rate, you simply need to grab your brunch from the existing buffet and join us in a special reserved section overlooking the Sea the Cortez.',NULL,'Tom Rikert','tom@a16z.com','2013-10-19 17:40:09','2013-10-19 17:40:09','0',0,'2013-10-27 09:00:00','2013-10-27 11:30:00'),(20404,207,'sm7vu00v3ajj2fqmg0ho4muo1c',NULL,'Organize Cabo trip','2013-10-19 18:00:00','2013-10-19 19:00:00',0,NULL,NULL,